('SMP', 'Sekolah / Madrasah DIY', 20403244, '214/BH', '0000-00-00', 'JL. KAPAS II NO 7/A UMBULHARJO YOGYAKARTA', 'SEMAKI', 90, 5, '0274 564136', 'informasi_mucil@yahoo.co.id', 'www.smpmuh2yk.s', 'A', '21.01/BAP-SM/TU/XII/2013', 'Kurikulum ', 'VISI SMP MUHAMMADIYAH 2 YOGYAKARTA "Terbentuknya manusia muslim, takwa, cerdas, terampil, berwawasan lingkungan dan budaya INSERT INTO `profil` (`jenjang`, `nama_sekolah`, `npsn`, `sk_pendirian`, `tgl_pendirian`, `alamat`, `kel`, `kec`, `kab`, `telepon`, `email`, `web`, `akreditasi`, `sk_akreditasi`, `kurikulum`, `visi`, `misi`, `tujuan`, `moto`, `koordinat_long`, `koordinat_lat`, `listrik`, `akses_internet`) VALUES
('SMA', 'Sekolah / Madrasah DIY', 20402800, '3650/II.149/DIY.78/7', '1979-08-19', 'JL. Kedunggong Wates,Wates,Kulon Progo', 'WATES', 60, 3, '0274 774646', 'smamuhwateskp@yahoo.co.id', 'www.smamuhwates', 'A', '16.01/BAP-SM/TU/X/2014', 'KTSP ', 'visi sekolah SMA Muhammadiyah Wates adalah Terdidik,Tangguh,Ilmiah,Islami dan Berbudaya', '1.Meningkatkan mutu lulusan yang berwawasan global,2. Menumbuhkan semangat keunggulan dan mampu bersaing,3.Membentuk kader Muhammadiyah yang militan dan intelek,4.Menumbuhkembangkan sikap ilmiah,5.Membiasakan hidup secara alami,6.Menjadi teladan dimanapun berada,7.Mengembangkan jatidiri peserta didik sesuai minat,bakat dan potensinya,8.Menghargai,Melestarikan,dan mengembangkan budaya bangsa.', '1. Mendorong dan membantu setiap peserta didik untuk mengenali potensi dirinya,2.Melaksanakan pembelajaran dan bimbingan secara efektif dan efisien,3.Menggalakan 3 Tertib yaitu Tertib Waktu,Tertib Administrasi,TertibKerja,Belajar dan Beribadah,4.Membekali peserta didik dengan ilmu penetahuan dan teknologi,5.Membekali peserta didik dengan ketrampilan hidup,6.Memberi kesempatan berorganisasi dan kegiatan-kegiatan positif untuk membentuk karakter,7.Mampu menjuarai bidang akademis maupun non akademis minimal tingkat kabupaten,8. Membiasakn bertindak dan bekerja secara ilmiah,9.Menumbuhkan penghayatan terhadap ajaran agama islam secara nyata dalam kehidupan sehari hari,10.Menciptakan kondisi lingkungan yang islami,11.Mengenakan,mendidik dan melatihaneka cabang olahraga dan kesenian yang adiluhung,11.Meningkatkan apresiasi terhadap budaya bangsa,12.Menigkatkan pemahaman wawasan global untuk mengahadapi masa depan.', '', '-78,683', '1,101,515', '5000', '30'),
('SMP', 'Sekolah / Madrasah DIY', 20402733, '3130/M-644/DIY-56/77', '2016-01-01', 'JL. SAYANGAN', 'BANJARARUM', 51, 3, '8101509554', 'muh1ka@yahoo.co.id', 'www.smpmuh1kali', 'A', 'no sk akreditasi', 'KTSP', 'Terbentuknya manusia terdidik yang mandiri, terampil, berwawasan IMTAQ dan IPTEKS', '1. Meningkatkan pembelajaran berwawasan imtaq. 2. Mengefektifkan proses pembelajaran di kelas dan di luar kelas. 3. Melaksanakan kegiatan kompetisi akademik dan non akademik. 4. Meningkatkan standar kelulusan secara bertahap. 5. Meningkatkan profesionalisme guru dan tenaga kependidikan. 6. Meningkatkan kualitas ketrampilan hidup/ Life skill / berwirausaha. 7. Melengkapi sarana dan prasarana sekolah sesuai dengan SNP. 8. Mengembangkan pembelajaran berbasis ipteks. 9. Memantapkan pelaksanaan program manajemen berbasis sekolah (MBS). 10. Mengembangkan budaya bersih sehingga menumbuhkan kesadaran arti pentingnya kebersihan lingkungan (7K).', '1. Sekolah mampu meningkatkan kalitas standar kelulusan. 2. Sekolah mampu meningkatkan kualitas kegiatan non akademik. 3. Sekolah mampu meningkatkan kepercayaan masyarakat. 4. Sekolah mampu menghasilkan Kurikulum yang memenuhi standar. 5. Sekolah mampu menghasilkan silabus RPP semua mata pelajaran. 6. Sekolah mampu menerapkan pembelajaran saintifik. 7. Sekolah memiliki tenaga pendidik dan kependidikan yang handal. 8. Sekolah memiliki sarana yang lengkap. 9. Sekolah mampu membudayakan perilaku yang mencerminkan kecintaan terhadap lingkungan hidup. 11. Sekolah mampu membudayakan perilaku yang mencerminkan ketakwaan terhadap Tuhan YME. 12. Sekolah mampu membudayakan pembiasaan 7 S.', '', '-7,716,993', '110,225,935', '4500', ''),
('SMP', 'Sekolah / Madrasah DIY', 20402722, '0277/H/1986', '2016-01-01', 'Duwet', 'BANJARHARJO', 51, 3, '6290000000000.0', 'smpmuhaklbw@yahoo.co.id', 'www.....', 'B', 'Dp.018563', 'KTSP', 'visi misi sekolah SMP Muhammadiyah 2 Kalibawang adalah Unggul dalam Imtaq dan Prestasi', 'Menumbuhkan penghayatan terhadap pengamalan agama yang dianut.', '1.Â Â Â Â Â Â  Sekolah memiliki Kurikulum Tingkat Satuan Pendidikan sebagai pedoman pelaksanaan pembelajaran.', 'Hari Ini harus lebih baik dari kemarin.', '-76,934', '1,102,604', '1300', ''),
('SMP', 'SMA 1', 20402721, 'E.4/188/PPK/1981', '1981-11-14', 'TEGIRI 2', 'HARGOWILIS', 52, 3, '', '', '', 'C', '19.01/BAP/TU/XII/2007', 'KTSP', '1.membentuk manusia muslim yang taat dan sholeh/ sholekhah   2. meningkatkan peserta didik agar terampil dalam berkarya dan pandai memanfaatkan peluang    3. meningkatkan prestasi peserta didik agar terampil dalam berkarya dan pandai memanfaatkan peluang   4. melaksanakan pembinaan peningkatan ibadah sholat, puasa dan membaca alquran  5. melaksanakan pembelajaran efektif dan efisien   6. melaksanakan kegiatan pengembangan diri   7. melaksanakan pembinaan disiplin dan tanggung jawab', 'Terwujudnya refleksi iman dan taqwa dalam akhlakulkarimah, cerdas, terampil, berbudaya, sehat jasmani dan rohani serta mandiri.', '1. mempunyai perilaku positif atas dasar iman dan taqwa terhadap Tuhan YME. 2. Mempunyai sifat terbuka, kreatif, dan tanggap terhadap kemajuan iptek.   3. mempunyai pola pikir dan emosional yang matang.  4. mempunyai kemampuan berkompetensi dalam bidang ilmu pengetahuan.  5. mampu memecahkan permasalahan kehidupan yang dihadapi     6.  mampu melanjutkan  ke jenjang pendidikan yang lebih tinggi.', '', '-7,823', '1,100,988', '1400', ''),
('SMP', 'Sekolah / Madrasah DIY', 20402709, '23628/MPK/76', '1974-07-24', 'TLOGOLELO', 'HARGOMULYO', 52, 3, '-', 'smpm3kkp@yahoo.co.id', '-', 'B', '10.01/BAP.SM/TU/XI/2012', 'KTSP', 'Terwujudnya Pelajar MuslimBerakhlak Mulia, Terampil, dan Berprestasi dalam Ilmu Pengetahuan dan Teknologi, Berpedoman Pada Al-Qur an dan Sunnah.', '1.Â Â Â  Mewujudkan insan yang beriman dan bertakwa terhadap Tuhan Yang Maha Esa;', '1. Memenuhi pendidikan yang bermutu, efisien, dan relevan serta daya saing yang tinggi yang berwawasan Islami;', 'Islami, Berprestasi', '-78,681', '1,100,537', '900', '15'),
('SMP', 'Sekolah / Madrasah DIY', 20402736, '0910/H/1986', '1986-09-01', 'JARAKAN', 'KEBONHARJO', 57, 3, '', 'smpmuh1samigaluh@yahoo.co.id', '', 'B', '10.01/BAP-SM/TU/XI/2012', 'KTSP ', 'Mewujudkan manusia muslim beriman, bertaqwa, berilmu, sehat jasmani rohani dan unggul dalam NEM', '1. Meningkatkan pengamalan ajaran Islam dan akhlaqul karimah secara optimal, 2. Melaksanakan pembelajaran dan bimbingan secara efektif dan efisien, 3. Mendorong dan membantu setiap peserta didik untuk mengenali potensi dirinya, 4. Meningkatkan keterampilan akademik dan non akademik, 5. Meningkatkan sumber daya peserta didik, pendidik dan tenaga kependidikan, 6. Meningkatkan disiplin dan etos kerja yang tinggi, 7. Meningkatkan mutu pelayanan, 8. Menumbuhkan semangat apresiasi seni, olahraga dan iptek pada seluruh warga sekolah, 9. Menjalin kerja sama yang harmonis antarwarga sekolah dan lingkungan terkait, 10. Menumbuhkan sikap dan pola hidup berbudaya lingkungan yang sehat, bersih dan nyaman', '1. Meletakan dasar kecerdasan, pengetahuan, kepribadian, akhlak mulia, serta keterampilan untuk hidup mandiri dan mengikuti pendidikan lebih lanjut.', '', '-76.965', '1,101,405', '900', '30'),
('SMP', 'Sekolah / Madrasah DIY', 20402707, '018/SP/P/U/L-K/79', '1979-08-01', 'NGARAN III, BANJARSARI, SAMIGALUH, KULON PROGO', 'BANJARSARI', 57, 3, '', 'smpmuh2_samigaluh@yahoo.co.id', 'www.....', 'B', '16.02/BA-SM/TU/X/2014', 'KTSP', 'Terbentuknya Peserta Didik Yang Berkualitas,', 'Menyelenggarakan kegiatan belajar mengajar secara efisien dan efektif', '90% siswa tamatan SMP Muhammaadiyah 2 Samigaluh mampu mengoperasikan komputer terutama ms. Word', '', '-7,717,300', '110,179,000', '900', '30MBPS'),
