('SMP', 'Sekolah / Madrasah DIY', 20402708, '0277/H/1986', '2016-01-01', 'BLIMBING', 'SUKORENO', 58, 3, '', 'smpmuh2sentolo@yahoo.co.id', '', 'A', '10.01/BAP.SM/TU/11/2012', 'KTSP', 'visi misi sekolah SMP Muhammadiyah 2 Sentolo adalah Terwujudnya Pendidikan Islami, beriman dan bertaqwa, berprestasi di bidang ilmu pengetahuan dan tekhnologi serta berbudaya', '1. Mengembangkan SDM pendidik dan tenaga kependidikan, 2. Mengembangkan pembelajaran dan bimbingan siswa secara intensif sehingga berprestasi di bidang Ilmu Pengetahuan dan Tekhnologi, 3. Membentuk siswa berkepribadian muslim beriman dan bertaqwa, 4. Membentuk siswa sebagai kader Muhammadiyah, 5. Mengembangkan peserta didik dalam kepanduan HW, bidang olahraga dan seni', '1. Membentuk manusia muslim yang sholeh, berakhlak mulia, beriman dan bertaqwa dan mampu mengembangkan syiar Islam, 2. Terpenuhinya Standar Minimal dari 8 SNP, 3. Siswa trampil dalam berkarya dan pandai memanfaatkan peluang, 4. Memiliki prestasi akdemik dengan nilai UNAS 6,75 untuk 4 mata pelajaran, 5. melatih siswa agar trampil mengoperasikan komputer, 6. membentuk grup drumband yang handal, 7. memiliki siswa yang berprestasi di bidang tapak suci di tingkat Propinsi, 8. memiliki regu Pandu HW yang ikut dalam Jambore Nasional, 9. Memiliki ciri khas berbusana muslim dan menjalankan ibadah sholat Dzuhur berjamaah di sekolah, 10. Menjadikan SMP Muhammadiyah 2 SEntolo sebagai sekolah yang memiliki budaya, karakter dan berwawasan kesetaraan gender', 'Berkarakter cerdas dan berbudaya Islami', '-7,858,662', '110,216,732', '3000', '30'),
