('SMK', 'Sekolah / Madrasah DIY', 20402840, '0135/I13/MN/Kpts/97 ', '1997-05-16', 'JL. Wates-Purworejo KM. 10, Temon Kulon,  Temon,', 'TEMON KULON', 59, 3, '0274 6472513', 'smk.mutu@yahoo.com', 'www.....', 'A', '16.01/BAP-SM/TU/X/2014', 'KTSP', 'Membentuk Sumber Daya Manusia Yang Islami,Mandiri dan Berprestasi', '1.Mewujudkan pembelajaran yang Qur''ani, 2.Melaksanakan Kegiatan keterampilan dan kewirausahaan,3.Melaksanakan kerjasama dengan DU/DI,4.Melaksanakan pembinaan kedisiplinan siswa,5.Melaksanakan pengembangan bakat siswa,6.Melaksanakan pembelajaran sesuai dengan relevansi kompetensi kerja', '1.Membentuk karakter lulusan yang berilmu amaliah dan beramal ilmiah,2.Memiliki kompetensi kerja sesuai kebutuhan DU/DI atau berwirausaha,3.Membentuk Lulusan yang kompetitif di bidangnya', '', '-788,654', '11,007,589', '>15000', '2'),
('SMK', 'Sekolah / Madrasah DIY', 20409840, '421/086/Kpts/2010', '2010-06-03', 'Sewugalur, Karangsewu, Galur', 'KARANGSEWU', 50, 3, '82137893988', 'smkdu.galur@gmail.com', 'www.....', 'B', '22.01/BAP-SM/TU/X/2015', 'KTSP ', 'visi misi SMK Darul Ulum Muhammadiyah Galur adalah Terwujudnya Generasi Islami yang terampil, unggul dan mandiri (GENITUM)', '1. Memberikan pelayanan pendidikan Islam yang menekankan pada aspek kekuatan aqidah Islamiyah, Akhlakul Karimah, Tafaquh fiddin dan IPTEK.\n2. Menyelenggarakan pendidikan ketrampilan dan kewirausahaan yang bermanfaat bagi kehidupan.\n3. Meningkatkan kualitas tenaga pendidik yang profesional.\n4. Meningkatkan pelayanan administrasi bagi seluruh komponen pendidikan.\n1. Memberikan pelayanan pendidikan Islam yang menekankan pada aspek kekuatan aqidah Islamiyah, Akhlakul Karimah, Tafaquh fiddin dan IPTEK.\n2. Menyelenggarakan pendidikan ketrampilan dan kewirausahaan yang bermanfaat bagi kehidupan.\n3. Meningkatkan kualitas tenaga pendidik yang profesional.\n4. Meningkatkan pelayanan administrasi bagi seluruh komponen pendidikan\n', 'Pendidikan di Sekolah Menengah Kejuruan (SMK) Darul Ulum Muhammadiyah Galur, Kulon Progo, DI Yogyakarta bertujuan untuk:\n1. Mencapai tujuan Pendidikan Muhammadiyah, yaitu:\na. Terwujudnya manusia muslim yang bertaqwa, berakhlaq mulia, cakap, percaya pada diri sendiri, cinta tanah air dan berguna bagi masyarakat dan Negara, beramal menuju terwujudnya masyarakat adil dan makmur yang diridlai Allah SWT\nb. Memajukan dan mengembangkan ilmu pengetahuan dan ketrampilan untuk kemajuan umat dalam pembangunan masyarakat.\n2. Menyiapkan calon kader bangsa yang unggul melalui persyarikatan Muhammadiyah. \n3. Memberikan keterampilan dan ilmu pengetahuan guna membekali siswa menuju kemandirian hidup dan untuk mengembangkan diri sejalan dengan ilmu pengetahuan dan teknologi\n', '', '-79,436', '1,102,083', '2300', '512'),
('SMK', 'Sekolah / Madrasah DIY', 20402093, '193/I.13.1/I.82', '1982-12-22', 'Jalan Wonosari - Jogja Km 3, Siyono Wetan, Logande', 'DESA LOGANDENG', 26, 2, '0274 391298', 'muspla@muspla.sch.id', 'www.muspla.sch.', '', '', 'Kurikulum ', 'Terwujudnya lulusan yang unggul dalam prestasi dilandasi Iman dan taqwa.', 'a. Menumbuhkan semangat keunggulan akademis dan non akademis.', 'a. Mewujudkan pribadi yang unggul dalam akademis dan noin akademis.', 'SMK berkemajuan', '-79,517', '1,105,874', '69000', '7'),
('SMK', 'Sekolah / Madrasah DIY', 20402132, '018/I13/H/Kpts/1988', '1988-02-20', 'Jl. Manthous Km 1 Jatisari, Playen, Gunungkidul, Y', 'JATISARI', 26, 2, '0274 392504', 'smkmuha2playen@gmail.com', 'www.smkmuha2pla', 'A', '16.01/BAP-SM/TU/X/2014', 'KTSP', 'TERWUJUDNYA KADER MUSLIM YANG BERTAQWA, BERAKHLAK MULIA, ULET DAN MEMILIKI ETOS KERJA TINGGI', '1) Membangun Budaya Islami di Sekolah. 2) Membangun Budaya Tertib dan Disiplin di Sekolah. 3) Membangun Budaya Positif di Sekolah. 4) Memperkuat Manajemen Berbasis Sekolah dan Masyarakat. 5) Membangun Budaya Industry di Sekolah.', '1) Menyiapkan kader muslim agar menjadi warga Negara yang bertaqwa dan berakhlak mulia. 2) Menyiapkan kader muslim untuk bekerja mandiri atau sebagai tenaga kerja tingkat menengah untuk mengisi lowongan pekerjaan di Dunia Usaha / Dunia Industri. 3) Menyiapkan kader muslim agar menjadi warga Negara yang adaptif, kreatif, produktif dan santun. 4) Menyiapkan kader muslim menjadi warga negara yang berbudaya lingkungan. 5) Menyiapkan kader muslim yang mampu memilih karir, mampu berkompetisi dan mempu mengembangkan diri.', 'SMK MUDA, ISLAMI, BERBUDI, BERPRESTASI', '-79,453', '1,105,573', '22500', '5'),
('SMK', 'Sekolah / Madrasah DIY', 20402131, '3207/N.602/DIY.68/77', '1968-01-15', 'JL. KARANGMOJO-PONJONG KM.0,5', 'KARANGMOJO', 20, 2, '0274 391939', 'smkmuhkarangmojo@yahoo.co.id', 'smkmuhkarangmoj', 'A', '21.01/BAP-SM/TU/XII/2013', 'KTSP', 'Terwujudnya lulusan yang unggul dan islami', '1. Terlaksananya pembelajaran berbasis sains dan teknologi, 2. Terciptanya budaya belajar yang menyenangkan, 3. Terciptanya tradisi islami disekolah dan masyarakat, 4. Tersedianya lulusan yang mandiri, kreatif dan kompetitif', '1. Mencetak lulusan siap kerja di industri dan wirausaha yang profesional,handal berakhlak mulia. Untuk mlanjutkan kuliah juga bisa.', 'SantunÂ Mandiri dan berprestasiÂ AgamisÂ Rela berkorbanÂ Tegar', '-79533', '1,103,491', '25000', '7'),
('SMK', 'Sekolah / Madrasah DIY', 20402134, '0146/II3/MN/Kpts/199', '1998-12-05', 'JL. Yogya Wonosari Km. 23, 7, Putat, Patuk, Gunung', 'PUTAT', 25, 2, '85868225111', 'smk_muh1patuk@yahoo.co.id', 'www.....', 'B', '21.01/BAP-SM/TV/XII/2013', 'KTSP ', 'Menjadi Sekolah unggulan dalam menyiapkan tenaga kerja dan wirausaha baik tingkat lokal, nasional, maupun global yang dilandasi keimanan, ketaqwaan terhadap Allah SWT.', '1. Menyelenggarakan pendidikan dan pelatihan sesuai standar pemerintah dan persyarikatan Muhammadiyah.                  2. Memberi nilai-nilai tambahan sesuai peluang/ pasar baik lokal, nasional, maupun global.                                               3. membuka cakrawala untuk siswa dapat melihat peluang dan berkembang mengikuti tuntutan dnia kerja/ industri.                  4. meningkatkan keunggulan kompetitif dalam bidang Teknik Informatika, Akuntansi, Teknik Otomotif Sepeda Motor dan Teknik Audio Video.                                                                             5. Menyiapkan kerjasama dengan DU/DI.                                                                          6. Mencetak kader Muhammadiyah yang cakap dan berakhlaklul kharimah.', '1.Menyiapkan teaga yang siap pakai, melalui pendidikan yang terstandar, kerjasama dengan DU/DI dan pemberian nilai tambah berupa penguasaan TI dan Bahasa Inggris                                   2. Menghasilkan lulusan dengan kompetensi yang sesuai dengan standar pemerintah, masyarakat Muhammadiyah, tuntutan pasar lokal, nasional, maupun global, mamp berwirausaha secara mandiri serta siap untuk terus mengembangkan diri secara otodidak, belajar dalam komunitas/ rekan profesi ataupun study lanjut d Perguruan Tinggi.', 'Cerdas, Terampil, Berakhlaq Mulia', '-78,693', '1,105,197', '9000', '4Mbps'),
