('SMK', 'Sekolah / Madrasah DIY', 20402129, '004/II.3/MN/KPTs/97', '1997-03-22', 'PRIGI,SIDOHARJO,TEPUS', 'SIDOHARJO', 34, 2, '87739714680', 'smkmuhtepus@yahoo.com', 'http://www.smkm', '', 'A', 'KTSP ', 'MEWUJUDKAN LULUSAN YANG ISLAMI , SIAP BEKERJA , UNGUL DALAM PRESTASI', '1. MENGEMBANGKAN BUDAYA ISLAMI DI SEKOLAH 2. MEMBANGUN BUDAYA KEWIRAUSAHAAN DI SEKOLAH 3. MEMBANGUN BUDAYA INDUSTRI DI SEKOAH 4. MENGEMBANGKAN DIKLAT BERORIENTASI KEBUTUHAN PASAR KERJA ( DU/DI ) 5. MEMBANGUN JEJARING KERJASAMA DENGAN DU/DI 6. MELAKSANAKAN KBM YANG BERKUALITAS', '1. MENYIAPKAN SISWA MENJADI MANUSIA YANG BERTAQWA BERAKLAK MULIA CINTA TANAH AIR DAN LOYAL TERHADAP MUHAMADIYAH 2. MENYIAPKAN SISWA MENJADI TENAGA KERJA TINGKAT MENENGAH UNTUK MENGISI KEBUTUHAN DU/DI 3. MENYIAPKAN SISWA MENJADI WIRAUSAHAWAN BARU 4. MENYIAPKAN SISWA YANG BERPRESTASI BAIK AKADEMIK MAUPUN NON AKADEMIK', 'ISLAMI SIAP KERJA DAN KOMPETITIF', '-80,782', '1,106,247', '1500', '4'),
