('SMK', 'Sekolah / Madrasah DIY', 20407359, '1354/I.4/B/2016', '2016-07-22', 'Komplek Masjid Kota Kec. Ngawen Gunungkidul', 'KAMPUNG', 21, 2, '85293393460', 'smkmuh1ngawen@gmail.com', '', 'B', '16.01/BAP-SM/TU/X/2014', 'KTSP', 'Terwujud Sumber Daya Manusia yang bertaqwa, berakhlak mulia dan memiliki Intelektual, Ketrampilan, Kemandirian, Profesional, serta siap memasuki dunia industri', '1. Membentuk manusia yang memiliki Iman dan taqwa yang kuat dan berakhlakul karimah.', '1. Meningkatkan pengamalan agama Islam sesuai dengan ajaran Muhammadiyah (Al Qur''an dan Sunnah).', '', '-78,374', '1,107,009', '5000', '2'),
('SMK', 'Sekolah / Madrasah DIY', 20407434, '4048/II-208/DIY-82/1', '1984-03-01', 'RT 03,  RW 01, KERDONMIRI', 'KARANGWUNI', 29, 2, '85229783335', 'smkmuhiro@gmail.com', 'www.....', 'B', 'no sk akreditasi', 'KTSP ', 'Terwujudnya sekolah yang bermutu dalam IPTEk dan IMTAQ dengan mengedepankan akhlaq yang mulia', '1. Menyelenggarakan kegiatan pmbelajaran secara efektif.                      2. Memanfaatkan hasil - hasil teknologi dalam kegiatan pembelajaran.                3. Menumbuhkan semangat keunggulan jiwa mandiri, kompetensi sehat,tanggung jawab dan kepedulian sekolah.                4. Menggiatkan aktifitas keagamaan di lingkungan sekolah dan masyarakat.       5. Memberikan pendidikan dan pelatihan ketrampilan / kecakapan hidup di bidang teknologi, sehingga siswa memiliki kompetensi tinggi mampu bersaing dipasar kerja.', '1.............2.................3...........', '', '-80.762', '1,107,632', '2300', '6'),
('MTS', 'Sekolah / Madrasah DIY', 20411976, '4.580/II/1992/DIY84/', '1985-12-03', 'Jl. Baron, Km 13 Dilatan, Monggol, Saptosari, Gunu', 'MONGGOL', 30, 2, '-', 'Email sekolah', 'www.....', 'B', '21.01.BAP-SM/TU/XII/2013', 'KTSP dan K', 'Terwujudnya Madrasah Teladan', '1. Usaha sungguh - sungguh dan ikhlas untuk menjadi insan berkharakter dan berakhlak yang baik.\n', '1. Membentuk pribadi yang bertaqwa, berakhlak mulia, dan bertanggungjawab.\n', '', '1,105,529,328', '-77,802', '900', '1000'),
('MTS', 'Sekolah / Madrasah DIY', 20411959, 'E-4/216/XI/1979', '1979-11-06', 'Kampungkidul RT 03 RW 02, Komplek Masjid Besar Kec', 'KAMPUNG ', 21, 2, '81804251911', 'mtsmuhngawen@yahoo.co.id', 'www.....', 'B', 'Dp.011972', 'KTSP dan K', 'Terciptanya Suasana Islami dan Berakhlaqul Karimah, Unggul dalam Prestasi dean Berwawasan IPTEK', '1)Meningkatkan pengamalan ajaran Islam dan akhlaqul karimah dalam kehidupan sehari hari  2)Meningkatkan pelaksanaan pembelajaran dan bimbingan secara effektif, komprehensif dan integralistik  3)Mendorong dan membantu setiap peserta didik untuk mengenali potensi dirinya 4)Meningkatkan ketrampilan akademik dan non akademik  5)Meningkatkan sumber daya peserta didik, pendidik dan tenaga kependidikan 6)Meningkatkan disiplin, etos kerja yang tinggi dan pelayanan prima 7)Menerapkan penguasaan IPTEK dengan melibatkan seluruh warga sekolah 8)Menjalin kerjasama yang harmonis antar warga madrasah dan lingkungan terkait 9)Mengembangkan potensi seluruh warga sekolah untuk mencapai keunggulan dalam kegiatan pembelajaran', '1.............2.................3...........', '', '110,700,943', '-7,837,409', '1300', '54'),
('MTS', 'Sekolah / Madrasah DIY', 20411973, 'E-4/215/XI/1979', '1979-11-06', 'PADANGAN', 'PONJONG', 27, 2, '081 704 286 50', 'mtsmuhammadiyahponjong@yahoo.c', '', 'B', '28.2/BAP/TU/X/2011', 'KTSP dan K', 'visi misi sekolah MTS Muhammadiyah Ponjong adalah Membentuk tamatan yang berakhlak mulia dan berprestasi.', '1. Meningkatkan penghayatan dan pengamalan ajaran Agama Islam. 2.Membudayakan perilaku agama dalam kehidupan sehari-hari 3.Melaksanakan pembelajaran dan bimbingan secara efektif dan efisien. 4.Menyiapkan siswa untuk masuk ke jenjang sekolah yang lebih tinggi dengan nilai UN yang memuaskan. 5.Mewujudkan hubungan dengan masyarakat dengan memfungsikan komite Madrasah demi meningkatkan kualitas pendidikan', '1.Membekali siswa dengan ajaran Agama Islam. 2.Membiasakan diri mengamalkan ajaran Agama Islam dan berakhlakul karimah. 3.Meningkatkan prestasi akademik maupun non akademik. 4.Tercapainya perolehan nilai UN dan UMAD lebih dari 7.00. 5.Terciptanya hubungan yang harmonis dan saling memberikan kontribusi antara Madrasah, Komite, dan Masyarakat.', 'Berakhlak dan Berprestasi', '-7,984,539', '11,071,353', '1300', '128'),
('MTS', 'Sekolah / Madrasah DIY', 20411978, '4.579/II-191/DIY-94/', '1996-01-04', 'KOMPLEKS MASJID MUJAHIDIN', 'SEMANU', 31, 2, '', 'mts_muhsemanu@yahoo.co.id', '', 'A', '28.2/BAP/TU/X/2011', 'KTSP dan K', 'TERWUJUDNYA INSAN YANG BERAKHLAK MULIA SESUAI TUNTUNAN ISLAM, BERPRESTASI, UNGGUL, DAN MEMILIKI KECAKAPAN HIDUP', '1. Membiasakan perilaku sesuai ajaran Islam dalam kehidupan sehari-hari, 2. Memotivasi dan meningkatkan pembelajaran siswa agar berprestasi, 3. Menumbuhkembangkan bakat dan minat siswa secara optimal, 4. Membekali siswa dengan keterampilan melalui kegiatan intrakurikuler dan ekstrakurikuler.', '1. Semua warga madrasah dapat menjalani hidup sesuai dengan syariat Islam seperti yang dicontohkan oleh Nabi Muhammad SAW, 2. Siswa dapat berprestasi baik dibidang akademik maupun non akademik, 3. Bakat dan minat siswa berkembang dengan baik sehingga memiliki bekal hidup untuk meraih masa depan yang gemilang, 4. Siswa dapat melanjutkan ke jenjang lebih tinggi dan memiliki keterampilan hidup.', 'Berakhlak Mulia, Tekun Beribadah, Berprestasi', '110,648,028', '-778,013', '1300', '0'),
('MTS', 'Sekolah / Madrasah DIY', 20411963, '56/MTs/GK/86', '1986-07-15', 'JALAN KI AGENG GIRING', 'SODO', 23, 2, '81904228426', 'mtsmuhammadiyahsodo@yahoo.co.i', '0', 'A', '12.1/BAP/TU/XI/2010', 'KTSP dan K', 'Islami, Berprestasi, dan Berbudaya Positif', '1. Memupuk dan memelihara keimanan dan ketaqwaan melalui rutinitas tadarus Al Qur an, shalat wajib dan shalat sunah 2. Menjadikan para siswa aktif dalam belajar dan berlatih untuk mencapai prestasi dan berketrampilan serta kemampuan yang maksimal.  3. Membiasakan warga madrasah selalu menjunjung tinggi nilai budaya dengan menghargai kreasi cipta karya siswa  dan guru / karyawan.', 'Memiliki lulusan madrasah yang unggul dalam menjalankan syariat islam, berprestasi dalam bidang akademik serta mampu menjunjung nilai- nilai budaya yang positif', 'MASAMUDO Santun dan Berwibawa', '-8,002,608', '110,560,878', '2200', '1'),
('MTS', 'Sekolah / Madrasah DIY', 20411981, '3678/II.177/DIY.79/1', '1979-08-19', 'JL.ALUN-ALUN BARAT NO.09 WONOSARI GUNUNGKIDUL', 'KEPEK', 35, 2, '0274 392952', 'mtsmuhiwonosari@yahoo.co.id', 'www.mtsmuhwonos', 'A', '12.1/BAP/TU/XI/2010', 'KTSP dan K', 'Religius dan Cendekia', '1. Menyiapkan generasi religius dan cendekia.\n2. Menciptakan Ilmuwan yang Agamis dan Agamawan yang Saintis\n3. Menyelenggarakan pendidikan yang memadukan antara kurikulum Pendidikan Nasional, Muhammadiyah, dan Agama Islam.\n4. Menyelenggarakan pembelajaran yang Inspiratif.\n5. Menyelenggarakan pendidikan yang berbasis budaya.\n6. Menyelenggarakan pendidikan yang berwawasan lingkungan hidup.\n', 'Mengantarkan peserta didik menjadi manusia yang bertaqwa, berakhlakul karimah, berkepribadian, menguasai ilmu pengetahuan dan teknologi, serta mampu mengaktualisasiikan diri dalam kehidupan bermasyarakat, berbangsa dan bernegara.\nDari tiga tujuan pendidikan tersebut dapat dirumuskan tujuan pendidikan MTs Muhammadiyah Wonosari adalah meletakan dasar dan mengembangkan potensi :\n1. Keimanan dan ketaqwaan.\n2. Kepribadian dan akhlakul karimah.\n3. Kecerdasan, ketrampilan, dan kemampuan berbahasa.\n4. Percaya diri, bertanggungjawab, dan mandiri.\n5. Sehat jasmani, rohani, dan social.\n6. Patriotisme  dan kebangsaan.\n7. Mengimplementasikan nilai- nilai budaya dalam kehidupan.\n8. Melestarikan lingkungan hidup.', '"RELIGIUS CENDEKIA"', '-7,963,785', '110,600,299', '7700', '10'),
('MTS', 'Sekolah / Madrasah DIY', 1, '', '0000-00-00', 'PATUK RT 04/ RW 01, PATUK, PATUK, GUNUNGKIDUL', 'PATUK', 25, 2, '6280000000000.0', 'mts.muhammadiyahpatuk@gmail.co', 'www.mtsmuhammad', '', '', 'KTSP dan K', 'Terwujudnya Madrasah yang unggul dalam Imtak, kuat dalam prestasi, terampil dan mandiri.', '1. Menyiapkan generasi religius, berakhlak islami dan cendekia.\n2. Menyelenggarakan pembelajaran yang inspiratif\n3. Menyelenggarakan pendidikan yang memadukan antara kurikulum Pendidikan Nasional, Muhammadiyah, dan Pondok Pesantren.\n4. Menyelenggarakan pendidikan keterampilan.\n5. Melaksanakan misi pengkaderan.\n6. Menyelenggarakan pendidikan yang berwawasan lingkungan hidup.\n', 'Mengantarkan peserta didik menjadi manusia yang bertaqwa, berakhlakul karimah, berkepribadian, menguasai ilmu pengetahuan dan teknologi, serta mampu mengaktualisasiikan diri dalam kehidupan bermasyarakat, berbangsa dan bernegara.\nDari tiga tujuan pendidikan tersebut dapat dirumuskan tujuan pendidikan MTs Muhammadiyah Wonosari adalah meletakan dasar dan mengembangkan potensi :\n1. Keimanan dan ketaqwaan.\n2. Kepribadian dan akhlakul karimah.\n3. Kecerdasan, ketrampilan, dan kemampuan berbahasa.\n4. Percaya diri, bertanggungjawab, dan mandiri.\n5. Sehat jasmani, rohani, dan social.\n6. Patriotisme  dan kebangsaan.\n7. Mengimplementasikan nilai- nilai budaya dalam kehidupan.\n8. Melestarikan lingkungan hidup.', '"RELIGIOUS, SKILLED, AND INTELLECTUAL"', '-78,596,574', '1,105,334,637', '2200', '8'),
('SMP', 'Sekolah / Madrasah DIY', 20401947, '3068/M.638/DIY_74/77', '2016-01-01', 'KARANGSASEM RT 03/02', 'SAMPANG', 18, 2, '6290000000000.0', 'muhammadiyah.sampang@gmail.com', 'www.smp-musage.', 'B', '19.01/BAP/XI/2012', 'KTSP', 'visi misi sekolah SMPMuhammadiyah 1 Gedangsari adalah Unggul Dalam Prestasi , Berwawasan Iptek,\nBerdasarkan Iman dan Taqwa', '1. meningkatkan pengamalan ajaran Islam dan akhlaqul karimah secara optimal 2. melaksanakan pembelajaran dan bimbingan secara efektif dan efisien 3. meningkatkan keterampilan akademik dan non akademik 4. menumbuhkan pola hidup sehat dan berbudaya lingkungan 5. Meningkatkan sarana dan prasarana', '1. meningkatkan pemahaman dan landasan akhlaqul karimah yang merupakan implementasi keimanan dan ketaqwaan 2. menghasilkan pembelajaran yang aktif kreatif, efektif dan menyenangkan 3. memberikan pendidikan yang seimbang (kognitif, afektif dan psikomotor) melalui pembelajaran maupun ekstrakurikuler dan pembiasaan 4. menciptakan lingkungan yang menyenangkan dan nyaman 5. Menyusun RKAS dan merealisasikannya secara transparan dengan prinsip efektif, efisien dan akuntabel', 'Sekolahku jembatan kesuksesanku dunia akhirat', '-78,071', '1,105,749', '2.2', '1'),
('SMP', 'Sekolah / Madrasah DIY', 20401973, '203/SP/P/U/LK/79', '0000-00-00', 'Jln. Mertelu, Gedangsari, Gunungkidul', 'MERTELU', 18, 2, '81328497397', 'Email sekolah', 'www.....', 'B', '25/BAS/DIY/4/09', 'KTSP', 'visi misi sekolah SMP Muhammadiyah 2 Gedangsari adalah : Berprestasi, berwawasan IPTEk berlandaskan Imtaq', '1Menumbuhkan motivasi untuk mendalami,menghayati dan mengamalkan ajaran agama islam dalam kehidupan sehari-hari, 2 melaksanakan PBM yang efektif dan intensif. 3 mensosialisasikan dan menumbuhkan semangat bersaing. 4 memberikan ketrampilan komputer. 5 memberikan ekstrakurikuler BTA. 6 Menciptakan pelayanan prima terhadap siswa,orang tua dan masyarakat. 7 menerapkan manajemen partisipatif dengan melibatkan seluruh warga sekolah sehingga menjadi team work yang solid.', '1 rata-rata peningkataan nilai ujian nasioanl + 0.5 2.jumlah lulusan diterima di SMK/SMA mencapai 30 % 3. 60 % siswa mampu melaksanakan ibadah dengan tekun dan benar 4. 60% siswa mampu membaca al-qur''an dan doa sehari-hari 5.50% siswa mampu mengoperasikan komputer 6.25 % ruang kelas dilengkapi LCD sebagai media pembelajaran di kelas 7.terbangunnya data base profil sekolah 8.terpenuhinya sarana dan prasarana sekolah 9.terpenuhinya tambahan ruang belajar baru 10.memiliki lingkungan yang tertib,bersih,nyaman aman dan kondusif', '', '-78,344', '1,106,051', '2200', '2'),
('SMP', 'Sekolah / Madrasah DIY', 20401977, 'E-1/58/K/GK/1983', '1987-01-01', 'JL.WOTGALIH', 'PILANGREJO', 22, 2, '', 'smpmuhammadiyah1nglipar@gmail.', 'www.....', 'B', '16.01/BAP-SM/TU/X/2014', 'KTSP 2006', 'Berkembangnya potensi siswa menjadi pribadi yang unggul dalam iman dan taqwa, ilmu pengetahuan dan teknologi, terampil dan mandiri serta berakhlak mulia.', '1. Melaksanakan PBM yang konduktif', '1. Terbentuknya manusia yang beriman dan bertaqwa serta berahlak mulia', '', '-78.572', '1,106,476', '900', '30'),
('SMP', 'Sekolah / Madrasah DIY', 20401981, '0277/H/1986', '1983-07-01', 'JL.BINA KOTA , NGLIPAR', 'NGLIPAR', 22, 2, '', 'smpmuh2nglipar@gmail.com', 'www.....', 'A', '16.01/BAP/SM/TU/X/2014', 'KTSP 2006', 'BERKEMNGNYA POTENSI SISWA MENJADI PRIBADI YANG TAQWA, BERPRESTASI DAN TERAMPIL', '1.MELAKSANAKAN PBM YANG EFEKTIF DAN KONDUKTIF', '1. TERBENTUKNYA MANUSIA YANG BERBUDI LUHUR, BERTAQWA SERTA BERAKHLAK MULIA,', '', '-79,023', '1,106,161', '2200', '30'),
('SMP', 'Sekolah / Madrasah DIY', 20401974, '3202/M.675/DIY.74/77', '1974-06-24', 'GROGOL', 'GROGOL', 23, 2, '6280000000000.0', 'smpmuhammadiyah1paliyan@gmail.', '', 'B', '04.03.017.09', 'KTSP', 'mulia dalam akhlak, berprestasi, berwawasan iptek, berlandaskan imtaq, dan peduli lingkungan', '1. meningkatkan keimanan dan ketakwaan terhadap Tuhan Yang Maha Esa; 2. menumbukan penghayatan teradap agama dan budaya bangsa sehingga menjadi sumber kearifan dalam bertindak; 3. menumbuhkan akhlak mulia (budi pekerti luhur); 4. melaksanakan PBM yang efektif dan intensif untuk mengoptimalkan potensi siswa; 5. meningkatkan prestasi akademik dan non akademik; 6. meningkatkan mutu lulusan; 7. mengembangkan kemampuan bidang olahraga; 8. meningkatkan kualitas lingkungan yang indah, bersih, nyaman, dan aman', '1. sekolah mampu melaksanakan program baca tulis Al-Quran (TPA/BTA) oleh siswa yang beragama Islam; 2. sekolah mampu melaksanakan berbagai program kegiatan keagamaan seperti: pembiasaan sholat dhuha, sholat dhuhur berjamaah, sholat Jum''at berjamaah, Pesantren Kilat,/Ramadhan, dan pringatan hari besar keagamaan; 3. sekolah mampu melaksanakan program 5 S (salam, salim, senum, sapa, dan santun) dalam rangka menumbuhkan akhlak mulia; 4. sekolah mampu melaksanakan pembelajaran aktif inovatif kreaif dan menyenangkan; 5. sekolah mampu mencapai tingkat kelulusan 100% dengan rata-rata nilai ujian 6,0; 6. sekolah mampu meningkatkan persentase lulusan yang diterima di sekolah negeri (SMA/SMK/MA) sekurang-kurangnya 90% dari lulusan; 7. sekolah mampu melaksanakan kegiatan pengembangan diri/ eksra kurikuler secara efektif guna melaksanakan pengembangan bakat siswa; 8. sekolah mampu melaksanakan berbagai kegiatan lomba antar warga sekolah; 9. sekolah mampu melakukan berbagai kegiatan penataan dan pembersihan lingkungan; 10. sekolah mampu mengelola sampah di sekolah menjadi lebih bermanfaat.', '', '-8', '111', '2200', '3'),
('SMP', 'Sekolah / Madrasah DIY', 20401980, '3195/M.668/DIY.75/77', '1977-09-01', 'Jl.Paliyan - Playen, karangduwet, Paliyan, Gunungk', 'KARANGDUWET', 23, 2, '81227099580', 'semmudapaliyan@yahoo.co.id', '', 'A', '16.01/BAP.SM/TU/X/2014', 'KTSP', 'visi misi sekolah SMP Muhammadiyah 2 Paliyan adalah TERWUJUDNYA SEKOLAH YANG MENGHASILKAN LULUSAN BERIMAN, BERPRESTASI, DAN MANDIRI INSERT INTO `profil` (`jenjang`, `nama_sekolah`, `npsn`, `sk_pendirian`, `tgl_pendirian`, `alamat`, `kel`, `kec`, `kab`, `telepon`, `email`, `web`, `akreditasi`, `sk_akreditasi`, `kurikulum`, `visi`, `misi`, `tujuan`, `moto`, `koordinat_long`, `koordinat_lat`, `listrik`, `akses_internet`) VALUES
('SMP', 'Sekolah / Madrasah DIY', 20407328, '0200/H/1986', '1986-05-01', 'Jl. WONOSARI- PALIYAN KM.4', 'WARENG', 35, 2, '81328651158', 'smpmuhduawonosari@yahoo.com', '-', 'C', '2011', 'KTSP', 'Visi SMP Muh 2 Wonosari adalah beriman, Trampil dan Cerdas', '1.Menyelenggarakan kegiatan peningkatan keimanan, 2. Menyelenggarakan kegiatan pembekalan life skill batik dan menjahit, 3. Melaksanakan kegiatan pembelajaran yang efektif, efisien,  inovatifdan menyenangkan, 4. Melaksankan pembinaan kegiatan ekstrakurikuler atau pengembangan diri, 5. Mengadakan sarana prasarana pembelajaran, 6. Menumbuhkan semangat keunggulan dalam berkarya, 7. Menciptakan lingkungan sekolah yang bersih dan nyaman, 8. Meningkatkan hubungan komunikasi dengan masyarakat dan lembaga, 9. Meningkatkan komitmen stakeholder sekolah.', '1. 100 % warga sekolah beriman, 2. 90 % siswahafal 25 surat pendek dengan benar, 3. 100% warga sekolah berakhlak mulia, 4. 80 % siswa memiliki ketramplan membatik dan menjahit, 5. Menjadi juara 1 Lomba MHQ tk kecamatan, 6. Menjadi juara 2 lomba MTQ tk Kabupaten, 7.menjadi juara 3 lomba lari tk kabupaten,8.  Terlaksananya pembelajaran yang efektif dan menyenangkan, 9. !00 % guru melaksanakan pembelajaran dengan baik dan disiplin, 10. Terwujudnya ruang perpustakaan yang baik, 11. Terciptanya managemen yang efektif, 12. 100 % administrasi sekolah tersusun dengan baik, 13. Meningkatnya animo siswa baru', 'berprestasi dan berakhlak mulai', '-79,875', '1,105,787', '900', '3(tri)'),
