('SMK', 'Sekolah / Madrasah DIY', 20401142, '44/I.13.1/1986', '1985-02-05', 'Sanggrahan Tempel Sleman', 'MOROREJO', 76, 4, '8112650222', 'smkmuh1.tempel@gmail.com', '-', 'A', '5.01/BAP-SM/TU/XI/2016', 'KTSP', 'Akhlaq  Mulia, Cerdas, Terampil dan Kompetitif', '1. Mewujudkan kehidupan islami yang sesuai tuntunan A1-qur an  dan sunnah rasul, 2. Meningkatkan kualitas sumber daya  insani yang  cerdas, terampil, produktif  dan  mandiri, 3. Menumbuhkan kemampuan siswa yang kritis, sistematis, kreatif dan mampu bekerja sama dengan efektif.', 'Menjadikan pendidik yang profesional dan menghasilkan lulusan yang berkualitas', 'Pasti Lebih Lebih Pasti', '-76,581,872.10', '1,103,491', '900  -', '21'),
('SMK', 'Sekolah / Madrasah DIY', 20401140, '3080/N-583/DIY-71/77', '1977-01-09', 'Ngentak', 'SUMBERAGUNG', 69, 4, '0274 6497077', 'smk_muh2moyudan@yahoo.com', '', '', '1. 8.01/BAP-SM/TU/XI/2016    2', 'KTSP dan K', 'Menjadi SMK unggul, kompeten, menguasai iptek dan Islami serta berwawasan global dan lingkungan', '1. Menumbuhkan semangat keunggulan      dan kompetitif pd semua warga sekolah   2. Melaksanakan KBM secara optimal dalam iklim kondusif untuk mencapai keahlian sesuai kompetensi keahlian yang berorientasi nasional dan global 3. Mengembangkan suasana agamis dan budaya bangsa 4. Mengembangkan dengan intensif sekolah dengan Dunia Industri serta 5. Melestarikan lingkungan sekolah dengan mencegah pencemaran lingkungan dan kerusakan lingkungan', '1. Menghasilkan       generasi              profesional di bidangnya           2. Menyiapkan kader Muham   madiyah yang baik', 'Bergerak untuk kemajuan', '-77,712', '1,102,625', '220', '3 mb'),
('SMK', 'Sekolah / Madrasah DIY', 20401175, '0617/I.13/MN/Kpts/19', '1997-06-04', 'Jl. D. Ronggowarsito No. 2 Medari Caturharjo Slema', 'CATURHARJO', 75, 4, '274868419', 'stemuro@ymail.com', '', 'A', '22.01/BAP-SM/TU/X/2015', '2013', 'Menjadikan lulusan yang bertaqwa, cerdas, terampil, mandiri dan berbudaya dalam menghadapi tantangan global', 'Melaksanakan pendidikan dan pengajaran secara efektif, efesien serta inovatif; Meningkatkan kompetensi peserta didik; Mendidik peserta didik agar punya jiwa wirausaha dan berbudaya; Mengembangkan potensi peserta didik secara profesional; Meningkatkan penghayatan dan pengamalan terhadap ajaran Muhammadiyah', 'Penyediaan fasilitas untuk pembelajaran Teknik Kendaraan Ringan dan Teknik Sepeda Motor; Mengusahakan dengan sepenuhnya pelaksanaan kurikulum Tingkat Satuan Pendidikan (KTSP) dan Kurikulum 2013; Memberdayakan seluruh komponen sekolah (stake holder) guna mendukung tercapainya peningkatan ketrampilan di bidang otomotif; Menyiapkan tamatan yang mampu mengembangkan diri secara optimal dilandasi iman dan taqwa', '', '-7,682,293', '110,338,642', '9000', '10'),
('SMK', 'Sekolah / Madrasah DIY', 20401174, '074/113/H/KPTS/1995', '1995-04-18', 'GENDOL', 'SUMBER REJO', 76, 4, '0274 7169855', 'smkmuhammadiyah2tempel@yahoo.c', '', 'A', '16.01/BAP-SM/TU/X/2014', 'KTSP', 'Terwujudnya Lembaga Pendidikan Muhammadiyah yang Unggul, Terpercaya dan Islami', '1. Meningkatkan proses pendidikan yang efektif dan kompetitif', '', '', '-76,824', '1,102,982', '4500', '2'),
('SMK', 'Sekolah / Madrasah DIY', 20401310, '0152/I13/MN/Kpts/199', '1998-05-12', 'JL.TURI TEMPEL 3,5 NGABLAK', 'BANGUN KERTO', 77, 4, '83869599077', 'smkmuhturi2@gmail.com', 'http://smkmuhtu', 'A', 'No.22.01/BAP-SM/TU/X/2015', 'KTSP', 'Terwujudnya tamatan yang siap bekerja, mandiri, memiliki etos kerja, berbudaya dan bertaqwa kepada Allah SWT', '1. Meningkatkan sarana dan prasarana pendidikan.\n2. Tertip mengajar, belajar dan administrasi.\n3. Optimalisasi sarana pendidikan yang ada.\n4. Peningkatan profesi pendidik dan potensi warga sekolah sesuai dengan bidangnya.\n', '1. Meningkatkan pengetahuan dan kemampuan peserta didik untuk memasuki dunia kerja tingkat menengah dan berkepribadianh sesuai dengan tuntunan Persarikatan Muhammadiyah.\n2. Mempersiapkan peserta didik agar menjadi warga negara yang berkepribadian nasional.\n3. Mempersiapkan peserta didik untuk mengikuti pendidikan pada jenjang yang lebih tinggi.\n', 'mandiri, siap kerja, berbudaya dan bertaqwa', '-7,653', '1,103,554', '3000', '2'),
('SMK', 'Sekolah / Madrasah DIY', 20401139, '0277/H/1986', '1928-02-28', 'Jl. Krikilan', 'TEGALTIRTO', 61, 4, '0274 367954', 'smkmuhberbah@gmail.com', 'www.smkmuhberba', '', '', 'KTSP', 'Terwujudnya Kader umat yang beriman dan bertaqwa,memiliki Akhlak Mulia  serta mampu bersaing dalam era global', '1. Mendidik siswa menjadi tamatan yang memiliki keimanan,Ketaqwaan dan   Akhlak Mulia serta mampu menyampaikan kebenaran yang bersumber pada Al- Qur''an dan Al-Hadits.', '1. Mendidik siswa menjadi tamatan yang memiliki keimanan,Ketaqwaan dan   Akhlak Mulia serta mampu menyampaikan kebenaran yang bersumber pada Al- Qur''an dan Al-Hadits.', '', '-7,780,437', '11,044,051', '5200', 'Telkom'),
('SMK', 'Sekolah / Madrasah DIY', 20401138, '0277/H/1986', '2016-01-01', 'JL. JETIS JETIS RT 01 RW 25', 'ARGOMULYO', 62, 4, '0274 367954', 'smkmuca@gmail.com', 'www.smkmuca.sch', 'A', 'no sk akreditasi', 'KTSP dan K', 'visi misi sekolah SMK Muhammadiyah Cangkringan Mencetak Tenaga Terampil Tingkat Menengah yang Berkualitas, berprestasi dan beraklaq mulia', '1Memprofesionalkan guru dan karyawa 2. Membekali peserta didik dengan imtaq dan iptek.3.Membangunan suasana yang kompetitif dan Islami 4. Menumbuhkan jiwa percaya diripecaya diri  dan mandiri kepada peserta didik', '1 Menyiapkan Peserta didik dalam kecerdasan dan ketrampilan  sesuai tuntutan yaman 2. Menyiapkan perserta didik dalam persaingan dalam lapangan kerja 3. Meningkatkan siswa dalam daya adaptasi IPTEK', 'Sinergi, Integritas, Adil, Peduli (SIAP)', '-79,023', '1,103,491', '15000', '30'),
('SMK', 'Sekolah / Madrasah DIY', 20407390, '174/KPTS/2008', '2008-08-19', 'JL. WATES KM. 6 DEPOK', 'AMBARKETAWANG', 64, 4, '8112639912', 'smkmuhammadiyahgamping@ymail.c', 'www.smkmuhammad', 'A', '22.01/BAP-SM/TU/X/2015', 'KTSP', 'Sekolah Unggul dan Berdaya Saing', '1)Â Â Â Â Â Â  Pengamalan dan pembudayaan nilai-nilai agama sebagai sendi/ dasar dalam proses pendidikan.', '1)Â Â Â Â Â Â Â Â  Menyiapkan siswa menjadi manusia muslim yang bertaqwa, berkrepribadian, cakap, percaya pada diri sendiri dan cinta tanah air sehingga berguna bagi agama, masyarakat dan Negara', '', '-7,804,163', '110,309,273', '7000', '1 mbps'),
('SMK', 'Sekolah / Madrasah DIY', 20409728, '010/AKT/III.A/2009', '2009-05-30', 'JL. SIDOREJO', 'SENDANGREJO', 67, 4, '6280000000000.0', 'smkmm.yk@gmail.com', 'www.....', '', 'no sk akreditasi', 'KTSP 2006', 'visi misi sekolah SMK Muhammadiyah Minggir adalah TERWUJUDNYA SEKOLAH UNGGUL, AGAMIS, MAJU', '1.  MEMBEKALI SISWA UNTUK MENJADI LULUSAN YANG SIAP PAKAI DAN MANDIRI, SERTA BERAKHLAK MULIA\n2. MENINGKATKAN KOMPETENSI SISWA SEHINGGA BERPRESTASI DALAM BIDANG PENDIDIKAN \n3. MENINGKATKAN KOMPETENSI GURU DAN KARYAWAN SEHINGGA TERWUJUD KEKUATAN YANG SOLID DALAM MENGELOLA LEMBAGA PENDIDIKAN\n4. MELENGKAPI SARANA DAN PERALATAN YANG SESUAI DENGAN PERKEMBANGAN ZAMAN\n5. MELIBATKAN MASYARAKAT, DUNIA USAHA / INDUSTRI SERTA PEMERINTAH DALAM MENGHADAPI PERUBAHAN GLOBAL\n', 'TUJUAN\nMeningkatkan kualitas tamatan, guna mempersiapkan diri untuk  menghadapi era global sehingga mampu bersaing dengan tenaga asing yang mengacu pada Visi dan Misi SMK, dapat dirumuskan sebagai berikut :\n\n1. Tercapainya kuantitas dan kualitas Tenaga Kependidikan sesuai tuntutan Program Pembelajaran yang bertaraf internasional.\n2. Terpenuhinya kebutuhan sarana dan prasarana pendidikan untuk mendukung tercapainya Kompetensi Tamatan bertaraf internasional\n3. Tewujudnya kerjasama ( Networking) dengan lembaga / institusi terkait, masyarakat, Dunia Usaha / Dunia Industri yang bersertifikasi internasional\n4. Terciptanya Tamatan yang professional, mandiri, mampu bersaing dengan Tenaga Kerja Asing\n', '', '-79,023', '1,103,491', '2.2', '50'),
