('SMK', 'Sekolah / Madrasah DIY', 20401318, '3216/N.611/DIY.73/77', '0000-00-00', 'JL.PAKEM TURI KM 0,5 PAKEM', 'PAKEMBINANGUN', 72, 4, '895178', 'stm_muhpakem@yahoo.co.id', 'www.smkmuhammad', 'A', '18510', 'Kurikulum ', '8. Menyiapkan tenaga menengah kejuruan yang siap pakai,menguasai imtaq dan iptek serta mampu berkopetensi dalam rangka mendukung otonomi daerah', '1. Mengoptimalkan peralatan praktek /sarana belajar dan pengembangannya.', '1. Â Meningkatkan ketaqwaan kepada Tuhan Yang Maha Esa', '', '-76,766', '1,104,045', '15000', '10 mbps'),
('SMK', 'Sekolah / Madrasah DIY', 20401317, 'C.120/Set/IIIa/Kppt/', '1971-04-23', 'JL. PRAMBANAN-PIYUNGAN KM. 01 GATAK', 'BOKOHARJO', 73, 4, '0274 496170', 'pos@smkmuhprambanan.sch.id', 'smkmuhprambanan', 'A', '16.01/BAP-SM/TU/X/2014', 'Kurikulum ', 'visi misi sekolah SMK Muhammadiyah 1 Bantul adalah Membentuk tamatan yang berakhlak mulia, berprestasi, mandiri dan berdaya saing di tingkat lokal maupun nasional', '1.................., 2.........................3...............', '1.............2.................3...........', 'BE BETTER FOREVER', '-7,765,703', '110,490,302', '40000', '30'),
('SMK', 'Sekolah / Madrasah DIY', 20409729, '211/KPTS/2009', '2009-07-09', 'JL. SEYEGAN - TEMPEL KM 1,1 KRAPYAK', 'MARGOAGUNG', 74, 4, '0274 4364672', 'smkms_rpl@yahoo.co.id', '', 'B', '22.01/BAP.SM/TU.X/2015', 'KTSP', 'TERWUJUDNYA PENDIDIKAN ISLAM YANG BERMUTU UNTUK MENGANTARKAN PESERTA DIDIK UNGGUL DALAM KEPRIBADIAN, KOMPETENSI DAN KARYA SERTA BERDYA SAING TINGGI SEIRING DENGAN VISI PENDIDIKAN MUHAMMADIYAH', '1. MENGEMBANGKAN KEPRIBADIAN PESERTA DIDIK DENGAN KEIMANAN DAN KETAQWAAN, 2. MENGEMBANGKAN KREATIVITAS PESERTA DIDIK UNTUK MENUNJANG KETRAMPILAN, 3. MELATIH DAN MENGEMBANGKAN SIKAP KEMANDIRIAN PESERTA DIDIK, 4. MENGEMBANGKAN WAWASAN KEILMUAN SESUAI PERKEMBANGAN JAMAN DAN KEBUTUHAN PASAR KERJA.', '1.............2.................3...........', '', '', '', '15000', '30'),
('SMK', 'Sekolah / Madrasah DIY', 20400383, '0277/H/1986', '2016-01-01', 'JL. PARANGTRITIS KM.12 MANDING, TRIRENGGO, BANTUL,', 'TRIRENGGO', 11, 1, '0274 367954', 'smkmuh1bantul@yahoo.com', 'smkmuh1bantul.s', 'A', 'Mk. 022313', '2013', 'visi misi sekolah SMK Muhammadiyah 1 Bantul adalah Membentuk tamatan yang berakhlak mulia, berprestasi, mandiri dan berdaya saing di tingkat lokal maupun nasional', 'Melalui keterbukaan, kemitraan dan pelayanan prima, SMK Muhammadiyah 1 Bantul : 1. Menerapkan kedisiplinan dan kejujuran yang dilandasi ketaqwaan kepada Allah SWT. 2. Menyelenggarakan pendidikan dan latihan yang berkualitas dengan mengedepankan keunggulan untuk berprestasi. 3. Melaksanakan layanan sekolah yang mengacu pada sistem manajemen mutu dan penerapan budaya Industri, untuk membekali siswa dengan pengetahuan, ketrampilan dan kemandirian sehingga mampu bersaing di tingkat lokal maupun nasional.', '1. Mempersiapkan peserta didik agar menjadi manusia produktif, mampu bekerja mandiri, mengisi lowongan pekerjaan yang ada di DU/DI sebagai tenaga kerja tingkat menengah, sesuai kompetensi dalam keahlian pilihannya.  2. Membekali peserta didik agar mampu memilih karir, ulet dan gigih dalam berkompetisi, beradaptasi di lingkungan kerja dan mengembangkan sikap profesional dalam bidang keahlian yang diminatinya. 3. Membekali peserta didik dengan ilmu pengetahuan, teknologi dan seni agar mampu mengembangkan diri dikemudian hari, baik secara mandiri maupun melalui jenjang pendidikan yang lebih tinggi.  4. Mengembangkan berbagai kegiatan dalam proses belajar di kelas berbasis pendidikan budaya dan karakter bangsa.  5.Menyelenggarakan berbagai kegiatan sosial yang menjadi bagian dari pendidikan budaya dan karakter bangsa', 'Mendidik sumber daya manusia dengan spirit MUSABA\nM Menjadikan Allah SWT. Sebagai sumber k', '-79,023', '1,103,491', '15000', '30'),
('SMK', 'Sekolah / Madrasah DIY', 20401177, '110/I.13/H/KPTS/1996', '1996-04-16', 'Jl.LPMP, Ngajeg, Tirtomartani, Kalasan', 'TIRTOMARTANI', 66, 4, '2742850003', 'smkmuhammadiyah1kalasan@gmail.', 'www.....', 'B', '5.01/BAP-SM/TU/XI/2016', 'KTSP ', 'visi misi sekolah SMK Muhammadiyah 1 Kalasan adalah Membentuk tamatan yang berakhlak mulia, berprestasi, mandiri dan berdaya saing di tingkat lokal maupun nasional', '1.................., 2.........................3...............', '1.............2.................3...........', '', '', '', '2000', 'Indihome unlimi'),
('SD', 'Sekolah / Madrasah DIY', 20403418, '2877/L-1828/DIY-16/7', '1977-09-01', 'JL. RONODIGDAYAN NO. 60, YOGYAKARTA', 'BAUSASRAN', 78, 5, '0274 542254', 'bausasran2015@gmail.com', '-', 'A', 'no sk akreditasi', 'KTSP 2016', 'Terbentuknya siswa Unggul, mandiri, dan cendikia berlandaskan imtaq dan iptek\n Indikator :\na. Unggul dalam perolehan  nilai kelulusan\nb. Unggul dalam lomba mata pelajaran, keagamaan, olahraga usia dini, ketrampilan dan seni budaya\nc. Mandiri dalam kehidupan di keluarga dan sekolah\nd. Cendikia dalam berpikir dan berperilaku\n', '1. Menciptakan kegiatan belajar mengajar secara efektif dan efisien sehingga potensi siswa dapat berkembang secara optimal\n2. Mengembangkan seluruh potensi warga sekolah untuk mencapai tingkat keunggulan\n3. Meningkatkan kemandirian siswa dalam kegiatan belajar mengajar di sekolah\n4. Meningkatkan kemandirian dan kedisiplinan dalam berbagai aspek sehingga tercipta suasana sekolah yang aman, nyaman, bersih, rapi dan tertib \n5. Memberikan arahan pada anak sesuai kemampuan untuk menyiapkan pendidikan selanjutnya\n', 'Tujuan pendidikan dasar secara umum adalah meletakkan dasar kecerdasan, pengetahuan, kepribadian, akhlak mulia, serta keterampilan untuk hidup mandiri dan mengikuti pendidikan selanjutnya.\nSecara khusus tujuan pendidikan di SD Muhammadiyah Bausasran I Yogyakarta adalah:\na. Dapat mengamalkan ajaran agama  Islam sesuai dengan ajaran persyarikatan Muhammadiyah\nb.  Meraih prestasi akademik maupun non akademik minimal tingkat Kota Yogyakarta;\nc. Menguasai dasar-dasar ilmu pengetahuan dan teknologi sebagai bekal untuk melanjutkan ke sekolah yang lebih tinggi;\nd.  Menjadi sekolah pelopor dan penggerak di lingkungan masyarakat sekitar;\ne.  Menjadi sekolah yang diminati masyarakat.\n', 'Be An Achievement Student', '-77947', '110.3763\n', '3200', '24'),
('SD', 'Sekolah / Madrasah DIY', 20403374, '0313/DN/2008 2665/00', '2008-05-24', 'JL. Ronodigdayan No. 60', 'BAUSASRAN', 78, 5, '0274 510744', 'sdmuhbausasran@yahoo.co.id', '', 'A', 'Dd. 070302', 'KTSP ', 'Terbentuknya siswa Unggul, mandiri, dan cendikia berlandaskan imtaq dan iptek. Indikator : a.Â Â Â  Unggul dalam perolehan  nilai kelulusan; b.Â Â Â  Unggul dalam lomba mata pelajaran, keagamaan, olahraga usia dini, ketrampilan dan seni budaya; c.Â Â Â  Mandiri dalam kehidupan di keluarga dan sekolah; d. Cendikia dalam berpikir dan berperilaku', '1. Menciptakan kegiatan belajar mengajar secara efektif dan efisien sehingga potensi siswa dapat berkembang secara optimal; 2. Mengembangkan seluruh potensi warga sekolah untuk mencapai tingkat keunggulan; 3. Meningkatkan kemandirian siswa dalam kegiatan belajar mengajar di sekolah; 4.  Meningkatkan kemandirian dan kedisiplinan dalam berbagai aspek sehingga tercipta suasana sekolah yang aman, nyaman, bersih, rapi dan tertib; 5. Memberikan arahan pada anak sesuai kemampuan untuk menyiapkan pendidikan selanjutnya', 'Tujuan pendidikan dasar secara umum adalah meletakkan dasar kecerdasan, pengetahuan, kepribadian, akhlak mulia, serta keterampilan untuk hidup mandiri dan mengikuti pendidikan selanjutnya. Secara khusus tujuan pendidikan di SD Muhammadiyah Bausasran II Yogyakarta adalah: a. Dapat mengamalkan ajaran agama  Islam sesuai dengan ajaran persyarikatan Muhammadiyah; b. Meraih prestasi akademik maupun non akademik minimal tingkat Kota Yogyakarta; c. Menguasai dasar-dasar ilmu pengetahuan dan teknologi sebagai bekal untuk melanjutkan ke sekolah yang lebih tinggi; d. Menjadi sekolah pelopor dan penggerak di lingkungan masyarakat sekitar; e. Menjadi sekolah yang diminati masyarakat.', 'Moebayo Be an Achievement Student', '-77,947', '1,103,763', '900', '24'),
('SD', 'Sekolah / Madrasah DIY', 20403342, '2289/L-1840/DIY-68/7', '1968-08-01', 'Jl. Melati Wetan GK IV/374', 'BACIRO', 80, 5, '0274-543134', 'sdmugenta@yahoo.com', 'http://www.sdmu', 'A', '21.01/BAP-SM/TU/XII/2013', 'KTSP dan K', 'Terwujudnya manusia muslim yang unggul, peduli terhadap lingkungan, serta berguna bagi agama, masyarakat, dan negara.', '1.Â Menumbuhkan dan mengembangkan pola pikir dan tindakan yang  mencerminkan budaya mutu dalam dzikir, pikir dan santun dalam moril. 2.  Membekali siswa dengan pengetahuan dan pengalaman dalam pengamalan ajaran agama sehingga menjadi siswa yang beriman dan bertaqwa kepada Allah SWT. 3. Melaksanakan kegiatan pembelajaran secara efektif sehingga mampu mengembangkan daya pikir, qalbu dan fisik secara optimal. 4. Melaksanakan program bimbingan khusus untuk mempersiapkan siswa agar mampu bersaing untuk masuk ke SMP yang berkualitas. 5. Melaksankan pembinaan dalam berbagai bidang olah sehingga siswa memiliki daya fisik yang sehat dan tangguh. 6. Memberikan pendidikan dan pelatihan kepada siswa agar menguasai dan mampu memanfaatkan perkembangan teknologi, khususnya komputer, 7. Menciptakan sistem pembelajaran dan budaya sekolah yang secara optimal mampu mendukung proses belajar bahasa Jawa, bahasa Indonesia, bahasa Arab, dan bahasa Inggris siswA,  8. Â  Mengupayakan pembentukan kualitas sumber daya manusia yang peduli akan kelestarian alam melalui pembiasaan dalam kehidupan sehari-hari, 9. Membiasakan perilaku hidup bersih dan sehat, 10. Membiasakan perilaku yang berbudaya lingkungan, 11. Membiasakan perilaku yang peduli lingkungan, 12.  Membentuk generasi yang berwawasan lingkungan.', '1.Terwujudnya generasi yang mencintai Al-Qur an, dan menjadikan Al-Qur an sebagai pegangan hidupnya, 2.  Terwujudnya generasi yang seimbang antara aspek jasmani dan rohani, 3. Memiliki keilmuan yang dapat diaplikasikan dalam menghadapi tantangan kehidupan masa depan, 4. Memiliki keterampilan hidup dan menumbuhkan sikap kepemimpinan yang bertanggung jawab, 5. Memiliki kemampuan komunikasi bahasa nasional dengan baik dan pengenalan dasar berbahasa Internasional (Inggris dan Arab), 6. Terwujudnya sekolah yang peduli dan berbudaya lingkungan, 7.   Terwujudnya sekolah yang berwawasan Teknologi Informasi dan Komunikasi, 8. Mewujudkan pribadi warga sekolah agar memiliki budaya lingkungan yang baik, 9. Meningkatkan kepribadian warga sekolah yang berwawasan lingkungan, 10. Mewujudkan insan yang peduli terhadap lingkungan sekitar.', '', '-77,912', '1,103,865', '220', '30'),
('SD', 'Sekolah / Madrasah DIY', 20403343, '2896/L-1847/DIY-73/7', '1973-01-01', 'JL.JOGOKARIYAN NO. 77 A YOGYAKARTA', 'MANTRIJERON', 85, 5, '0274 419475', 'sdmjogokariyan@gmail.com', '-', 'A', '21.01/BAP-SM/TU/XII/2013', 'KTSP dan K', 'visi misi sekolah SD MUHAMMADIYAH JOGOKARIYAN  adalah 1.Unggul dalam prestasi  nilai UAS dan UN,  2.Unggul dalam  olympiade MIPA, 3.Unggul dalam lomba keagamaan,  4.Unggul dalam lomba siswa berprestasi', '1 Mendorong siswa, guru dan warga sekolah untuk meningkatkan motivasi  berprestasi, 2. Menumbuhkan semangat keunggulan warga sekolah dalam berkarya,  3. Mendorong siswa, guru dan warga sekolah untuk meningkatkan pemahaman, penghayatan dan pengamalan ajaran Agama Islam, 4. Meningkatkan Sarana Prasarana Sekolah untuk menuju sekolah berprestasi dan unggul, 5. Melaksanakan 7 K yaitu keamanan, kebersihan, ketertiban, keindahan, kekeluargaan, kerindangan dan kesehatan untuk mewujudkan sekolah Adiwiyata', '1. Dapat mengamalkan ajaran agama hasil proses pembelajaran dan \n    kegiatan pembiasaan.\n2. Meraih prestasi akademik maupun non akademik  minimal tingkat Kota\n    Yogyakarta\n3. Menguasai dasar-dasar ilmu pengetahuan dan teknologi sebagai bekal \n    untuk melanjutkan ke sekolah yang lebih tinggi, 4. Menjadi sekolah pelopor dan penggerak di lingkungan masyarakat, 5.. Menjadi sekolah yang diminati masyarakat \n    sekitar.\n\nMenguasai dasar-dasar ilmu pengetahuan dan teknologi sebagai bekal \n    untuk melanjutkan ke sekolah yang lebih tinggi. \n', 'Sekolah Kader Pencetak Calon Pemimpin Bangsa', '-78,236', '1,103,663', '2000', '30'),
('SD', 'Sekolah / Madrasah DIY', 20404154, '2888/L-1839/DIY-69/7', '1977-09-01', 'JL. Khantil, Karangwaru Lor TR II/14 Yogyakarta', 'KARANGWARU', 89, 5, '0274 557836', 'sdmuh_karangwaru@yahoo.com', '-', 'A', 'D4.047902', 'KTSP dan K', 'Visi sekolah SD Muhammadiyah Karangwaru Yogyakarta adalah Terwujudnya generasi Islami, berilmu, berakhlak mulia dapat meneladani  kehidupan Nabi Muhammad SAW dan berwawasan lingkungan.', '1.Melaksanakan hidup islami sebagai upaya pengenalan, pemahaman, penghayatan   dan pengamalan ajaran islam sesuai dengan yang diajarkan Nabi Muhammad SAW., 2.Melaksanakan pembinaan belajar secara efektif dan melatih berfikir kreatif, fleksibel serta terbuka terhadap perubahan., 3.Melaksanakan pembinaan budi pekerti serta memberi keteladanan untuk terbentuknya akhlakul karimah., 4.Melaksanakan hidup sehat dan berwawasan lingkungan.', '1.Dapat mengamalkan ajaran agama islam yang utuh hasil proses pembelajaran dan kegiatan pembiasaan; 2.Meraih prestasi akademik maupun non akademik minimal tingkat Kota Yogyakarta.; 3.Menguasai dasar-dasar ilmu pengetahuan dan teknologi sebagai bekal untuk  melanjutkan ke sekolah yang lebih tinggi; 4.Menjadi sekolah pelopor dan penggerak di lingkunagn masyarakat sekitar; 5.Menjadi sekolah yang diminati di masyarakat; 6.Menjadi sekolah yang bersih, hijau dan rindang.', '', '-77.752', '1,103,589', '4500', ''),
('SD', 'Sekolah / Madrasah DIY', 20403347, '2880/L- 1831/DIY-23/', '1977-01-01', 'Kauman GM I/374 Yogyakarta', 'NGUPASAN', 81, 5, '0274 384386', 'sdm.kauman@yahoo.co.id', '-', 'A', '5.01/BAP-SM/XI/2016', 'KTSP', 'Teladan dalam Akhlaqul Karimah, Unggul Dalam Prestasi, Berbudaya, Berwawasan Lingkungan, & IPTEK', '1. Menciaptakan kesadaran keteladanan dalam  berakhlaqul karimah, 2. Menciptakan kesadaran belajar dan beribadah baik di rumah maupun di sekolah,  3. Menciptakan iklim belajar yang kondusif\n4. Menciptakan budaya disiplin\n5. Meningkatkan kesadaran berkreasi, berprestasi dan berkompetisi\n6. Menjadikan sekolah yang unggul dan diminati masyarakat\n7. Menciptakan 7K (Keamanan, Kebersihan, Ketertiban, Keindahan, Kekeluargaan, \nKerindangan, dan Kerapian)\n8. Terwujudnya sekolah Adiwiyata, yakni sekolah yang berbudaya lingkungan\n9. Meningkatkan kemampuan dan pemanfaatan IT\n10. Meningkatkan peran serta dan partisipasi masyarakat\n.', '1. Terwujudnya manusia muslim yang bertaqwa, berakhlaq mulia, cakap, \nPercaya diri, cinta tanah air, dan berguna bagi masyarakat dan negara serta menjadi teladan dalam masyarakat\n2. Memajukan dan mengembangkan kompetensi dan life skills siswa sebagai bekal untuk melanjutkan ke jenjang yang lebih tinggi dan hidup bermasyarakat\n3. Memiliki tanggung jawab terhadap lingkunganya\n4. Terwujudnya sekolah Adiwiyata, yakni sekolah yang berbudaya lingkungan\n5. Menjadi sekolah yang mampu bersaing di tingkat lokal maupun nasional\n6. Menjadikan sekolah yang unggul dan diminati masyarakat\n7. Terwujudnya manusia yang memiliki kecakapan teknologi\n', '', '-78,042', '1,103,621', '17600', '20'),
('SD', 'Sekolah / Madrasah DIY', 20403348, '2885/L-1836/DIY-35/7', '1977-09-01', 'JL. NYI PEMBAYUN NO. 20 KOTAGEDE, YOGYAKARTA', 'PRENGGAN', 83, 5, '0274 412662', 'sdm _kleco 1@ymail.com', 'www.sdmuhklecoy', 'A', 'Dd 070300', 'KTSP', 'Unggul dalam prestasi, luhur budi pekerti, sadar budaya dan lingkungan, terampil, terwujudnya insan muttaqin.', '1. Melaksanakan pembelajaran dengan pendekatan pakem dan scientific secara maksimal dan riil : aktif, kreatif, mengasyikkan dan menyenangkan.', 'Setelah lulus dari SD Muhammadiyah Kleco, siswa diharapkan mampu :', '', '-78,224', '1,103,983', '3500', '2'),
('SD', 'Sekolah / Madrasah DIY', 20403349, '2908/L-1859/DIY-62/7', '1977-09-01', 'Jl. Tegal Gendu 3', 'PRENGGAN', 83, 5, '0274 4340628', 'sdm_kleco2@ymail.com', 'www.sdmuhklecoy', 'A', 'Dd.070308', 'KTSP ', 'Unggul dalam prestasi, luhur budi pekerti, sadar budaya dan lingkungan, terampil serta terwujudnya insan muttaqin.', '1. Pembelajaran melalui pendekatan pakem dan scientific : aktif, kreatif, menghasilkan serta \nmenyenangkan alamiah dan ilmiah, 2. Pembelajaran melalui multi media dengan tidak meninggalkan lingkungan sekitar sebagai \nsumber belajar, 3. Pembelajaran baca tulis Al- Qur an hingga tartil, 4. Bimbingan tahfidz 80 % hafal Juz Amma, 5. Membimbing bakat dan minat siswa melalui ekstrakurikuler sserta bimbingan olimpiade, 6. Menciptakan budaya berakhlakul karimah melaui suri tauladan guru dan karyawan, 7. Membiasakan hidup bersih, aman, tertib, disiplin, sehat dan sadar lingkungan, 8. Membiasakan siswa hidup hemat melalui gemar menabung, 9. Membiasakan sholat berjama ah, berdzikir dan sholat sunat.', '1. Meningkatkan mutu akademik dan nonakademik di atas kritera ketuntasan minimal berdasarkan  Standar Nasional Pendidikan,\n2. Meningkatkan kemampuan penelitian sederhana sesuai dengan pengembangan mata pelajaran, 3. Meningkatkan prestasi siswa di bidang  seni budaya,\n4. Terwujudnya pendidik dan tenaga kependidikan yang profesional, 5. Terwujudnya suasana komunikasi yang santun berdasarkan pengamalan agama islam, 6. Terwujudnya sarana dan prasarana yang mampu digunakan untuk mengembangkan pembelajaran, 7. Terwujudnya hubungan harmonis dan dinamis baik dalam sekolah maupun dengan masyarakat, 8. Terwujudnya  sekolah yang peduli dan berbudaya lingkungan atau sekolah adiwiyata', '', '-78,224', '1,103,981', '4500', '2'),
('SD', 'Sekolah / Madrasah DIY', 20403350, '2902/L-1860/DIY-71/7', '1977-09-01', 'JL. Nyi Pembayun No.20', 'PRENGGAN', 83, 5, '0274 412662', 'sdm_kleco3@ymail.com', 'www.sdmuhklecoy', 'A', '2012', 'KTSP dan K', 'Unggul dalam prestasi, Luhur budi pekerti, Sadar budaya, Sadar lingkungan, Terampil dan terwujudnya insan mutaqin', '', '', '', '-78,224', '1,103,983', '4500', '2Mbps'),
('SD', 'Sekolah / Madrasah DIY', 20403320, '2881/L-1832/DIY-27/7', '1977-09-01', 'Jl. Bhayangkara No. 7', 'NGAMPILAN', 87, 5, '0274 512363', 'sdmuh.ngupasansatu@gmail.com', 'http://www.sdmu', 'A', 'Dd. 070319', 'KTSP dan K', 'Menyiapkan Kader Muhammadiyah Yang Cerdas, Taqwa, Dan Unggul Berlandaskan Al-Qur an Dan As-Sunah', '1.Menanamkan aqidah dan menumbuhkan penghayatan terhadap ajaran agama Islam. 2. Melaksanakan pembelajaran dan bimbingan yang efektif sehingga setiap siswa dapat berkembang secara optimal sesuai dengan potensi yang dimiliki. 3. Menanamkan kecintaan terhadap seni dan budaya bangsa. 4. Membiasakan siswa berperilaku disiplin, jujur, tanggung jawab, kerja keras, kreatif, inovatif, kerja sama, dan mandiri. 5. Membiasakan siswa berperilaku peduli lingkungan dan sosial, semangat kebangsaan, cinta tanah air, cinta damai, dan demokratis. 6. Melaksanakan pembinaan atlet usia dini dalam cabang Atletik, Permainan, dan Seni Bela diri pencak silat Tapak suci.', '1. Membentuk generasi yang kuat akidah dan taat beribadah. 2. Membentuk generasi yang menguasai Ilmu Pengetahuan dan Teknologi. 3. Membentuk generasi yang mencintai budaya bangsa dan juga bangsa lain yang tidak bertentangan budaya sendiri. 4. Membentuk generasi yang disiplin, jujur, tanggung jawab, kerja keras, kreatif, inovatif, kerja sama, dan mandiri. 5. Membentuk generasi yang mempunyai kepedulian lingkungan dan sosial, semangat kebangsaan, cinta tanah air, cinta damai, dan demokratis. 6. Membentuk generasi yang menguasai bidang Olah raga, cabang : Atletik, Permainan, dan Seni Bela diri Pencak silat Tapak suci.', '', '-78,007', '1,103,621', '9000', '30'),
('SD', 'Sekolah / Madrasah DIY', 69830190, '015/KEP/III.0/A/2014', '2014-03-07', 'KRANON, NITIKAN UH VI/ UMBULHARJO', 'SOROSUTAN', 90, 5, '0274 2870668', 'humas@sdmuhnitikan.sch.id', 'www.sdmuhnitika', '-', '-', 'KTSP', 'Visi Sekolah terbentuknya pribadi muslim yang berakhlaqul karimah, berbudaya, berprestasi, dan berwawasan lingkungan.', 'Misi Sekolah 1. membentuk lingkungan pendidikan disekolah yang mampu menumbuhkan dan meningkatkan kualitas keagamaan siswa, 2. melaksanakan pembelajaran dan bimbingan secara efektif sehingga dapat mengembangkan potensi siswa, 3. memberikan kesempatan untuk mengembangkan aspek kognitif, afektif dan psikomotor, 4. mengembangkan nilai budaya dan etos kerja yang tinggi, 5. menumbuhkan kesadaran dan kepedulian terhadap lingkungan, 6. meningkatkan management partisipasi dengan melibatkan orangtua, guru, siswa dan stakeholder sekolah, 7. mengembangkan pembelajaran berbasis IT dan kemampuan bahasa asing, 8. membangkitkan semangat berprestasi seluruh warga sekolah, 9. menumbuhkan kegemaran dan kebiasaan membaca, menulis, dan berkarya', '1. mencetak lulusan yang mengamalkan ajaran islam sesuai dengan Al-Qur''an dan tuntunan Rosulnya, 2. meningkatkan wawasan dan penerapan keilmuan yang holistik yang meliputi pengembangan aspek kognitif, afektif, dan psikomotor, 3. meningkatkan prestasi belajar siswa secara utuh yang berbasis pada multiple intelegent, 4. terpenuhinya kebutuhan sarana prasarana sekolah, 5. meningkatkan kreatifitas peserta didik melalui pengembangan diri dalam bentuk kegiatan live skill, 6. menjalin hubungan yang kondusif antara Tri Pusat Pendidikan, 7. mendidik dan membekali siswa agar memiliki sikap yang menjunjung tinggi nila-nilai norma sebagai dasar pembentukan watak yang berkepribadian dan beretika', '', '-7,823,745', '110,379,145', '4400', '30'),
('SD', 'Sekolah / Madrasah DIY', 20403323, '2890/L-1841/DIY-66/7', '1977-01-09', 'Jalan Pakel Baru 40 Sorosutan Umbulharjo Yogyakart', 'SOROSUTAN', 90, 5, '0274 415377', 'sdmuhpakel@gmail.com', 'sdmuhpakel.sch.', 'A', 'Dd.070292', 'KTSP', 'Terwujudnya generasi Islam yang berprestasi dan memiliki keunggulan dalam ilmu pengetahuan dan teknologi (Iptek) serta Iman dan Taqwa (Imtaq) yang berwawasan lingkungan dilandasi akhlaq yang mulia', '1. Mendorong siswa, Guru dan Warga Sekolah untuk meningkatkan motivasi berprestasi 2. Menumbuhkan semangat keunggulan warga Sekolah dalam berkarya, 3. Mendorong Siswa, Guru dan Warga Sekolah untuk meningkatkan pemahaman, penghayatan, dan pengamalan ajaran Agama Islam, 4. Meningkatkan Sarana Prasarana Sekolah untuk menuju sekolah berprestasi dan unggul, 5. Melaksanakan 7K yaitu: Keamanan, Kebersihan, Ketertiban, Keindahan, Kekeluargaan, Kerindangan, dan Kesehatan untuk mewujudkan sekolah adiwiyata.', '1. Memiliki Aqidah yang kuat, menjalankan ibadah dengan baik, dan berakhlak mulia 2. memiliki ghirah islamiah dalam segala aspek kehidupan, 3. Mengembangkan pola pikir yang cerdas, kreatif, serta berwawasan IPTEK dan IMTAQ, 4. memiliki kemampuan dasar berkomunikasi dengan bahasa inggris secara sederhana, 5. memiliki kemmampuan dasar berbahasa Arab untuk memahami kandungan Al-Qur''an, 6. Mampu menghafal Al-Qur''an Â± 1 Juz dan Do''a sehari-hari, 7. Terbinanya kecakapan dan ketrampilan sesuai bakat dan minat yang dimiliki', 'Mempersiapkan generasi Islam yang seimbang Ilmu, Iman, dan Amalnya', '-78,198', '1,103,797', '19100', 'Bantuandari Set'),
('SD', 'Sekolah / Madrasah DIY', 20403325, '3215/L-2027/DIY-76/7', '1976-04-22', 'Jl. Purbayan No 11', 'PURBAYAN', 83, 5, '0274 4436382', 'sd_muhammadiyah_purbayan@yahoo', 'www.sdmuhpurbay', 'A', 'Dd070309', 'KTSP', 'Unggul Prestasi, Luhur Budi Pekerti, Berwawasan Lingkungan, dan Terwujudnya Insan Robbani', '1. Membina siswa menjadi bibit unggul melalui Proses Pembelajaran Aktif, Kreatif, Inovatif, Efektif, dan Menyenangkan (PAIKEM), 2. Memberikan keteladanan 5 S (Salam, Senyum, Sapa, Sopan dan Santun), 3. Membiasakan siswa berperilaku 9 K (Keamanan, kebersihan, ketertiban, keindahan, kekeluargaan, kedamaian dan kerindangan, keindahan, keteladanan, kesehatan), 4. Membiasakan siswa untuk berkata dan berbuat jujur, 5. Membiasakan siswa untuk ikhlas beramal, 6. Membiasakan siswa berdoa dan beribadah, 7. Membiasakan siswa peduli lingkungan, 8. Menciptakan sekolah yang berwawasan lingkungan', 'Terwujudnya manusia berkualitas melalui pengamalan ajaran agama meraih prestasi dalam bidang ilmu pengetahuan dan teknologi sebagai bekal untuk melanjutkan ke jenjang pendidikan yang lebih tinggi', '', '-78,289', '1,104,026', '3300', '3'),
('SD', 'Sekolah / Madrasah DIY', 20403326, '2884/L-1835/DIY.68/7', '1977-09-01', 'Purwodiningratan NG I/902C', 'PURWODININGRATAN', 87, 5, '0274 513281', 'sdmuhpurwosatu@gmail.com', 'www.sdmuhpurwo1', 'A', 'Dd.070317', 'KTSP', 'Unggul dalam prestasi, berakhlakul karimah, mencintai lingkungan dan budaya serta berwawasan teknologi', '1.Menyelenggarakan kegiatan pembelajaran yang menyenangkan dan mencerdaskan, 2.Menyediakan pendidik yang profesional, 3.Menyediakan sarana dan prasarana yang representatif, 4.Menerapkan sistem manajemen mutu, 5.Menerapkan prinsip-prinsip ajaran Islam dalam kehidupan sehari-hari, 6.Mengembangkan minat, kemampuan dan kebiasaan membaca Al-Qur an, 7.Membiasakan mencintai kebersihan lingkungan, 8.Membiasakan mencintai nilai-nilai luhur dan budaya Ngayogyakarta, 9.Menyelenggarakan ekstra kurikuler komputer.', '1.Meningkatkan mutu akademik dan non akademik di atas kriteria ketuntasan minimal berdasarkan standar nasional pendidikan, 2.Meningkatkan pengamalan ajaran Islam yang murni dan konsekuen, 3.Mewujudkan ukhuwah Islamiyah yang harmonis, 4.Meningkatkan sarana dan prasarana sekolah yang mampu digunakan untuk mengembangkan pembelajaran, 5.Mewujudkan lingkungan sekolah yang indah yang nyaman, 6.Mewujudkan penerapan nilai-nilai luhur dalam kehidupan sehari-hari di lingkungan sekolah, 7.Mewujudkan ketrampilan siswa dalam bidang teknologi.', '', '-7,798,498', '110,357,885', '5500', '1'),
('SD', 'Sekolah / Madrasah DIY', 20404155, 'E.1/278/77', '1969-01-01', 'Jl KH AHMAD DAHLAN GANG PURWODININGRATAN NG I 902', 'NGAMPILAN', 87, 5, '0274 518 139', 'sdmuhpurwo2@yahoo.com', 'www.sdmuhpurwod', 'A', '', 'KTSP 2006', 'UNGGUL DALAM PRESTASI, BERKARAKTER ISLAMI, BERWAWASAN BUDAYA,\nRAMAH LINGKUNGAN  dan TEKNOLOGI\n', '1. Melaksanakan proses pembelajaran secara efektif dan efisien dengan menggunakan pendekatan PAKEM., 2. Melaksanakan pembinaan prestasi siswa sesuai bakat dan minat., 3. Membiasakan budaya berkreasi, berkompetisi, dan berprestasi., 4. Membentuk karakter siswa yang Islami melalui pembiasaan sholat berjamaah, tadarus Al Quran, pelaksanaan Program Senyum, Salam, Sapa, Sopan, Santun (5 S)., 5. Mewujudkan lingkungan belajar yang kondusif., 6. Melatih dan membimbing siswa dalam penerapan teknologi (TIK)., 7. Mewujudkan manajemen berbasis sekolah., 8. Menjadikan sekolah bertaraf internasional yang diminati masyarakat', '1.   Mewujudkan pengembangan kurikulum yang adaptif dan proaktif., 2. Mewujudkan proses pembelajaran yang efektif dan efisien dengan pendekatan PAKEM., 3. Mewujudkan lulusan dengan nilai tinggi dan kompetitif., 4.  Mewujudkan sumberdaya pendidik yang kompeten dan berdedikasi tinggi., 5.  Mewujudkan sarana dan prasarana pendidikan yang relevan dan mutakhir., 6.  Mewujudkan manajemen yang tangguh dan berbasis sekolah (MBS)., 7.  Mewujudkan penggalangan biaya pendidikan yang memadai., 8.  Mewujudkan standar penilaian prestasi akademik dan non akademik sesuai standar nasional.', 'UNGGUL DALAM PRESTASI, BERKARAKTER ISLAMI, BERWAWASAN BUDAYA,\nRAMAH LINGKUNGAN  dan TEKNOL', '', '', '7700', '1'),
('SD', 'Sekolah / Madrasah DIY', 20403351, '2886/l-1837/diy-64/7', '1977-09-01', 'JL. KAPAS NO. 5A', 'SEMAKI', 90, 5, '0274 517869', 'sdmuhsokonandi_yogya@yahoo.com', 'www.sdmuhsokona', 'A', '', 'Kurikulum ', 'Terwujudnya generasi Islam yang sebenar-benarnya, unggul dalam Ipteks, kreatif dan peduli lingkungan', '1.  Mendidik siswa beraqidah kuat, rajin beribadah, fasih membaca Al-Qur''an, berakhlak mulia dan peduli sesama', 'Menjadi Lembaga Pendidikan yang unggul, kuat dan mandiri untuk mewujudkan Misi Muhammadiyah dalam dakwah, mencerdaskan bangsa dan kaderisasi.', '', '-77,998', '1,103,831', '5500', 'Telkom Speedy'),
('SD', 'Sekolah / Madrasah DIY', 20403352, '2886/l-1837/diy-64/7', '1977-09-01', 'JL. KAPAS NO. 5A', 'SEMAKI', 90, 5, '0274 517869', 'sdmuhsokonandi_yogya@yahoo.com', 'www.sdmuhsokona', 'A', '', 'Kurikulum ', 'Terwujudnya generasi Islam yang sebenar-benarnya, unggul dalam Ipteks, kreatif dan peduli lingkungan', '1.  Mendidik siswa beraqidah kuat, rajin beribadah, fasih membaca Al-Qur''an, berakhlak mulia dan peduli sesama', 'Menjadi Lembaga Pendidikan yang unggul, kuat dan mandiri untuk mewujudkan Misi Muhammadiyah dalam dakwah, mencerdaskan bangsa dan kaderisasi.', '', '-77.998', '1,103,831', '11000', 'Telkom Speedy'),
('SD', 'Sekolah / Madrasah DIY', 20403365, '2907/L-1858/DIY-68/7', '1977-09-01', 'JL. WAHID HASYIM NO 34 YOGYAKARTA', 'GEDONGKIWO', 85, 5, '0274 415716', 'sdmuhammadiyahsuryowijayan@gma', 'www.....', 'A', '22.01/BAP-SM/TU/X/2015', 'KTSP ', 'Visi SD Muhammadiyah Suryowijayan adalah membentuk siswa yang berakhlaqul karimah, unggul dalam prestasi, cerdas, trampil, mandiri serta bertanggungjawab', '1. Membiasakan hidup islami dilingkungan sekolah, keluarga dan masyarakat. (2) Membina motivasi belajar secara kontinyu.(3) Mengintensifkan bimbingan belajar di sekolah, dirumah dan dimasyarakat.(4) Menciptakan KBM aktif,kreatif,inovatif dan menyenangkan. (5) Meningkatkan kegiatan ekstrakurikuler.(6) Mendorong dan membantu siswa untuk mengenali potensi dirinya sehingga dapat dikembangkan secara optimal.(7) Menyiapkan siswa menguasai IPTEK sehingga mampu bersaing di era global.', '1. Mempunyai Aqidah yang kuat, menjalankan ibadah dengan baik dan berakhlak mulia.(2) Memiliki ghirah keagamaan yang kuat dalam segala aspek kehidupan.(3) Memiliki prestasi akademik yang tinggi.(4) Memiliki kesiapan mental intellegent dan emosional sesuai dengan usianya dalam rangka menghadapi pergaulan dan kompetensi yang lebih luas.(5) Menguasai dasar-dasar ilmu pengetahuan dan teknologi sebagai bekal untuk melanjutkan ke sekolah yang lebih tinggi.(6) Mampu membaca Al Qur''an dengan baik dna benar.(7) Menjadi sekolah yang diminati masyarakat.', '', '', '', '9000', '50'),
('SD', 'Sekolah / Madrasah DIY', 20403367, '28941L 1895/DIY-6917', '1969-01-01', 'KUNCEN WB 1/328 A YOGYAKARTA', 'PAKUNCEN', 91, 5, '0274 543377', 'sdm.wb1@gmail.com', '', 'A', 'Dd.000549', 'KTSP', 'Terbentuknya generasi Islami, berilmu, dan berakhlaq mulia', '1.Â Â Â Â Â  Pelaksanaan belajar dan mengajar aktif dan inovatif dengan prinsip enjoy to learning', '1.Â Â Â Â Â  Dapat mengamalkan ajaran agama hasil proses pembelajaran dan kegiatan pembiasaan', '', '-77,964', '1,103,534', '900', '0'),
('SD', 'Sekolah / Madrasah DIY', 20403368, '2903/L-1854/DIY-71/7', '1971-01-01', 'Komplek Masjid Kuncen RT 21 RW 05 Pakuncen Wirobra', 'PAKUNCEN', 91, 5, '0274 618061', 'sdmuhwirobrajan2@gmail.com', '', 'A', '16.01/BAP-SM/TU/X/2014', 'KTSP', 'Terwujudnya Generasi Islam yang tangguh Iman dan Taqwa, Unggul Ilmu Pengetahuan dan Teknologi, Terampil, Berbudaya, Peduli Lingkungan serta Berpola Hidup Bersih dan Sehat', '1. Membiasakan siswa untuk mengamalkan ajaran Islam sesuai Al Qur''an dan As Sunnah, 2. Memberikan Ilmu Pengetahuan dan Teknologi 3. Mengembangkan Keterampilan 4. Mengenalkan budaya islam, lokal, dan nasional 5. Peduli lingkungan dan menerapkan kebiasaan berpola hidup bersih dan sehat', '1. membentuk generasi islam yang taat mengamalkan ajaran Islam sehingga dapat meraih Nilai Akhlak Mulia 2. menguasai Ilmu Pengetahuan sehingga dapat meraih prestasi akademik yang maksimal 3. menguasai teknologi sehingga dapat memiliki wawasan global 4. memiliki keterampilan sesuai bakat dan minat siswa sehingga dapat meraih prestasi non akademik 5. mencintai budaya islam, lokal dan nasional 6. menyiapkan generasi islam yang peduli terhadap lingkungan', '', '-77,968', '1,103,507', '3500', '120'),
('SD', 'Sekolah / Madrasah DIY', 20409865, '114/IV.0/F/2009', '2011-04-11', 'JL. VETERAN 108 YOGYAKARTA', 'WARUNGBOTO', 90, 5, '0274-389002', 'operatormuwarta@gmail.com', 'http://www.esde', 'B', '21.01/BAP-SM/TU/XII/2013', 'KTSP dan K', 'Terwujudnya Sekolah Dasar Muhammadiyah yang unggul berlandaskan IMTAQ dan IPTEK, berakhlakul karimah, terjangkau semua lapisan masyarakat dengan mengedepankan nilai-nilai islami', '', '', 'Enlightening and Exhilarating (Mencerahkan dan Menggembirakan)', '-78.069', '1,103,869', '1300', '5'),
('MI', 'Sekolah / Madrasah DIY', 20400543, '4118/I.204/DIY-69/19', '1969-01-01', 'JRAGAN II PONCOSARI SRANDAKAN BANTUL YOGYAKARTA', 'SRANDAKAN', 17, 1, '6290000000000.0', 'prafangasta123@yahoo.co.id', 'www.....', 'B', 'Dd.048244', 'KTSP dan K', 'visi misi sekolah MI Muhammadiyah Jragan adalah Terbentuknya siswa yang islami, cerdas, kompetitif, terampil, dan berkarakter.', '1.Menumbuh kembangkan sikap dan amaliah keagamaan Islam, 2.Mengintensifkan baca tulis Al Qur''an, 3.Membiasakan salam, doa, tadarus, sholat dhuha, dan sholat berjama''ah, 4.Menerapkan manajemen berbasis madrasah dengan melibatkan seluruh steakholder madrasah dan komite madrasah, 5.Menumbuhkan dan meningkatkanminat baca dan tulis, 6.Melaksanakan pemeblajaran dan bimbingan yang inovatif dan berkualitas, 7.Meningkatkan pencapaian rata-rata nilai Ujian Nasional ( UASBN ), 8.Mengembangkan kemampuan berbahasa Arab dan berbahasa Inggris, 9.Meningkatkan pencapaian prestasi akademik dan non akademik, 10.Memberdayakan lingkungan madrasah sebagai sumber belajar, 11.Membangun citra madrasah sebagai mitra terpercaya masyarakat, 12.Mengintensikan kegiatan ekstrakurikuler adalah Membiasakan betutur kata dan bertindak santun dan Memberikan keteladanan bertuturan kata dan bertindak santun.', '1.Memberikan dasar-dasar keimanan, ketaqwaan, dan akhlakul karimah sehingga siswa mampu mengamalkannya dalam kehidupan sehari-hari, 2.Memberikan dasar-dasar keilmuan secara optimal, sehingga siswa mampu memecahkan masalah dan mempunyai kepekaan sosial, 3.Meningkatkan kegiatan yang dapat menumbuhkan kembangkan budaya baca dan tulis, 4.Melaksanakan Pembelajaran yang Aktif, Kreatif, Inovatif, Efektif, dan Menyenangkan (PAIKEM), sehingga siswa mampu mencapai prestasi akademik dan non akademik secara optimal, 5.Mengoptimalkan pelaksanaan program perbaikan dan pengayaan, sehingga siswa mampu meningkatkan rata-rata nilai Ujian Nasional (UN) serta mampu berkompetisi pada tingkat nasional, 6.Meningkatkan kelengkapan sarana dan prasarana sebagai penunjang proses pembelajaran, sehingga siswa betah berada di lingkungan madrasah, 7.Menerapkan manajemen pengendali mutu madrasah sehingga dapat meningkatkan animo siswa baru, transparansi, dan akuntabilitas.', '', '-7,974,918', '110,227,488', '900', '30'),
('MI', 'Sekolah / Madrasah DIY', 20400551, '4117/I.206/DIY-72/19', '1983-03-01', 'Jl. Patuk-Dlingo Km 7', 'TERONG', 5, 1, '85100875599', 'mimuhammadiyahterong@yahoo.co.', 'www.....', 'B', '28./BAP/TU/x/2011', 'KTSP dan K', 'Visi Sekolah ''''Terwujudnya Calon Kader Muhammadiyah yang berakhlakul Karimah, Cerdas, Terampil dan Mandiri', '1. Mewujudkan kader yang beriman dan bertaqwa kepada Allah SWT, 2. Mewujudkan kader yang berakhlakul karimah dalam tutur kata, perilaku kepribadian, 3. Mewujudkan Kader yang cerdas dan mandiri dalam menyelesaikan masalah, 4. Mewujudkan kader yang terampil dan berprestasi dalam berbagai wawasan keahlian, 5. Berkolaborasi dengan berbagai pihak untuk inovasi dan penigkatan mutu', '1. Terselenggaranya pembelajaran tematik terpadu dengan ciri PAIKEM dan Pendekatan Scientific sehingga meningkatkan pencapaian akademis diatas KKM di setiap tingkat, 2. Terintegrasinya pendidikan karakter spiritual dan sosial serta ketrampilan dalam pembelajaran serta tercapainya kompetensi tersebut dengan nilai minimal Baik, 3. Tingkat ketuntasan penguasaan kompetensi 100% dengan melaksanakan remidial teaching bagi siswa yang belum tuntas, 4. Tingkat Kelulusan 100%.', 'Mendidik Dengan Hati', '-7.887902', '110.46385', '900', ''),
('SD', 'Sekolah / Madrasah DIY', 20400605, '2946/C.1877/DIY.51/7', '1977-02-26', 'JL. WONOSARI KM 5, KETANDAN, BANGUNTAPAN, BANTUL 5', 'BANGUNTAPAN', 13, 1, '8112952206', 'sdmbanguntapan@yahoo.co.id', '-', 'A', '10.01/BAP-SM/TU/XI/2012', 'KTSP dan K', 'Terbentuknya generasi Islami yang cerdas, mandiri, kreatif, berahlaq mulia, dan berdaya saing tinggi', '(1) Memberikan layanan pendidikan Al-Islam dan budi pekerti secara aplikatif disertai pembiasaan yang kontinu. (2.) Memberikan layanan pembelajaran yang malsimal dengan berbagai metode yang variatif dan inovatif  (3) Membiasakan layanan pendidikan yang mendorong siswa untuk menciptakan karya  (4)Membiasakan anak menghargai perbedaan dalam berbagai hal. (5) Membiasakan siswa menghargai perbedaan dalam berbagai hal. (6) Membiasakan siswa untuk mencintai budaya bangsa. (7) Membiasakan siswa untuk selalu megikuti perkembangan ilmu pengetahuan, teknologi, dan perubahan yang terjadi di lingkungan sekitar', '1. Siswa  memiliki kebiasaan: a. Rajin melalksanakan ibadah, b. Rajin membaca kitab suci Al-Quran dengan bacaan yang benar dan baik, c. Tekun melaksanakan ibadah sunah, d. Santun dalam berbicara dan bertindak, e. Memiliki sikap menghargai orangtua, sesama, dan menyanyangi pada orang yang lebih muda, f. Memiliki sikap sayang pada orang memiliki kekurangan', 'INSERT INTO `profil` (`jenjang`, `nama_sekolah`, `npsn`, `sk_pendirian`, `tgl_pendirian`, `alamat`, `kel`, `kec`, `kab`, `telepon`, `email`, `web`, `akreditasi`, `sk_akreditasi`, `kurikulum`, `visi`, `misi`, `tujuan`, `moto`, `koordinat_long`, `koordinat_lat`, `listrik`, `akses_internet`) VALUES
('SD', 'Sekolah / Madrasah DIY', 20400599, '125/KPTS/1991', '1991-04-01', 'JL BOJONG, WONOLELO, PLERET, BANTUL', 'WONOLELO', 6, 1, '081 12655791', 'anangpramudianto@yahoo.com', '', 'A', '', 'KTSP dan K', '', '1. Membentuk kader-kader muslim yang tangguh, berpengetahuan luas, berbudi tinggi, berbadan sehat, dan berbakti ikhlas', '1. Membentuk siswa yang rajin melaksanakan ibadah wajib maupun rajin membaca Al-Quran', '', '-78952', '1,104,295', '900', 'Indosat'),
('SD', 'Sekolah / Madrasah DIY', 20400598, '2958/L.1889/DIY.50/7', '1977-09-01', 'DUKUH WIDARAN, SIDOMULYO, BAMBANGLIPURO, BANTUL, 5', 'SIDOMULYO', 8, 1, '87811190068', 'sdmuh.dukuhwidaran@gmail.com', '', 'B', 'No: 10.01/BAP-SM/TU/XI/2012', 'KTSP dan K', 'Terwujudnya insan yang agamis, berprestasi, berbudaya, mandiri, berwawasan lingkungan berdasarkan iman dan taqwa', '1. Menanamkan nilai-nilai religius dalam setiap kegiatan sekolah, 2. Meningkatkan kualitas dan kompetensi pendidik dan tenaga kependidikan, 3. Mengoptimalkan pembelajaran tematik integratif berwawasan agamis, 4. Meningkatkan prestasi akademik dan non akademik sesuai minat, bakat dan potensi siswa, 5. Membiasakan berperilaku agamis dan berbudi pekerti luhur sesuai dengan nilai-nilai Pancasila.', '1. Meningkatkan pencapaian Nilai rata-rata Ujian Sekolah (US) dari 180,10 (untuk 3 mata pelajaran) pada tahun 2015/2016 maka: (a.) Tahun pelajaran 2016-2017 menjadi 210,00, (b.) Tahun pelajaran 2017-2018 menjadi 220,00, (c.) Tahun pelajaran 2018-2019 menjadi 230,00, (d.) Tahun pelajaran 2019-2020 menjadi 240,00, (2) Menjuarai lomba akademik / olimpiade akademik yang diselenggarakan tingkat Kecamatan, Tingkat Kabupaten, Tingkat Propinsi dan Tingkat Nasional, (3) Meraih juara 1 lomba olahraga cabang atletik tingkat Kabupaten, (4) Meraih kejuaraan no 1 dalam lomba MTQ di tingkat Kecamatan dan Kabupaten, (5) Mengembangkan kompetensi siswa di bidang seni budaya secara optimal, (6) Menjuarai lomba seni budaya tingkat Kecamatan sampai dengan Kabupaten, (7) Menumbuhkan dan mengembangkan penghayatan serta pengamalan terhadap ajaran agama melalui intensifikasi kegiatan keagamaan, sehingga meningkat iman dan taqwanya, (8) Mengusai dasar-dasar ilmu pengetahuan dan teknologi sebagai bekal untuk  melanjutkan ke sekolah yang lebih tinggi, (9) Mengimplementasikan  pendidikan berkarakter bangsa dalam pembelajaran, (10) Menjadi sekolah yang unggul dalam agama yang diminati masyarakat.', 'Kami datang untuk belajar, Kami pulang membawa ilmu', '-79,619', '1,103,068', '900', ''),
('SD', 'Sekolah / Madrasah DIY', 20400586, '31/KPTS/1989', '0000-00-00', 'GEGER', 'SELOHARJO', 3, 1, '', 'sdmuh_geger@yahoo.co.id', '', 'B', '22.01/BAP-SM/TU/X/2015', '2013, KTSP', 'INSERT INTO `profil` (`jenjang`, `nama_sekolah`, `npsn`, `sk_pendirian`, `tgl_pendirian`, `alamat`, `kel`, `kec`, `kab`, `telepon`, `email`, `web`, `akreditasi`, `sk_akreditasi`, `kurikulum`, `visi`, `misi`, `tujuan`, `moto`, `koordinat_long`, `koordinat_lat`, `listrik`, `akses_internet`) VALUES
