('SD', 'Sekolah / Madrasah DIY', 20402155, '3162/L.1996/DIY.49/7', '1949-02-01', 'JL. WONOSARI-PANGGANG', 'MULUSAN', 23, 2, '87838171871', 'sdmuhmulusan1@gmail.com', '', 'A', 'Dd.048138', 'KTSP', 'visi misi sekolah SD MUHAMMADIYAH MULUSAN 1 adalah Terwujudnya pendidikan yang unggul, berakhlak mulia, terampil, berbudaya dan mandiri, serta berwawasan global', 'a.Â Â Â Â Â Â Â Â  Melaksanakan pembelajaran aktif, inovatif, kreatif efektif, menyenangkan dan bimbingan yang berkualitas.b. Pembinaan ibadah agar siswa beriman, bertaqwa, dan beraqidah kuat, sehingga dapat mengamalkan ajaran Islam dengan benar.c. Membentuk siswa yang terampil, dan ulet dalam mengamalkan ilmunya di masyarakat.d. Menampilkan kreatifitas anak diberbagai kegiatan.e. Membentuk siswa yang berbudi pekerti luhur untuk hidup mandiri.f. Membentuk siswa yang menguasai IPTEK, sebagaÃ­ bekal diri dÃ¬ masa depan', 'a.Berprestasi bidang akademik  tingkat kabupaten. b. Berprestasi non akademik tingkat nasional. c. Pembinaan ibadah agar siswa beriman, bertaqwa, dan beraqidah kuat, sehingga dapat mengamalkan ajaran Islam dengan benar.d. Membiasakan dan melestarikan budaya daerah nasional', 'Prestasi Tinggi Jujur Pasti', '-80,096', '1,105,435', '1300', '2000'),
('SD', 'Sekolah / Madrasah DIY', 20402154, 'E-1/107/K/GK/1983', '1976-01-01', 'LEMAHBANG', 'KARANGASEM', 23, 2, '.+6287839927271', 'sdmuha2@yahoo.com', '', 'B', 'no sk akreditasi', 'KTSP', 'Terselenggaranya pendidikan yang islami, berprestasi, berbudaya dan berwawasan global', '1. Mengembangkan pendidikan berbasis Al-Qur an dan As Sunnah sebagai media dakwah dan kaderisasi. \n2. Membiasakan perilaku islami,hormat terhadap orang tua, berakhlakul karimah sehingga menjadi teladan sebagai teman dan masyarakat.\n3. Mengembangkan pendidikan yang inovatif, kreatif, dan berdaya tarik dengan mengoptimalkan media yang ada.\n4. Mengoptimalkan proses belajar mengajar untuk meningkatkan pencapaian nilai UAS UKK,USEK dan UN.\n5. Membiasakan perilaku tertib, disiplin,santun terhadap sesama yang berlandaskan iman dan taqwa.\n6. Mengembangkan budaya yang mendukung pembentukan moral generasi bangsa\n7. Memngembangkan pengetahuan bidang iptek,bahasa, olah raga, sesuai bakat, minat serta potensi yang ada .\n8. Memupuk dan mengembangkan warga sekolah yamng berwawasan global dan menguasai teknologi\n', '1. Dapat mengamalkan ajaran agama,hasil/proses pembelajaran dan kegiatan pembiasaan dalam kehidupan sehari- hari\n2. Meningkatkan prestasi akademik maupun  non akademik minimal ditingkat kecamatan\n3. Mampu mengaktualisasikan budaya hidup tertib, disiplin, jujur dan santun dalam tutur kata sopan dalam perilaku terhadap sesama\n4. Terwujudnya sikap perilaku rajin taat dan tertib menjalankan ibadah sesuai dengan tuntunan  agama, dalam praktik kehidupan sehari-hari sehingga membangun insan yang beriman dan bertaqwa serta berakhlak mulia \n5. Mampu menguasai dasar dasar iptek sebagai bekal melanjutkan sekolah yang lebih tinggi \n', 'Mencetak generasi islami', '-80,004,133', '1,105,426,683', '900', ''),
('SD', 'Sekolah / Madrasah DIY', 20402140, '3160/L.1994/DIY.39/7', '1939-02-01', 'Jln.Ki Demang Wana Pawiro Kemorosari I', 'PIYAMAN', 35, 2, '(0274)391343', 'sdmuhammadiyahpiyamanwonosari@', '', 'B', '', 'KTSP', 'Terbentuknya  insan yang sholeh, taqwa, cerdas dan berkarakter', 'a.Â Â Â  Melaksanakan kegiatan peningkatan iman dan taqwa dikalangan warga sekolah.', 'a.Â Â Â Â Â  Membentuk manusia muslim yang beriman, bertaqwa,berakhlak mulia,  cakap, percaya pada diri sendiri, berdisiplin, bertanggung jawab, cinta tanah air, memajukan dan mengembangkan ilmu pengetahuan dan ketrampilan serta beramal menuju terwujudnya masyarakat utama, adil dan makmur yang diridloi Alloh SWT.', '', '-79,404', '1,105,912', '1300', '10 Mbps'),
('SD', 'Sekolah / Madrasah DIY', 20402248, '3172/L.2006//DIY.68/', '1977-09-01', 'DANGGOLO PURWODADI TEPUS GUNUNGKIDUL', 'PURWODADI', 34, 2, '-', 'sdm_purwodadi@yahoo.co.id', 'www.....', 'C', 'no sk akreditasi', 'KTSP', 'terciptanya sekolah sehat berakhlak mulia dan berprestasi', 'Menerapkan 6K dalam pendidikan sehari-hari, 3. Membudayakan berdoa sebelum dan sesudah belajar, 4. Menumbuhkembangkan sikap perilaku dan sikap amaliah yang berlandaskan agama Islam, 5. Mengintegrasikan pendidikan budi peketi ke dalam setiap mata pelajaran, 6. Menumbuhkan semangat keunggulan secara intensif dan daya saing kepada warga sekolah baik prestasi akademik maupun nonakademik, 7. Membudayakan sikap kritis terhadap perkembangn ilmu pengetahuan dan teknologi.', 'Tujuan pendidikan dasar adalah meletakkan dasar kecerdasan pengetehuan, kepribadian, akhlak mulia, serta keterampilan untuk hidup mandiri dan mengikuti pendidikan lebih lanjut. Merujuk pada tujuan pendidikan dasar tersebut, Tujuan Sekolah Dasar Muh Purwodadi lima tahun mendatang (tahun 2011-tahun 2016) adalah sebagai berikut:', '', '-79,023', '1,103,491', '15000', '30'),
('SMP', 'Sekolah / Madrasah DIY', 20401978, '005/1043', '2008-05-31', 'PREBUTAN', 'KEMEJING', 32, 2, '0274 367954', 'smpmuhammadiyahsidorejo@yahoo.', '', 'B', 'no sk akreditasi', 'ktsp', 'UNGGUL DALAM PRESTASI BERDASARKAN IMTAQ DAN BERWAWASAN   IPTEK', 'a. Melaksanakan pengembangan perangkat pembelajaran silabus\nb. Melaksanakan pengembangan sistem penilaian\nc. Melaksanakan pengembangan rencana pelaksanaan pembelajaran\nd. Melaksanakan diversifikasikasi kurikulum pendidikan\ne. Melaksanakan pengembangan kurikulum muatan lokal\nf. Melaksanakan inovasi dalam proses pembelajaran\ng. Melaksanakan peningkatan nilai UNAS\nh. Melaksanakan pengembangan keorganisasian sekolah (organisasi, sarpras, fasilitas, pembiayaan)\ni. Melaksanakan pengembangan fasilitas pendidikan\nj. Melaksanakan pengembangan pembiayaan pendidikan\nk. Melaksanakan pengembangan SDM pendidikan \nl. Melaksanakan pengembangan manajemen (pengelolaan : SDM, pembelajaran, sarpras, penilaian, kesiswaan, kurikulum, administrasi, pembiayaan, pemasaran) sekolah.\nm. Melaksanakan pengembangan otonomi sekolah (Kemandirian, penggalangan partisipasi dan kerjasama stake holder)\nn. Melaksanakan pengembangan metode pembelajaran (proses) di sekolah\no. Melaksanakan pengembangan strategi pembelajaran\np. Melaksanakan pengembangan kegiatan bidang Olahraga\nq. Melaksanakan pengembangan kegiatan bidang wiyata mandala\nr. Melaksanakan pengembangan kegiatan bidang kesehatan sekolah\ns. Melaksanakan pengembangan kegiatan bidang kesenian\nt. Melaksanakan pengembangan kegiatan bidang pramuka\nu. Melaksanakan pengembangan kegiatan bidang KIR\nv. Melaksanakan pengembangan kegiatan bidang agama\nw. Melaksanakan pengembangan kegiatan bidang keterampilan\nx. Melaksanakan pengembangan kegiatan bidang IMTAQ\ny. Melaksanakan pengembangan kegiatan bidang IPTEK\n', 'a. Tercapainya tingkat kelulusan 99,9 % .\nb. Meningkatnya persentase lulusan yang diterima di sekolah pilihan (SMA/SMK/ MA) sekurang-kurangnya 80% dari lulusan.\nc. Terlaksananya program tadarus Al-Quran oleh siswa yang beragama Islam. \nd. Terlaksananya program berbagai kegiatan keagamaan seperti: Bimbingan baca tulis Al-Quran, Pesantren Kilat/ Ramadhan, retreat dan peringatan hari besar keagamaan.\ne. Terlaksananya program 7 K (Keamanan Ketertiban Keindahan  Kebersihan Kenyamanan Kerindangan Kekeluargaan) sehingga sekolah menjadi kondusif\nf. Terlaksanannya progam 5 S (salam, salim, senyum, sapa, dan santun)\ng. Terlaksananya pelayanan yang optimal kepada semua pihak yang memerlukan berdasarkan SAS (Sistem Administrasi Sekolah).\nh. Tersedianya media pembelajaran  standar  yang diperlukan.\ni. Terjalinnya kerja sama antarwarga/keluarga besar sekolah dan lingkungkan sekitar\n', 'UNGGUL DALAM PRESTASI BERDASARKAN IMTAQ DAN BERWAWASAN   IPTEK', '', '', '22000', 'tidak ada'),
('SD', 'Sekolah / Madrasah DIY', 20402233, '3184/L.2018/DIY.71/7', '1971-01-01', 'Jl.Siraman', 'SIRAMAN', 35, 2, '85729290255', 'sdmuhsiraman@yahoo.com', '', 'A', '5.01/BAP-SM/TU/XI/2016', 'KTSP', 'UNGGUL DALAM IMAN DAN TAQWA,CERDAS DALAM BERPIKIR SERTA BERAKHLAK MULIA', 'Meningkatkan pemahaman isi kandungan Al Qur''an', 'Dapat mengamalkan ajaran agama Islam dengan benar dan berakhlak mulia', '', '-79,707', '1,105,733', '2200', ''),
('SD', 'Sekolah / Madrasah DIY', 20402232, '3182/L-2016/DIY-70/7', '1970-05-01', 'SUKOREJO', 'SAMBIREJO', 21, 2, '8179495571', 'sdmuhsukorejo@yahoo.co.id', '', 'A', '5.01/BAP-SM/TU/XI/2016', 'KTSP', 'Terbentuknya Manusia Pembelajar Yang Bertakwa, Unggul Dalam Prestasi, Trampil, Dan Berkemajuan', '1.Â Â Â Â Â Â Â  Melaksanakan pembelajaran dan bimbingan untuk menumbuhkan kesadaran dan ketaatan ketuhanan (spiritual makrifat);', '1.Â Â Â Â Â  Tujuan 5 tahun', '', '-78,278', '1,107,331', '900', '100'),
('SD', 'Sekolah / Madrasah DIY', 20402231, '3165/L.1999/DIY.59/7', '1977-09-01', 'Sumberjo, RT/RW 02/09', 'KARANGMOJO', 20, 2, '6280000000000.0', 'sdmuhsumberejo6@gmail.com', 'www.....', 'A', '5.01/BAP-S/TU/XI/2016', 'KTSP', 'Terwujudnya Insan yang Shaleh dan Shalikhah,Cerdas dan Berdaya Mutu untuk Meraih Prestasi', '1. Melaksanakan program bimbingan khusus untuk meningkatkan mutu kelulusan 2. Melaksanakan bimbingan dan pelatihan dasar komputer sehingga siswa menguasai dan mampu memanfaatkan perkembangan tegnologi 3. Membekali siswa dengan pengetahuan dan pengamalan agama sehingga menjadi siswa yang kuat iman dan amal sholehnya menuju pada tingkatan taqwa kepada Allah SWT 4. Menumbuhkan dan mengembangkan pola pikir dan tindakan yang mencerminkan  akhlak mulia dan budaya mutu dalam kehidupan sehari-hari 5. Melaksanakan pembinaan berbagai bidang olahraga sehingga siswa memiliki daya fisik yang kuat dan tangguh 6. Melaksanakan berbagai pembinaan berbagai bidang seni sehingga siswa memiliki sikap yang santun, humanistik, dan jiwa yang menghargai keindahan 7. Melaksanakan pembinaan dalam bidang seni baca Al-Quran 8. Memberikan pendidikan dan pelatihan berorientasi kecakapan hidup sehingga siswa memiliki keunggulan koparatif dalam lingkungannya.', '1. Menjalankan ajaran agama Islam sesuai dengan tahap perkembangan anak, 2. Mengenal kekurangan dan kelebihan diri sendiri, 3. Mematuhi aturan-aturan sosial yang berlaku dalam lingkungannya, 4. Menghargai keberagaman agama, budaya, suku, ras, dan golongan sosial ekonomi, di lingkungan sekitarnya, 5. Menggunakan informasi tentang lingkungan sekitar secara logis, kritis, dan kreatif, 6. Menunjukan kemampuan berpikir logis, kritis, dan kreatif, 7. Menunjukan rasa keingintahuan yang tinggi dan menyadari potensinya, 8. menunjukan kemampuan memecahkan masalah sederhana dalam kehidupan sehari-hari, 9. menunjukan kemampuan mengenali gejala alam dan sosial di lingkungan sekitar, 10. Menunjukan kecintaan dan kepedulian terhadap lingkungan, 11. Menunjukan kecintaan dan kebanggaan terhadap bangsa, negara, dan tanah air Indonesia, 12. Menunjukan kemampuan untuk melakukan kegiatan seni dan budaya lokal, 13. Menunjukan kebiasaan hidup bersih, sehat, bugar, aman, dan memanfaatkan waktu luang, 14. Berkomunikasi secara jelas dan santun, 15. Berkerjasama dalam kelompok, tolong-menolong, dan menjaga diri sendiri dalam lingkungan keluarga dan teman sebaya, 16. Menunjukan kegemaran membaca dan menulis, 17. Menunjukan ketrampilan menyimak, berbicara, membaca, menulis dan berhitung.', '', '-79.456', '1,107,011', '900', '2000'),
('SD', 'Sekolah / Madrasah DIY', 20402230, '3185/L.2019/DIY.71/7', '1971-01-01', 'Jl. Ki Ageng Giring Km. 05', 'WARENG', 35, 2, '', 'sdmuhwareng@yahoo.com', '', 'A', '', 'KTSP dan K', 'Unggul dalam prestasi, mandiri dan berakhlak mulia', '1. Menanamkan sikap terpuji dan saling menghargai dan toleransi 2. Mengembangkan keterampilan proses dalam pembelajaran 3. Mengembangkan kecerdasan bidang ilmu pengetahuan dan teknologi 3. Memotivasi dan membantu peserta didik untuk mengenali potensi dirinya dengan memberikan wadah dalam kegiatan ekstrakurikuler 4. Memberikan pelayanan prima dan membangun citra sekolah 5. Memberikan kesempatan kepada siswa untuk mengembangkan aspek kecerdasan intelektual, sosial, emosional dan kinestetik secara optimal. 7. Mengembangkan pembelajaran PAIKEM (aktif, inovatif, kreatif, efektif, menyenangkan) 8. Melaksanakan menejemen berbasis sekolah, jujur, dan profesional 9. Membangun dan mengembangkan budaya sekolah yang berkualitas berwawasan global berbasis kearifan lokal 10. Menciptakan lingkungan sekolah yang kondusif', '1. Berkualitas berbasis pada sikap, pengetahuan dan keterampilannya 2. Siswa dapat berkompetisi dan unggul dalam bidang akademis maupun non akademis di tingkat regional, nasional, dan internasional 3. Menjadi sekolah yang maju, berprestasi dan diminati oleh masyarakat 4. Meningkatkan capaian hasil ujian dengan nilai 7,5 rata-rata tiap tahun naik 0,1 5. Seluruh warga sekolah dapat mematuhi tata tertib yang berlaku 6. Seluruh warga sekolah dapat melaksanakan kewajiban dengan didiplin', 'Unggul dalam prestasi, mandiri dan berakhlak mulia', '', '', '1500', '30'),
('SD', 'Sekolah / Madrasah DIY', 20402219, '3161/L.1995/DIY.67/1', '1947-01-01', 'Widoro Kidul, Bendung, Semin, Gunungkidul', 'BENDUNG', 32, 2, '', 'sdmuhammadiyahwidoro@gmai.com', 'http://www.sdmu', 'A', 'no sk akreditasi', 'KTSP ', 'visi misi sekolah SD MUHAMMADIYAH WIDORO adalah Menuju insan beriman, cerdas, berbudi dan bertanggungjawab', '1. Membiasakan Ibadah 2. Menghormati orang tua dan guru 3. Aktif mengikuti lomba dan kegiatan', '1. Berkepribadian luhur 2. Dapat mengamalkan agama 3. Berprestasi dibidang Akademik dan non Akademik 4. Mempunyai bekal ilmu pengetahuan dan teknologi 5. Mempunyai kemandirian dan bertanggungjawab', '', '-78,548', '110,721', '900', ''),
('SD', 'Sekolah / Madrasah DIY', 20402218, '3163/L.1997/DIY.50/7', '1950-10-01', 'Dusun Wonodoyo RT 03 RW 08', 'SUMBERGIRI', 27, 2, '85743830179', 'sd.muh.wonodoyo@gmail.com', 'sdmwonodoyo.blo', 'B', '48200', 'KTSP dan K', 'Tercapainya Iptek yang seimbang dengan Iman dan takwa Bagi Keshalihan Pribadi Anak', '1. Membina dan membekali anak dengan pengetahuan dasar dan keterampilan dasar agar dapat melanjutkan ke jenjang pendidikan sekolah tingkat pertama, 2. Membina dan membekali anak dengan pengetahuan dasar dan keterampilan dasar agar dapat beradaptasi dengan kehidupan dilingkungan alam sekitar, 3. Menanamkan secara dini nilai-nilai ajaran Islam yang bersumber pada Al-Qur an dan Sunnah Rasul sebagai dasar aqidah, ibadah, akhlakul karimah dalam kehidupan masyarakat yang Islami', '1. Siswa beriman dan bertaqwa kepada Tuhan YME dan beerakhlak mulia, 2. Siswa sehat jasmani dan rohani, 3. Siswa memiliki dasar   dasar pengetahuan, kemampuan dan keterampilan untuk melanjutkan pada jenjang yang lebih tinggi, 4. Mengenal dan mencintai bangsa, masyarakat dan kebudayaannya, 5. Siswa kreatif, terampil dan bekerja untuk dapat mengebangkan diri secara terus menerus', 'Mencerdaskan dan Menshalihkan', '  7o57', '  7o57', '900', '5'),
('SD', 'Sekolah / Madrasah DIY', 20402217, '3167/L-2001/DIY-63/7', '1963-08-01', 'JL. Sumber Agung, Tawarsari, Wonosari', 'WONOSARI', 35, 2, '0274 391884', 'sd_muri@yahoo.co.id', '', 'A', 'Dd-048118', 'KTSP ', 'visi SD Muhammadiyah Wonosari adalah Unggul dalam Prestasi, mandiri, terampil dan berakhlakul karimah', 'Misi SD Muhammadiyah Wonosari adalah 1. Mengintegrasikan nilai-nilai Al-Qur an dan Al Hadits dalam materi pembelajaran\n2. Melaksanakan system pendidikan islami\n3. Mengembangkan budaya disiplin dan etos kerja yang tinggi.\n4. Melaksanakan pembelajaran PAKEM \n5. Melaksanakan bimbingan pengembangan bakat dan keterampilan melalui kegiatan ekstrakurikuler\n6. Membudayakan tertib menjalankan ibadah\n7. Mendidik membaca dan menghapal Al Qur an terutama juz 30\n8. Melaksanakan budaya akhlak mulia guna membentuk perilaku siswa yang berkarakter.\n9. Menumbuhkan kesadaran dan kepedulian terhadap lingkungan sekitar\n10. Meningkatkan manajemen partisipasif yang melibatkan siswa, guru, orangtua, komite, yayasan dan masyarakat.', 'Tujuan SD Muhammadiyah Wonosari adalah Terselenggaranya pendidikan yang berkarakter Islam yang bermutu kompetitif untuk mengantarkan peserta didik unggul dalam kepribadian, kompetensi, karya untuk terwujudnya masyarakat utama.', 'Membangun Generasi Qurani', '-79,624,633', '1,106,089,86', '6800', '512'),
('SD', 'Sekolah / Madrasah DIY', 20407430, '421/216/Kpts/2008', '2008-09-07', 'Singkil', 'GIRING', 23, 2, '62800000000000.', 'sdkiagenggiring@ymail.com', '', 'B', '16.01/BAP-SM/TU/X/2014', 'KTSP', 'visi misi sekolah SD Ki Ageng Giring adalah terselenggaranya pendidikan islami, cerdas, terampil, unggul dan terpilih untuk mewujudkan masyarakat utama.', '1. Mengembangkan pendidikan berbasis Al-Qur''an dan As Sunnah sebagai media dakwah dan kaderisasi.', 'Menghasilkan siswa yang beriman dan bertaqwa kepada Allah SWT, berakhlak mulia, sehat jasmani dan rohani serta memiliki kepribadian, menguasai IPTEK, unutk melanjutkan pendidikan pada jenjang yang lebih tinggi dan memiliki ketrampilan sehingga mampu hidup mandiri.', 'Bersama Kita Bisa', '-8,067,895', '1,105,493,833', '900', '30'),
('SD', 'Sekolah / Madrasah DIY', 20401480, '3013/L.1921/DIY.72/7', '1972-01-01', 'JL. WATES KM 7,5 SUMBER', 'BALECATUR', 64, 4, '81328117409', 'sdmuhbalecatur@yahoo.com', '', 'A', '5.01/BAP-SM/TU/XI/2016', 'KTSP ', 'Mencetak Lulusan yang Berprestasi, Terampil yang Berlandaskan Iman dan Taqwa.', '1. Penyelenggaraan Pendidikan yang Mampu Meningkatkan Prestasi Akademik dan Non Akademik Secara Optimal.                                                                                        2. Penyelenggaraan Kegiatan Kesiswaan yang Berbasis Pada Keterampilan.                                                                                                                                                         3. Penyelenggaraan Kegiatan Keagamaan Tertentu Secara Maksimal.                                                                                                                                                                    4. Penyelenggaraan Perilaku Berbudi Pekerti Luhur Terhadap Diri, Keluarga, dan Masyarakat.', '1. Meningkatkan Prestasi Akademik Peserta Didik Secara Bertahap.                                                                                                                                                                     2. Membentuk Peserta Didik yang Mempunyai Keterampilan dalam Bidang - Bidang Tertentu.                                                                                                                                    3. Membentuk Kepribadian Peserta Didik yang Taat Beribadah dan Berbudi Pekerti Luhur Terhadap Diri, Keluarga, dan Masyarakat.', 'Tiada Hari Tanpa Belajar', '-77,973', '1,102,939', '1300', '2.5'),
('SD', 'Sekolah / Madrasah DIY', 20401502, '125/KPTS/PK/1996', '1996-04-10', 'Bendosari Rt 02 Rw 02', 'MADUREJO', 73, 4, '81392372821', 'sidiq_wasito@yahoo.com', '0', 'B', 'no sk akreditasi', 'KTSP', 'visi Sekolah SD Muhammadiyah Bendosari adalah Unggul dalam prestasi, berbudaya, dan berbudi pekerti luhur menurut Al-Qur,an dan as-Sunnah', '1. Menciptakan suasana belajar yang kondusif. 2. Melaksanakan pembelajaran dan bimbingan secara efektif. 3. menumbuhkan semangat keunggulan untuk mencapai untuk mencapai prestasi. 4. Menciptakan budaya disiplin. 5. Membantu siswa untuk mengenali diri sehingga dapat berkembang secara optimal. 6. Membiasakan hidup yang sesuai dengan ajaran Islam.', '1. Meletakkan dasar kecerdasan,pengetahuan, kepribadian, akhlak mulia, serta keterampilan untuk hidup mandiri dan mengikuti pendidikan lebih lanjut. 2. Menghasilkan keluaran yang memenuhi Standar Kompetensi Lulusan ( SKL ) dan Standar Kompetensi Mata Pelajaran', '', '-77,966', '1,104,688', '900', '0'),
