('SD', 'Sekolah / Madrasah DIY', 20401485, 'E-5/e.03/SDM-03/1990', '0000-00-00', 'Jl. Perumnas, Ring Road Utara, Gorongan', 'CONDONGCATUR', 63, 4, '274486619', 'sdmuhcondongcatur@yahoo.com', 'http://sdmuhcc-', 'A', '28.02/BAP/TU/X/2011', 'Kurikulum ', 'Mewujudkan generasi Muhammadiyah berkarakter unggul Islami, cerdas, trampil, berbudaya, dan mencerahkan serta siap berkompetisi di dunia global', '1. Melaksanakan pembelajaran dengan pendekatan Saintifik, discovery based learning, project based learning dan bimbingan secara intensif untuk mencapai tingkat ketuntasan dan daya serap yang tinggi sehingga peserta didik  dapat masuk SMP sesuai pilihannya.', '1. tujuan', 'Sekolah Islami, Kreatif dan Inovatif', '77.617', '1,104,067', '46200', '10 Mbyte'),
('SD', 'Sekolah / Madrasah DIY', 20401497, '3037/L.1945/DIY.72/7', '1977-09-01', 'JL LPMP DHURI', 'TIRTOMARTANI', 66, 4, '6280000000000.0', 'sdm.dhuri@yahoo.com', '', 'A', '21.01/BAP-SM/TU/XII/2013', 'KTSP ', 'Unggul dalam prestasi, Berakhlak mulia, Berwawasan lingkungan,  mampu bersaing di era global.', '1. Terwujudnya pengembangan kurikulum yang adaptif dan proaktif, 2. Terwujudnya proses pembelajaran yang efektif dan efisien, 3. Terwujudnya lulusan yang cerdas dan kompetitif', '1. Terwujudnya warga sekolah yang memiliki budaya disiplin tinggi, 2. Terlaksananya pembelajaran yang menyenangkan, dinamis, kreatif, dialogis dan produktif.', '', '-77,641', '1,104,678', '9000', '0'),
('SD', 'Sekolah / Madrasah DIY', 20401496, '2990/L.1898/DIY.27/7', '1977-09-01', 'Karanggawang, Mororejo, Tempel', 'MOROREJO', 76, 4, '85228367835', 'sdmuhdomban1@yahoo.co.id', '', 'A', 'no sk akreditasi', 'KTSP dan K', 'Unggul dalam prestasi berdasar Iman, Taqwa, dan Budaya Bangsa.', '1. Meningkatkan mutu siswa.', '1. Siswa dapat mengamalkan ajaran agama hasil proses pembelajaran dan kegiatan pembiasaan,', 'Berprestasi yang Islami', '', '', '1800', '1'),
('SD', 'Sekolah / Madrasah DIY', 20401495, '3024 / L 1932 / DIY.', '1968-01-01', 'KARANGGAWANG', 'MOROREJO', 76, 4, '81336448541', 'sdmuhd2@gmail.com', '-', 'A', '22.01/BAP-SM/TU/X/2015', 'KTSP', 'Unggul dalam agama, akademis dan non akademis, berakhlak mulia, cerdas, terampil dan berwawasan luas.', '1. Melaksanakan ibadah sesuai dengan kaidah agama Islam berdasarkan Al Quran dan Al Hadits.', '1. Mencapai tujuan pendidikan Muhammadiyah, yaitu: Mewujudkan manusia muslim yang bertakwa, berkhlak mulia, cakap, percaya kepada diri sendiri, cinta tanah air dan berguna bagi masyrakat dan negara, beramal menuju terwujudnya masyarakat utama adil dan makmur yang diridhoi Allah SWT.\n', 'Smart Is Crucial, Behavior Is More  (Pintar itu penting, tetapi perilaku itu lebih penting', '', '', '900', '10'),
('SD', 'Sekolah / Madrasah DIY', 20401493, '3005/L.1913/DIY.62/7', '1977-09-01', 'JALAN KYAI PANGGER, PANGGERAN', 'TRIHARJO', 75, 4, '0274 4361575', 'sddombanempat@yahoo.co.id', '-', 'B', '10.01/BAP-SM/TU/XI/2012', 'KTSP', 'INSERT INTO `profil` (`jenjang`, `nama_sekolah`, `npsn`, `sk_pendirian`, `tgl_pendirian`, `alamat`, `kel`, `kec`, `kab`, `telepon`, `email`, `web`, `akreditasi`, `sk_akreditasi`, `kurikulum`, `visi`, `misi`, `tujuan`, `moto`, `koordinat_long`, `koordinat_lat`, `listrik`, `akses_internet`) VALUES
('SD', 'Sekolah / Madrasah DIY', 20401343, 'III.A/1.b/449/1999', '1999-11-24', 'Tengahan', 'SENDANGAGUNG', 67, 4, '0274 367954', 'sdmuh_tengahan@yahoo.co.id', '', 'A', '22.01/BAP-SM/TU/X/2015', 'KTSP dan K', 'visi misi sekolah SD Muhammadiyah Tengahan adalah Terwujudnya Pribadi yang Unggul, Islami, dan Berbudaya.', '1. Melaksanakan pembelajaran efektif, 2. Melaksanakan pembelajaran aktif, inovatif, kreatif, dan menyenangkan, 3. Melaksanakan budaya tertib waktu, kerja, administrasi, dan berpakaian, 4. Melaksanakan pengembangan nilai budaya dan pendidikan karakter, 5. Melaksanakan budaya bersih menuju hidup sehat, 6. Melaksanakan kegiatan ekstra kurikuler sesuai potensi siswa, 7. Melaksanakan budaya salam, senyum, sapa, dan sopan', '1. Mencerdaskan peserta didik dan guru sehingga menjadi sekolah unggul dan diminati masyarakat, 2. Terlaksananya pembelajaran yang menyenangkan, dinamis, kreatif, dan efektif, 3. Meraih prestasi akademik dan non akademik, 4. Mengamalkan ajaran Islam hasil proses pembelajaran dan pengembangan diri, 5. Terlaksananya kegiatan ekstrakurikuler untuk menyeimbangkan perkembangan kedua belahan otak, 6. Terlaksananya budaya tertib, bersih, salam, senyum, sapa, dan sopan ekstrakurikuler untuk menyeimbangkan perkembangan kedua belahan otak,', '', '-77,332', '1,103,491', '1300', '30'),
('SD', 'Sekolah / Madrasah DIY', 20401353, '550/KPTS/2015', '1953-08-01', 'BAKI, BOKOHARJO, PRAMBANAN, SLEMAN', 'BOKOHARJO', 73, 4, '81215949998', 'sdm_mbs@yahoo.co.id', 'www.sdmuhammadi', 'B', '-', 'KTSP ', 'Terwujudnya Generasi Unggul dan Berkepribadian Islami', '1.Menanamkan Tauhid, 2.Membimbing pengamalan ajaran Islam, 3.Mengembangkan kecerdasan akademik dan non akademik, 4. Membimbing untuk bisa mandiri, 5. Mengembangkan potensi sesuai bakat dan minat peserta didik', '1. Mengamalkan ilmu agama yang didapat di sekolah dengan baik, 2. Hafal Juz 30, 3. Hafal 40 Hadits dan do''a harian, 4. Menjalankan kehidupan yang islami, 5. Menjadi anak yang mandiri, 6. Menguasai Bahasa Arab dan Bahasa Inggris dasar, 7. Menerapkan budaya tata krama, 8. Berani berbicara di podium/kultum, dan 9. Menguasai materi SD dengan baik.', 'Mantapkan hati meraih prestasi, Menggapai cita dan terdepan di setiap peran', '-79,023', '1,103,491', '15000', '0'),
('SD', 'Sekolah / Madrasah DIY', 20401325, '3023/L.1931/DIY.68/7', '1968-01-01', 'Jowah', 'SIDOLUHUR', 65, 4, '85729681164', 'sdsangonan2@yahoo.com', '', 'A', 'no sk akreditasi', 'KTSP', 'Unggul Dalam Prestasi, Kreatif, Terampil, Bertaqwa Terhadap Tuhan Yang Maha Esa', '(1.) Mengoptimalkan proses pembelajaran yang aktif, inovatif, kreatif dan menyenangkan, (2.) Melaksanakan pembelajaran secara efektif dan efisien di bidang seni budaya, olahraga dan life skill baik pada kegiatan intra kurikuler dan ekstra kurikuler, (3.) Memupuk keimanan dan ketaqwaan terhadap Allah SWT.', '(1.) Siswa beriman dan bertaqwa kepada Tuhan YME dan berakhlaq mulia, (2.) Siswa menguasai dasar-dasar target keterampilan untuk melanjutkan pendidikan pada jenjang yang lebih tinggi, (3.) Siswa mampu meraih prestasi akademik maupun non akademik, (4.) Siswa mampu berperilaku Islami.', '', '-7.76', '110.288', '1300', ''),
('SD', 'Sekolah / Madrasah DIY', 20401363, '2988/L.1896/DIY.28/7', '1938-07-01', 'KEMUSUH', 'BANYUREJO', 76, 4, '', 'sdmuhammadiyahngabean1@yahoo.c', '', 'B', '21.01/BAP-SM/TU/XII/2013', 'KTSP', 'visi misi sekolah SD Muhammadiyah Ngabean 1 adalah Unggul dalam imtaq dan iptek serta berakhlaqul karimah dalam mempersiapkan kader bangsa yang amanah', 'Misi Sd Muhammadiyah Ngabean 1 Adalah :.Membina Siswa agar Memiliki Fondamen agama islam yang kuat, Mengembangkan Kecerdasan Siswa agar memiliki wawasan yang luas, menguasai teknologi informasi dan komunikasi serta bisa mengembangkan dan mengepresikan karya seni budaya , Membiasakan Siswa dalam kehidupan sehari- hari yang mencerminkan sikap yang sopan dan santun, Mengondisikan siswa agar terpupuk jiwa dan semangat kebangsaaan yang mandiri dalam mensikapi perkembangan jaman', '1. Memberikan bakal kemampuan dasar dan ajaran islam kepada peserta didik untuk mengembangkan diri dan kehidupan sebagai pribadi, anggota persyarikatan muhammadiyah serta masyarakat , warga negara dan anggota umat manusia 2. Mempersiapkan Peserta didik untuk mengikuti pendidikan menengah3. Mengembangkan potensi peserta didik agar menjadi manusia yang berimandan bertaqwa kepada tuhan yang maha esa , beraklaq mulia,sehat,berilmu, cakap,kreatif dan mandiri 4. membentuk kader - kader bangsa yang demokratis, dan bertanggung jawab', '', '-76,825', '1,102,985', '1300', 'Media Net'),
