('SMP', 'Sekolah / Madrasah DIY', 20400312, 'PIMPINAN PUSAT MUHAM', '1984-03-01', 'DERMAN', 'SUMBERMULYO', 8, 1, '2742810135', 'smpmudabali@gmail.com', 'www.....', 'B', '10/01/BAP-SM/TU/XI/2012', 'KTSP dan K', 'MENJADIKAN SEKOLAH UNGGUL DALAM PENGEMBA NGAN AKHLAK MULIA,KECERDASAN DAN KETERAMPILAN', '1.MENDIDIK MENGAJAR&MELATIH MEMBACAAL QUR''AN  2.MENDIDIK ,MENGAJAR &MEMBIBING SHOLAT WAJIB DAN SUNAT 3.MENANAMKAN DAN TELADAN AHLAKUL KARIMAH  4MENYELENGGARAKAN KBM PRINSIP PAIKEM 5.MENGUPAYAKAN PRESTASI BELAJAR YANG OPTIMAL 6.MENINGKATKAN PRESTASI SISWA DALAM BERBAGAI LOMBA TINGKAT KABUPATEN /PROPINSI 7.MEMBERIKAN BEKAL KETRAMPILAN KECAKAPAN HIDUP 8.MENDIDIK DAN BERORGANISASI 9.MEMBINA KADER ORGANISASI', '1.............2.................3...........', '', '-79.302', '110.3302\n', '2200', '30'),
