('SMP', 'Sekolah / Madrasah DIY', 20400314, '068/H/1986', '1986-04-25', 'Jl. Jogja-Wonosari Km.14 Piyungan Srimartani Piyun', 'SRIMARTANI', 14, 1, '0851-0088-0307', 'smp_muhpy@yahoo.co.id', 'www.smpmuhpiyun', 'A', '10.01/BAP-SM/TU/XI/2012', 'KTSP dan K', 'Jujur, Cerdas, Terampil dan Berakhlak Mulia', 'a. Mewujudkan kehidupan Islami \nb. Melaksanakan pengembangan Kurikulum \nc. Melaksanakan pengembangan SDM Pendidik dan tenaga Kependidikan \nd. Melaksanakan pengembangan proses pembelajaran \ne. Melaksanakan Rencana Induk Pengembangan Fasilitas Sekolah \nf. Melaksanakan peningkatan kualitas lulusan \ng. Melaksanakan peningkatan program MBS \nh. Melaksanakan pengembangan penilaian\n', 'A. Tujuan Umum\nTujuan Umum Pendidikan di SMP Muhammadiyah Piyungan mengacu pada tujuan umum Pendidikan Dasar yaitu meletakkan dasar kecerdasan, pengetahuan, kepribadian, akhlak mulia, serta keterampilan untuk hidup mandiri dan mengikuti pendidikan lebih lanjut.\n\nB. Tujuan Khusus\n  Sesuai dengan Visi dan Misi Sekolah, serta Tujuan perguruan Muhammadiyah, maka tujuan Pendidikan SMP Muhammadiyah Piyungan adalah :\n1). Mewujudkan peserta didik yang bertaqwa, berakhlak mulia, cerdas, terampil, dan percaya diri sendiri, cinta tanah air, dan berguna bagi Masyarakat dan Negara, mampu beramal menuju terwujudnya masyarakat adil dan makmur yang diridhoi ALLAH SWT.\n2). Mewujudkan manusia muslim yang taat menjalankan agama.\n3). Terwujudnya muslim yang berakhlak muluia, jujur dalam segal;a tingkah laku\n4). Meningkatkan kemampuan peserta didik baik dibidang akademik maupun non akademik\n5). Menghasilkan lulusan yang berkualitas dan mampu bersaing.\n', '', '-7.9023', '1,104,751', '8800', '5'),
('SMP', 'Sekolah / Madrasah DIY', 20400315, '066/H/1986', '1986-04-25', 'Kanggotan', 'PLERET', 6, 1, '(0274) 4546181', 'smpmpleret@yahoo.com', '-', 'A', '10.01/BAP-SM/TU/XI/2012', 'KTSP, K13', 'visi SMP Muhammadiyah Pleret adalah Taqwa,cerdas,berakhlaq mulia dan berkepribadian Indonesia', 'a) Membina kehidupan beragama dan akhlaq mulia yang menunjukkan karakter bangsa Indonesia baik disekolah maupun di rumah', 'Tujuan Pendidikan Dasar\nTujuan Pendidikan Dasar di SMP Muhammadiyah Pleret adalah meletakkan dasar kecerdasan,pengetahuan,kepribadian,akhlaq mulia,serta keterampilan yang berkarakter bangsa Indonesia untuk hidnp mandiri untuk mengikuti pendidikan labih lanjut.\n', 'Mendidik sumber daya manusia dengan spirit MUSABA\nM Menjadikan Allah SWT. Sebagai sumber k', '-78,671', '1,103,975', '3100', 'Telkomsel Flash'),
('SMP', 'Sekolah / Madrasah DIY', 20400324, '2969/M.604/DIY.64/77', '0164-08-01', 'Blali', 'SELOHARJO', 3, 1, '', 'smpm1pdg@yahoo.com', '', 'A', '10.01/BAP-SM/TU/XI/2012', 'KTSP dan K', 'Visi SMP Muhammadiyah 1 Pundong adalah Membentuk sumber daya manusia yang unggul, bertaqwa, breakhlak mulia, cerdas, terampil dan berdisiplin.', '1. Mewujudkan lulusan dengan kemampuan akademik tinggi, bisa berpikir cepat dan dapat mengatasi berbagai persoalan yang dihadapinya; 2. Mewujudkan lulusan yang memiliki wawasan kebangsaan yang tinggi dan cinta tanah air; 3. Mewujudkan nilai-nilai solidaritas bagi kehidupan sekolah; 4. Mewujudkan lulusan yang taat beribadah, mengamalkan ajaran agamanya, dan selalu melakukan amar ma`ruf nahi munkar; 5. Mewujudkan kemampuan olahraga yang tangguh dan kompetitif; 6. Mewujudkan kemampuan yang tangguh dan kompetitif; 7. Mewujudkan kemampuan HW yang menjadi suri tauladan; 8. Mewujudkan sekolah progresif, inovatif dan visioner; 9. Mewujudkan organisasi sekolah yang terus belajar (school that learns);10. Mewujudkan fasilitas sekolah yang memadai, fungsional, relevan, mutakhir, dan berwawasan kedepan; 11.Mewujudkan pendidik dan tenaga kependidikan yang profesional, memiliki komitmen dan dedikasi tinggi; 12. Mewujudkan manajemen berbasis sekolah yang tangguh; 13. Mewujudkan pembiayaan pendidikan yang memadai, wajar dan adil; 14. Mewujudkan kebiasaan menghargai prestasi; 15. Mewujudkan kebiasaan tertib dalam beribadah; 16. Mewujudkan kebiasaan pengamalan ajaran agama; 17. Mewujudkan kehidupan sekolah yang harmonis dan agamis; 18. Mewujudkan sekolah sebagai wiyata mandala yang menjadi surga bagi warganya (madrosati jannati); 19. Mewujudkan sekolah sehat, tertib, ramah dan penuh dengan sopan santun; 20. Mewujudkan lingkungan sekolah yang nyaman, aman, rindang, asri, dan bersih.', '1. Sekolah mampu menghasilkan lulusan dengan capaian rata-rata NUN 76; 2. Terciptanya sikap mental peserta didik yang mampu melaksanakan, mengamalkan ibadah dengan tertib dan membaca Al Quran dengan baik dan lancar; 3. Terciptanya mental dan karakter peserta didik yang dapat menjadi contoh dalam masyarakat; 4. Terciptnya peserta didik yang memiliki kemampuan akademik, teknologi, dan seni budaya; 5. Sekolah mampu menghasilkan lulusan yang berpartisipasi aktif dalam kehidupan bernegara; 6.Sekolah mampu menghasilkan lulusan yang taat beribadah; 7. Sekolah mampu menghasilkan lulusan yang selalu mengamalkan ajaran agamanya dalam kehidupan sehari-hari; 8. Sekolah mampu menghasilkan lulusan yang gemar melakukan `amar ma`ruf nahi munkar;9. Sekolah mamu membentuk tim olahraga dan atlet yang memenangi lomba kabupaten dan provinsi; 10. Sekolah mampu membentuk kepanduan HW yang aktif berpartisipasi dalam kegiatan sosial dan kepanduan; 11. Sekolah mampu menghasilkan lulusan yang berperilaku baik dalam kehidupan bermasyarakat; 12. Sekolah mampu memenuhi proses persekolahan yang terencana, terorganisir, terlaksana, terkontrol, dan terevaluasi dengan baik; 13. Sekolah mampu memenuhi kebutuhan fasilitas sekolah yang memadai, fungsional, relevan, mutakhir, dan berwawasan kedepan; 14. Sekolah mampu memenuhi ketersediaan pendidik dan tenaga kependidikan yang profesional, memiliki komitmen dan dedikasi tinggi; 15. Sekolah mampu memenuhi ketersediaan pendidik dan tenaga kependidikan yang tangguh, ulet dan mampu memberikan solusi atas berbagai persoalan sekolah secara konstruktif; 16. Sekolah mampu menghasilkan menerapkan manajemen berbasis sekolah yang tangguh; 17. Sekolah mampu melakukan proses penilaian pendidikan yang tepat, menyeluruh, dan adil dengan melibatkan guru, sekolah dan pemerintah; 18. Sekolah mampu menyediakan pembiayaan pendidikan yang memadai, wajar dan adil; 19. Sekolah mampu mewujudkan kebiasaan tertib dalam beribadah; 20. Sekolah mampu mewujudkan kebiasaan pengamalan ajaran agama; 21. Sekolah mampu mewujudkan kehidupan sekolah yang harmonis dan agamis; 22. Sekolah mampu mewujudkan sekolah sebagai wiyata mandala yang menjadi surga bagi wargany (mad`roti jannati); 23. Sekolah mampu mewujudkan sekolah sehat, tertib, ramah dan penuh dengan sopan santun; 24. Sekolah mampu mewujudkan lingkungan sekolah yang nyaman, aman, rindang, asri dan bersih.', '', '-79,465', '110.363', '5000', ''),
