('MA', 'Sekolah / Madrasah DIY', 20411881, '3670/II.169/DIY.32/7', '1932-07-05', 'Sewugalur', 'KARANGSEWU', 50, 3, '6290000000000.0', 'madumuhgalur@yahoo.co.id', 'http://madu-muh', 'A', 'Ma.026776', 'KTSP dan K', 'visi MA Darul Ulum Muhammadiyah Galur adalah Terwujudnya Generasi Islami yang Cerdas, Terampil dan Mandiri (Geni CTM).', '1. Memberikan pelayanan pendidikan yang Islami; 2. Membina generasi muda agar memiliki sense of social; 3. Menyediakan fasilitas yang memadai; 4. Menyelenggarakan pendidikan dan keterampilan.', '1. Mencapai tujuan pendidikan Muhammadiyah yaitu mewujudkan manusia muslim yang bertaqwa, berakhlak mulia, cakap, percaya diri sendiri, cinta tanah air dan berguna bagi masyarakat dan negara, beramal menuju terwujudnya masyarakat utama dan makmur yang diridhoi Allah Subhanahu wa ta ala; 2. Mewujudkan dan mengembangkan ilmu pengetahuan dan keterampilan untuk kemajuan umat dalam pembangunan masyarakat, bangsa dan negara; 3. Bersama pemerintah memajukan penyelenggaraan pendidikan dan kebudayaan sesuai dengan Undang-undang 1945 pasal 31; 4. Membentuk calon kader persyarikatan Muhammadiyah; 5. Menyiapkan calon  ulama, zu ama dan muballigh yang mandiri berlandaskan al-Quran dan Sunnah; 6. Menjadi teladan bagi masyarakat lingkungan sekolah khususnya dan masyarakat kecamatan Galur pada umumnya.', 'Ikhlas bekerja dan beramal.', '-7.9435483', '110.2083333', '2200', '500'),
