('SMP', 'Sekolah / Madrasah DIY', 20401983, '0402/H/1986', '1955-08-01', 'Jalan Brigjen Katamso 5', 'KEPEK', 35, 2, '0274 391330', 'smpmuh1wonosari.gk@gmail.com', 'www.smpmuh1wono', 'A', '28.2/BAP/TU/X/2011', 'KTSP', 'Terwujudnya lulusan yang berakhlak mulia, mandiri, dan berprestasi', '1. Meningkatkan pengamalan agama Islam  yang  sesuai dengan tuntunan Muhammadiyah, 2.Â Meningkatkan kedisiplinan dalam mentaati tata tertib sekolah dan aturan hidup beragama, bermasyarakat, berbangsa, dan bernegara, 3.Â Melaksanakan bimbingan dan PBM yang efektif dan intensif sehingga menumbuhkan semangat berkompetensi dalam bidang akademik, 4.Â Memberikan ekstrakurikuler olahraga, seni/keterampilan, dan minat khusus, 5.Â Menerapkan manajemen partisipatif dengan seluruh warga sekolah sehingga dapat memberikan layanan prima terhadap siswa, orang tua, dan masyarakat.', '1.Â a. 70  % siswa melaksanakan ibadah sesuai tuntunan Muhammadiyah, b. 70% siswa mampu membaca al- Quran dan doa sehari-hari, 2.Â 80 % siswa taat pada aturan dan  norma-norma hidup dengan baik, 3.Â a. Rata-rata peningkatan Nilai Ujian Nasional + 0,5.     b. Rata-rata peningkatan Nilai Ujian Sekolah + 0,5.  c.Â Proporsi lulusan diterima di SMA/SMK yang dianggap unggul mencapai 50%. 4.Â a. Memiliki tim olahraga yang mampu menjadi juara kabupaten minimal 2 cabang olahraga. b. Memiliki tim karya ilmiah yang mampu menjadi juara tingkat nasional. c. 20% siswa mempunyai keterampilan menjahit, tata boga, dan tata rias. d. 10% siswa menghasilkan produk keterampilan  yang layak jual. 5.Â a. Terpenuhinya sarana prasarana sekolah yang memadai dan digunakan secara maksimal, b.Â Memiliki lingkungan yang tertib, aman, nyaman, bersih, indah, dan kondusif c.Â Meningkatkan pengelolaan unit usaha pertokoan yang mampu meningkatkan kesejahteraan warga sekolah dan lingkungan', '', '-7,964,624', '110,599,638', '4400', '1');
  Beriman Terampil dan Berprestasi dalam IPTEK   \n', 'MISI SMP MUHAMMADIYAH PANGGANG\nMisi SMP Muhammadiyah Panggang adalah \n1. Melaksanakan kegiatan keagamaam secara optimal.\n2. Melaksanakan proses belajar mengajar dengan tertib, terencana, terarah, terpadu, berkesinambungan dan bertanggungjawab.\n3. Melaksanakan kegiatan pembelajaran tambahan, atau les, untuk meningkatkan prestasi akademik, khususnya dalam menghadapi ujian nasional.\n4. Menciptakan dan mengembangkan lingkungan pendidikan yang Islami, edukatif, harmonis, bersih, aman, tertib, inovatif, dan kompetitif.\n5. Melaksanakan kegiatan ekstrakuriluler guna mengembangkan bakat dan minat siswa di bidang seni budaya, olah raga, ketrampilan.\n6. Mengikuti / menyelenggarakan lomba bidang studi, seni budaya, olah raga, dan agama, baik di tingkat sekolah, kecamatan, kabupaten, propinsi, maupun nasional.\n7. Melaksanakan pembelajaran lingkungan alam dan sosial masyarakat sekitar, guna menanamkan nilai   nilai kemasyarakatan dan mencintai lingkungan hidup.\n8. Melaksanakan upacara bendera tiap hari Senin dan hari besar nasional sebagai upaya menanamkan kedisiplinan, cinta tanah air, dan bangsa Indonesia.\n9. Melaksanakan dan menegakkan tata tertib sekolah dengan penuh kedisiplinan, keadilan, dan bertanggung jawab.\n10. Melaksanakan bimbingan dan konseling bagi siswa untuk penyelesaian permasalahan yang timbul, dan mencapai kemandirian di masa depan.\n11. Menciptakan situasi lingkungan sekolah yang kondusif.  \n\n\n\n', 'TUJUAN SEKOLAH mengemban visi sekolah, SMP Muhammadiyah Panggang mencanangkan tujuan pendidikan yaitu mendidik siswa menjadi manusia Indonesia seutuhnya yang berakhlak, berperilaku santun, cerdas, terampil, dan mampu bertanggung jawab, baik terhadap dirinya sendiri maupun lingkungannya. Dapat menjuarai berbagai lomba bidang akademik maupun non akademik,  di tingkat kecamatan.\n1. Terciptanya lingkungan sekolah yang Islami, harmonis, bersih, aman, tertib, inovatif, dan kompetitif.\n2. Terjalin hubungan yang akrab dengan masyarakat dan lingkungan alam di sekitar sekolah.\n3. Terciptanya  kedisiplinan, ketertiban, cinta tanah air, dan bangsa Indonesia di kalangan peserta didik dan guru..\n4. Siswa dapat belajar dengan tertib di lingkungan yang bersih, sehat, aman, nyaman, dan penuh kedamaian.\n5. Setelah lulus peserta didik mampu mandiri untuk meraih masa depannya. \n6. Terciptanya situasi kehidupan di lingkungan sekolah yang kondusif.\na. Tujuan Jangka menengah\nTujuan jangka menengah yang hendak dicapai sesuai dengan visi dan misi sekolah yang telah digariskan, adalah  :\n1. Peningkatan kemampuan seni baca tulis Al   Qur an, tercipta kebiasaan pada siswa untuk sholat berjamaah secara tertib, dan dapat berceramah di depan umum serta berakhlak mulia.\n2. Peningkatan kemampuan  dan penguasaan ajaran agama Islam  bagi peserta didik sehingga mempunyai kemandirian dalam kehidupannya serta berperan aktif sebagai anggota masyarakat .\n3. Meraih kejuaraan bidang agama Islam di tingkat Kecamatan , Kabupaten dan propinsi.\n4. Semua guru mampu membuat perangkat pembelajaran dan melaksanakan KBM sesuai dengan silabus dan RPP yang dibuatnya..\n5. Peningkatan prestasi di bidang ilmu pengetahuan dan kemampuan peserta didik sehingga dapat  melanjutkan pendidikan pada jenjang yang lebih tinggi dan dapat mengembangkan diri sejalan dengan perkembangan ilmu pengetahuan, teknologi, dan kebudayaan sesuai dengan ajaran agama Islam.\nPeningkatan prestasi di bidang akademik 0,2 setiap tahun. SMP Muhammadiyah Panggang mempunyai tujuan :\n1. Tujuan khusus\nMemberikan bekal kemampuan dasar ajaran agama Islam kepada peserta didik untuk mengembangkan diri dan kehidupannya sebagai pribadi, anggota perserikatan Muhammadiyah serta masyarakat, warga negara dan anggota umat manuasia.\n2. Tujuan Umum\nb. Tujuan jangka Pendek\nTujuan Jangka Pendek yang hendak dicapai sesuai dengan misi sekolah yang telah digariskan adalah :\n7. Dalam waktu 1 tahun siswa dapat membaca Al Qur an dan sudah melaksanakan ibadah sholat wajib dengan tertib dan baik.\n8. Dapat menjuarai dalam berbagai lomba di bidang keagamaan di tingkat kecamatan dan kabupaten.\nD. TUJUAN SEKOLAH\nDalam mengemban visi sekolah, SMP Muhammadiyah Panggang mencanangkan tujuan pendidikan yaitu mendidik siswa menjadi manusia Indonesia seutuhnya yang berakhlak, berperilaku santun, cerdas, terampil, dan mampu bertanggung jawab, baik terhadap dirinya sendiri maupun lingkungannya. Dapat menjuarai berbagai lomba bidang akademik maupun non akademik,  di tingkat kecamatan.\n1. Terciptanya lingkungan sekolah yang Islami, harmonis, bersih, aman, tertib, inovatif, dan kompetitif.\nTUJUAN SEKOLAH\nDalam mengemban visi sekolah, SMP Muhammadiyah Panggang mencanangkan tujuan pendidikan yaitu mendidik siswa menjadi manusia Indonesia seutuhnya yang berakhlak, berperilaku santun, cerdas, terampil, dan mampu bertanggung jawab, baik terhadap dirinya sendiri maupun lingkungannya. Dapat menjuarai berbagai lomba bidang akademik maupun non akademik,  di tingkat kecamatan.\n1. Terciptanya lingkungan sekolah yang Islami, harmonis, bersih, aman, tertib, inovatif, dan kompetitif.\n2. Terjalin hubungan yang akrab dengan masyarakat dan lingkungan alam di sekitar sekolah.\n3. Terciptanya  kedisiplinan, ketertiban, cinta tanah air, dan bangsa Indonesia di kalangan peserta didik dan guru..\n4. Siswa dapat belajar dengan tertib di lingkungan yang bersih, sehat, aman, nyaman, dan penuh kedamaian.\n5. Setelah lulus peserta didik mampu mandiri untuk meraih masa depannya. \n6. Terciptanya situasi kehidupan di lingkungan sekolah yang kondusif.\na. Tujuan Jangka menengah\nTujuan jangka menengah yang hendak dicapai sesuai dengan visi dan misi sekolah yang telah digariskan, adalah  :\n1. Peningkatan kemampuan seni baca tulis Al   Qur an, tercipta kebiasaan pada siswa untuk sholat berjamaah secara tertib, dan dapat berceramah di depan umum serta berakhlak mulia.\n2. Peningkatan kemampuan  dan penguasaan ajaran agama Islam  bagi peserta didik sehingga mempunyai kemandirian dalam kehidupannya serta berperan aktif sebagai anggota masyarakat .\n3. Meraih kejuaraan bidang agama Islam di tingkat Kecamatan , Kabupaten dan propinsi.\n4. Semua guru mampu membuat perangkat pembelajaran dan melaksanakan KBM sesuai dengan silabus dan RPP yang dibuatnya..\n5. Peningkatan prestasi di bidang ilmu pengetahuan dan kemampuan peserta didik sehingga dapat  melanjutkan pendidikan pada jenjang yang lebih tinggi dan dapat mengembangkan diri sejalan dengan perkembangan ilmu pengetahuan, teknologi, dan kebudayaan sesuai dengan ajaran agama Islam.\nPeningkatan prestasi di bidang akademik 0,2 setiap tahun. SMP Muhammadiyah Panggang mempunyai tujuan :\n1. Tujuan khusus\nMemberikan bekal kemampuan dasar ajaran agama Islam kepada peserta didik untuk mengembangkan diri dan kehidupannya sebagai pribadi, anggota perserikatan Muhammadiyah serta masyarakat, warga negara dan anggota umat manuasia.\n2. Tujuan Umum\nb. Tujuan jangka Pendek\nTujuan Jangka Pendek yang hendak dicapai sesuai dengan misi sekolah yang telah digariskan adalah :\n7. Dalam waktu 1 tahun siswa dapat membaca Al Qur an dan sudah melaksanakan ibadah sholat wajib dengan tertib dan baik.\n8. Dapat menjuarai dalam berbagai lomba di bidang keagamaan di tingkat kecamatan dan kabupaten.\n9. Dalam waktu 1 tahun semua guru sudah dapat membuat perangkat pembelajaran termasuk silabus dan RPP.\n10. Nilai Ulangan Akhir Semester dan nilai Ulangan Kenaikan kelas mengalami peningkatan dari tahun sebelumnya. \n11. Nilai rata   rata Ujian Nasional dapat meningkat 12,11 dari tahun sebelumnya. Dimana rata   rata nilai UN tahun pelajaran 2015 / 2016 adalah 188,14, jadi target rata   rata UN tahun 2016/2017 menjadi 200,25.\n12. Sebagian besar lulusan melanjutkan ke jenjang pendidikan yang lebih tinggi.\n6. \n7. Meraih kejuaraan lomba baik akademik maupun non akademik di tingkat kecamatan, maupun kebupaten.\n8. Peningkatan hubungan antara sekolah dengan masyarakat sekitar dan lingkungan alam di sekitar sekolah.\n9. Terwujudnya  kedisiplinan, ketertiban, cinta tanah air, dan bangsa Indonesia di kalangan peserta didik dan guru secara mantab.\n10. Siswa dapat belajar dengan tertib di lingkungan yang bersih, sehat, aman, nyaman, dan penuh kedamaian.\n11. Setelah lulus peserta didik mampu mandiri untuk meraih masa depannya.\nc. Tujuan Jangka panjang\nTujuan jangka menengah yang hendak dicapai sesuai dengan visi dan misi sekolah yang telah digariskan, adalah  :\n1. Peningkatan kemampuan seni baca tulis Al   Qur an, tercipta kebiasaan pada siswa untuk sholat berjamaah, dan dapat berceramah serta disiplin dan budi pekerti siswa.\n2. Peningkatan kemampuan dasar dan penguasaan ajaran agama Islam peserta didik sehingga mempunyai kemandirian dalam kehidupannya serta berperan aktif sebagai anggota masyarakat.\n3. Meraih kejuaraan bidang agama Islam di tingkat Kecamatan , Kabupaten , propinsi, maupun Nasional.\n4. Semua guru mampu membuat perangkat pembelajaran dan melaksanakan KBM sesuai dengan silabus dan RPP yang dibuatnya serta dikembangkan pada penelitian tindakan kelas.\n5. Peningkatan prestasi di bidang ilmu pengetahuan dan kemampuan peserta didik sehingga dapat  melanjutkan pendidikan pada jenjang yang lebih tinggi dan dapat mengembangkan diri sejalan dengan perkembangan ilmu pengetahuan, teknologi, dan kebudayaan sesuai dengan ajaran agama Islam.\n6. Mencapai nilai rata   rata Ujian Nasional 7,00.\n7. Meraih kejuaraan lomba baik akademik maupun non akademik di tingkat kecamatan, kebupaten, maupun propinsi.\n8. Hubungan antara sekolah dengan masyarakat sekitar dan lingkungan alam di sekitar sekolah semakin kokoh.\n9. Terwujudnya  kedisiplinan, ketertiban, cinta tanah air, dan bangsa Indonesia di kalangan peserta didik dan guru secara mantab.\n10. Siswa dapat belajar dengan tertib di lingkungan yang bersih, sehat, aman, nyaman, dan penuh kedamaian.\n11. Peserta didik mampu mandiri untuk meraih masa depannya.\n\n\n\n\n', 'Unggul Prestasi, Peduli, B