('SMP', 'Sekolah / Madrasah DIY', 20407354, '018/I13/H/Kpts/1989', '1989-04-24', 'NGLORO', 'NGLORO', 30, 2, '81904179812', 'smpmuh.saptosarigk@yahoo.com', 'http://smpmuhsa', 'B', 'Dp 011938', 'KTSP', 'visi misi SMP Muhammadiyah Saptosari adalah Unggul dalam prestasi dan mantap dalam kehidupan beragama.', '1. Melaksanakan PBM yang efektif dan efisien  serta menyenangkan\n2. Melaksanakan dan menumbuhkan semangat bersaing\n3. Menumbuhkan motivasi untuk mendalami, menghayati dan mengamalkan ajaran agama Islam dalam kehidupan sehari-hari\n4. Mengembangkan ketrampilan membatik\n5. Melaksanakan ekstrakurikuler bidang olahraga dan seni\n6. Menciptakan pelayanan prima terhadap siswa, orang tua dan masyarakat\n\n', '1. Sekolah mampu mencapai rata -rata 4 mata pelajaran (bahasa inggris, bahasa indonesia, matematika dan IPA) 6,0;  2. Sekolah memiliki lulusan yang diterima disekolah unggul mencapai 80% dari jumlah kelulusan; 3. Sekolah memiliki kwalitas iman dan taqwa yang ditandai dengan kemampuan membaca Al-Qur''an, akhlakhul karimah serta memiliki wawasan keislaman yang baik; 4. Sekolah mengembangkan ketrampilan membatik; 5. Sekolah melaksanakan Ekstrakurikuler olahraga dan seni; 6. Terpenuhinya sarana dan prasarana sekolah yang memadai dan digunakan secara optimal; 7. Sekolah menciptakan pelayanan prima terhadap siswa, orangtua dan masyarakat,', 'visi misi SMP Muhammadiyah Saptosari adalah Unggul dalam prestasi dan mantap dalam kehidup', '-80.393', '1,105,288', '1300', '150'),
('SMP', 'Sekolah / Madrasah DIY', 20407353, '4454/II-190/DIY-88/1', '1988-04-09', 'Karangtengah', 'DADAPAYU', 31, 2, '-', 'smp_muhammadiyahsemanu@yahoo.c', 'www.....', 'B', '16.01/BAP-SM/TU/X/2014', 'KTSP 2006', 'visi misi sekolah SMP Muhammadiyah Semanu menjadi sekolah Islami, berprestasi, dan terampil berdasarkan wawasan kebangsaan', '1. Terwujudnya pembinaan keimanan dan ketaqwaan terhadap Tuhan yang Mahaesa serta berbudi pekerti luhur, 2. Terwujudnya prestasi dalam bidang akademis, 3. Terwujudnya prestasi dalam bidang nonakademis dan lomba porsenitas, 4. Terwujudnya keunggulan dalam bidang administrasi dan kelembagaan', '1. Terciptanya suasana yang kondusif untuk peningkatan rasa iman dan taqwa kepada Allah swt, 2. Terciptanya pengamalan ajaran Islam yang intensif dalam kehidupan sehari-hari, sehingga tercipta masyarakat Islami di sekolah. 3. Terciptanya peningkatan kualitas pembelajaran, sehingga kegiatan pembelajaran dapat berjalan dengan efektif dan efisien, 4. Berkembangnya pendidikan kecakapan hidup sehingga peserta didik menguasai keterampilan dasar sebagai bekal hidup di masyarakat, 5. Memperoleh selisih GSA (gain score achievement) Nilai UN 6,40 (dari 44,74 menjadi 51,14); selisih GSA Nilai US 0,2 (dari 84,29 menjadi 84,49.), 6. Tumbuhnya kondisi gemar membaca bagi peserta didik, guru, dan karyawan untuk meningkatkan pengetahuan, 7. Terselenggaranya kegiatan ekstrakurikuler dan pelatihan  secara efektif dan efisien guna mengembangkan potensi peserta didik di bidang nonakademis. 8. Terciptanya pengembangan bakat olahraga, keterampilan, dan kesenian yang dimiliki peserta didik sehingga diperoleh bibit unggul, 9. Memiliki tim atletik dan tim bola voli yang mampu menjadi juara tingkat kabupaten, 10. Terciptanya peningkatan profesionalisme pengelola sekolah  sehingga secara institusional dapat  memberikan layanan prima kepada warga sekolah dan warga masyarakat, 11. Terciptanya optimalisasi penggunaan sarana prasarana yang dimiliki sekolah, 12. Pelayanan terhadap guru, karyawan, dan peserta didik semakin  membaik, 13. Memiliki dokumen RPS (RKAS) yang representatif dan komprehensif, 14. Peserta didik berprestasi yang tidak mampu dapat menikmati kesempatan belajar', '', '-80,594', '1,107,045', '2200', '10'),
