('SMA', 'Sekolah / Madrasah DIY', 20402057, '3652/II/51/DIY.78/19', '1979-08-10', 'JL. SIMPANG LIMA', 'GENJAHAN', 27, 2, '2743950122', 'smamuhponjong@gmail.com', 'www.smamuhponjo', 'A', '5.01.BAP-SM/TU/XI/2016', 'KTSP', 'Terwujudnya sekolah yang unggul dalam IMTAQ dan IPTEK serta mampu berkompetensi di masyarakat.', '1. Terwujudnya sekolah yang unggul dalam IMTAQ dan IPTEK serta mampu berkompetensi di masyarakat.\n', '1. Mampu menyelenggarakan pendidikan yang dikelola secara islami.\n2. Mampu mengembangkan pendidik dan tenaga kependidikan yang profesional.\n3. Meningkatkan peserta didik berprestasi akademik maupun non akademik.\n4. Meningkatkan prosentase lulusan untuk melanjutkan ke PT.\n5. Membekali peserta didik mampu mengembangkan ketrampilan.', '', '-79,023', '1,103,491', '15000', '30'),
