('SMA', 'Sekolah / Madrasah DIY', 60724851, '362/KPTS/2011', '2011-10-24', 'JALAN PIYUNGAN KM. 2 MARANGAN', 'BOKOHARJO', 73, 4, '0811 2632008', 'mbs_yogya@yahoo.com', 'www.muhammadiya', 'A', '16.01/BAP-SM/TU/X/2014', 'KTSP  ', 'TERBENTUKNYA LEMBAGA PENDIDIKAN YANG BERKUALITAS DALAM MENYIAPKAN KADER MUHAMMADIYAH BERDASARKAN AL-QUR''AN DAN AS-SUNNAH', '', '1.............2.................3...........', 'MEMBINA IMAN, ILMU DAN AKHLAQ', '', '', '', ''),
('SMA', 'Sekolah / Madrasah DIY', 20401151, '0454/H/1986', '1986-05-28', 'JL. Magelang Km 13 Krapyak Triharjo Sleman', 'TRIHARJO ', 75, 4, '(0274) 4363632', 'smamuhsleman@yahoo.co.id', '-', 'B', 'no sk akreditasi', 'KTSP', 'Terbentuknya manusia yang cerdas, terampil dan berakhlaq mulia', '1. melaksanakan pembelajaran dan bimbingan secara efektif, kreatif dan inovatif 2. mendorong dan mengembangkan potensi diri sehingga berkembang secara optimal 3. menumbuhkan kesadaran dalam menghayati dan mengamalkan nilai - nilai ajaran Islam dan nilai Kebangsaan', '1. terwujudnya prestasi akademik melalui peningkatan nilai UAS dan UAN 2. terwujudnya pengembangan kedisplinan siswa untuk membentuk kepribadian yang tangguh 3. terwujudnya peningkatan aktivitas dan kreativitas siswa melalui pelaksanaan berbagai kegiatan ekstrakulikuler 4. meningkatkan keterampilan untuk hidup mandiri', '', '-77.052', '1,103,467', '1300', '40'),
('SMA', 'Sekolah / Madrasah DIY', 20401147, '3663/II.162/DIY.yg/1', '1979-07-01', 'DHURI Jln. LPMP', 'TIRTOMARTANI', 66, 4, '81328185995', 'smamuhika@yahoo.com', 'wwwsmamuhammadi', 'B', '22.01/BAP-SM/TU/X/2015', 'KTSP', 'ISLAMI,UNGGUL DALAM PRESTASI DAN KOMPETITIF', '1.Menumbuhkan kesadaran untuk menghayati nilai-nilai ajaran islam dan nilai-nilai kebangsaan,sehingga siswa dapat menjadi manusia Indonesia seutuhnya , 2.menjadikan lembaga pendidikan berskala nasional yang unggul dalam prestasi3.Menjadikan anak didik yang sholeh menguasai ilmu pengetahuan dan teknologi diatas landasan iman dan tagwa yang kokoh,sehingga menjadi insan yang mandiri, berwawasan luas, sadar akan keberadaannya dan bermanfaat bagi masyarakat Indonesia yang majemuk, ikhas dan bersungguh-sungguh dalam melaksanakan tugas amar makruf nahi munkar,4. Menjadi tempat bagi karyawan,guru dan kepala sekolah untuk kepentingan, kesejahteraan bersama dan mewujudkan kepentingan profesional, 5.Menjadi tempat bagi insan untuk berprestasi,berkreasi dan mengembangkan diri, 6. Menjadi aset pendidikan nasional yang mencetak manusi unggul,berbudi pekerti yang luhur serta menjadi kebanggaan umat islam dan masyarakat secara luas.', '1.Meningkatkan prestasi akademik dan non akademik melalui pencapaian nilai ujian akhir dan prestasi di bidang lain (keagamaan,kesenian,olahraga, dan karya ilmiah remaja),2. Mengembangkan kedisiplinan dari seluruh komponen sekolah untuk membentuk kepribadian yang tangguh dan kokoh sebagai dasar setiap aktifitas serta sebagai aset sekolah, 3.Meningkatkan penghayatan dan pengamalan terhadap ajaran agama, 4.Meningkatkan kemampuan siswa dalam       pemanfaatan teknologi informatika khususnya komputer, mengakses internet dan pemprograman komputer, 5.Meningkatkan aktifitas kreatifitas siswa melalui pelaksanaan kegiatan intrakulikuler dan ekstrakulikuler', 'Berprestasi tinggi, Islami dan berakhlak mulia.', '-77,574,713', '1,104,782,547', '2300', ''),
('SMA', 'Sekolah / Madrasah DIY', 20401158, '0277/H/1986', '2016-01-01', 'JL. MAGELANG KM 7, JOMBOR', 'SINDUADI', 68, 4, '0274 868283', 'smaditi.mlati@gmail.com', '', 'B', 'Ma 004097', 'KTSP', 'visi misi sekolah SMA Muhammadiyah  Mlati adalah membentuk " Islami, unggul dalam prestasi dan kompetitif ', '1.Menumbuhkan kesadaran untuk menghayati nilai-nilai ajaran Islam dan nilai-nilai kebangsaan, sehingga siswa dapat menjadi manusia Indonesia seutuhnya,', '1Meningkatkan prestasi akademik dan non akademik melalui pencapaian nilai ujian akhir dan prestasi di bidang lain (keagaman, kesenian, olah raga, dan karya ilmiah remaja) 2.Mengembangkan kedisiplinan dari seluruh komponen sekolah untuk membentuk kepribadian yang tangguh dan kokoh sebagi dasar setiap aktivitas serta sebagai asset sekolah.\nc) Meningkatkan penghayatan dan pengamalan terhadap ajaran Agama.\nd) Meningkatkan kemampuan siswa dalam pemanfaatan teknologi informatika khususnya computer, mengakses internet, dan pemrograman computer. \ne) Meningkatkan aktivitas dan kreativitas siswa melalui pelaksanaan kegiatan intrakurikuler dan ekstrakurikuler.\nf) Meningkatkan prestasi siswa di bidang kesenian. \ng) Meningkatkan kemampuan siswa untuk menggunakan bahasa inggris secara aktif.\n\n\n', '', '1,103,614', '-774,569', '1300', ''),
('SMA', 'Sekolah / Madrasah DIY', 20401169, '4379/II-193/DIY-78/1', '1988-12-03', 'Jl. Kaliurang Km. 17 Pakemtegal Pakembinangun Pake', 'PAKEMBINANGUN', 72, 4, '0274- 895545', 'sma_muhammadiyah_pakem@yahoo.c', '0', 'B', '22.01/BAP-SM/TU/X/2015', 'KTSP', '"Terwujutnya lulusan yang menguasai IMTEK dan IMTAQ, berakhlak mulia, peduli terhadap keunggulan lokal, dan mampu berperan sosial di masyarakat"', '1. Menumbuhkan budaya hidup islami di sekolah,                                                                                                                                         2. Meningkatkan profesionalitas pendidik dan tenaga kependidikan di sekolah guna menyiapkan lulusan yang berkualitas,               3. Meningkatkan penguasaan IMTEK pada siswa, guru, dan karyawan dengan memberdayakan fasilitas yang dimiliki,                        4. Membekali Pendidikan Berbasis Keunggulan Lokal ( PKBL ) bernuasa kepariwisataan kepada siswa melalui pengintegrasian pada mata pelajaran yang relevan, muatan lokal, pengembangan diri berupa kegiatan Corp Dakwah Pelajar ( CDP ), olahraga prestasi dan rekreasi , seni musik islami, tata busana dan kegiatan komputer desain grafis.', '1. Terwujudnya budaya / kultur sekolah yang islami     2. Tercapainya target akademis ( Rata rata Nim naik 0, 25 ) dan nonakademis ( menjuarai lomba - lomba non akademis ).                                                                         3. Meningkatnya siswa yang melanjutkan ke PT ( 80% ke 90 % )                                                                                4. Terpenuhinya 8 SNP                                                      5. Terwujudnya warga sekolah yang memiliki karakter berbangsa dan bernegara.', 'Kampus Islami Banyak Prestasi', '-76,667', '110,421', 'PLN (440', '20'),
