('SMP', 'Sekolah / Madrasah DIY', 20401013, 'No.3064/M.634/DIY.68', '1968-01-01', 'JL. Stan, Rt.04/Rw. 44, Maguwoharjo, Depok ,Sleman', 'MAGUWOHARJO', 63, 4, '(0274) 4462392', 'smpmusade1968@gmail.com', 'www.smpmuh1depo', 'A', 'No.5.01/BAP-SM/TU/XI/2016', 'KTSP', 'Terwujudnya insan yang berakhlak mulia, mandiri, kreatif, berprestasi, dan berwawasan global', '1.membentuk jati diri kepribadian siswa yang berkarakter keislaman dan kemuhammadiyahan, 2.menghantarkan potensi bakat dan minat secara optimal dan komprehensif dalam meraih prestasi akademik dan non akademik,3.melaksanakan pengembangan pendidik dan tenaga kependidikan yang profesional, 4. melaksanakan pengembangan pembelajaran aktif dan efektif, 5. melaksanakan pengembangan lulusan yang berkualitas, berkepribadian, tangguh, dan berbudaya, 6. melaksanakan pengembangan fasilitas pendidikan yang memadai dan inovatif, 7. melaksanakan pengembangan kelembagaan dan manajemen sekolah yang komprehensif, 8. melaksanakan pembiayaan pendidikan dengan prinsip keadilan dan akuntabel, 9. melaksanakan pengembangan sistem penilaian yang terencana dan berkala, 10. melaksanakan pengembangan penataan lingkungan, budaya sekolah yang kondusif, dan mitigasi bencana', '1.membentuk jati diri kepribadian siswa yang berkarakter keislaman dan kemuhammadiyahan, 2.menghantarkan potensi bakat dan minat secara optimal dan komprehensif dalam meraih prestasi akademik dan non akademik,3.melaksanakan pengembangan pendidik dan tenaga kependidikan yang profesional, 4. melaksanakan pengembangan pembelajaran aktif dan efektif, 5. melaksanakan pengembangan lulusan yang berkualitas, berkepribadian, tangguh, dan berbudaya, 6. melaksanakan pengembangan fasilitas pendidikan yang memadai dan inovatif, 7. melaksanakan pengembangan kelembagaan dan manajemen sekolah yang komprehensif, 8. melaksanakan pembiayaan pendidikan dengan prinsip keadilan dan akuntabel, 9. melaksanakan pengembangan sistem penilaian yang terencana dan berkala, 10. melaksanakan pengembangan penataan lingkungan, budaya sekolah yang kondusif, dan mitigasi bencana', 'Man Jadda wa Jadda...', '-7,763,700', '110,426,200', '7000', '5'),
('SMP', 'Sekolah / Madrasah DIY', 20401056, '0277/H/1986', '2016-01-01', 'Pirak, Jln Suparjo Km.1', 'SIDOLUHUR', 65, 4, '0274 798040', 'smpmuh1godean@yahoo.co.id', 'www.smpmuh1gode', 'A', '5.01/BAB-SM/TU/XI/2016', 'KTSP', 'Terbentuknya peserta didik yang berakhlak mulia cerdas terampil berprestasi berbudaya dan cinta tanah air', '1. Melaksanakan pembelajaran yang aktif, inovatif dan menyenangkan dengan memaksimalkan media pembelajaran, 2. Meningkatkan keaktian didalam beragama Islam sesuai Al-Qur''an dan Saunah Nabi., 3. Menggali potensi akademik dan non akademik untuk mewujudkan dan meningkatkan prestasi siswa., 4. Antusias terhadap perkembangan dan kemajuan ilmu poengetahuan, teknologi informasi dan komunikasi., 5. Menumbuh kembangkan budaya yang berkarakter, cinta kebersihan, keindahan dan cinta tanah air', '1. Perolehan nilai ujian nasional selalu mengalami kenaikan., 2. Siswa aktif beribadah sholat wajib, sholat sunah dan terbiasa kulyum., 3. Siswa  bisa membaca Al-Qur''an dengan tjwid yang benar., 4. Terwujudnya suasana pergaulan sehari-hari yang berlandaskan keimanan dan ketaqwaan.,  5. Terwujudnya disiplin yang tinggi dari seluruh warga sekolah., 6. Memiliki kegiatan ekstra kurikuler yang maju dan berprestasi di segala bidang,. 7. Siswa bisa memanfaatkan kemajuan teknologi informasi dan komunikasi dengan baik., 8. Terwujudnya menajemen sekolah yang transparan dan partipasif seluruh warga sekolah., 9. Terwujudnya lingkungan sekolah yang bersih, indah dan nyaman., 10. Terwujudnya budaya dan karakter yang baik serta cinta tanah air.', '', '-7,774,497', '110,285,459', '7000', '1'),
