('SMP', 'Sekolah / Madrasah DIY', 20401017, '3047/M.617/014.55/77', '1977-01-09', 'Glondong, Titomartani, Kalasan, Sleman, DIY', 'TIRTOMARTANI', 66, 4, '0274 367954', 'Email sekolah', 'www.smpmuh1kala', 'A', '', 'KTSP', '1. Memperkukuah landasan ketaqwaan yang dijiwai amal marif nahi munkar dengan berdasarkan Al-Qur an dan AsSunnah, 2. Mengembangkan kepribadain sopan, santun, ramah dalam keluarga, sekolah dan lingkungan masyarakat. 3. Membangun semangat mandiri dengan bekal ketrampilan yang dihandalkan. 4. Mengembangkan kompetensi meraih pretasi serta bertanggung jawab. 5. Mengembangkan sikap hemat, cermat, tekun dalam bertindak dalam segala bidang. 6. Mengembangkan budaya lingkungan sekolah, keluarga dan masyarakat yang bersih, indah dan sehat. 7. Membangun budaya etika berlalu lintas di keluarga, sekolah dan masyarakat.', 'Bertaqwa, Berprestasi, Berbudaya', '1. Mencapai tujuan pendidikan Muahammadiyah, 2. Membentuk calon kader persyarikatan, 3. Membentuk generasi penerus bangsa yang handal, cerdas, beriman dan tawakal berguna bagi orang tua, masyarakat dan negara, 4. Menengkatnya Pelaksan aan Pembelajaran Pendekatan   Pembelajaran    Aktif, Kreatif, Efektif, Inovatif dan Menyenangkan ( PAKEM ) pada semua Mata Pelajaran, 5. Meningkatnya Kedisiplinan untuk meraih prestasi di segala bidang baik secara akademik maupun non akedemik, 6. Meningkatnya budi pekerti dan akhlak yang mulia sebagai landasan hidup bermasyarakat, 7. Meningkatkan pencapaian budaya mutu yang up to date', '', '-77,694,394', '110.4673288', '4500', '30'),
('SMP', 'Sekolah / Madrasah DIY', 20401033, '0174/H/1986', '1986-04-28', 'Jl. Cangkringan Km. 3 Bayen', 'PURWOMARTANI', 15, 4, '0274 4542100 ', 'smpmuh2kalasan@yahoo.com', 'http://www.smpm', 'A', '28.2/BAP/TU/X/2011', 'KTSP', 'Terwujudnya siswa yang Mantap aqidahnya, Unggul dalam iptek, Lincah dalam karya dan raga, Islami dalam perilaku, Amanah dalam bermasyarakat dan berbangsa yang kemudian disingkat MULIA dengan motto sekolah MUHAKA MULIA', '1. Menumbuhkembangkan penghayatan dan pengamalan ajaran Islam sehingga muncul akhlakul karimah pada diri siswa.\n2. Mengembangkan 3S (senyum, salam, sapa) untuk memantapkan ukhuwah Islamiyah.\n3. Menumbuhkan kemandirian, kedislipinan dan rasa bertanggung jawab pada diri siswa sehingga terlahir siswa yang handal.\n4. Melaksanakan bimbingan dan pembelajaran yang efektif sehingga sisiwa berkembang secara optimal.\n5. Mengembangkan kegiatan  dalam bidang oleh raga, seni, keterampilan dan karya ilmiah.\n6. Menciptakan pola hidup sehat dengan bebas rokok ,minuman keras dan obat terlarang.\n7. Menciptakan lingkungan sekolah yang  green and clean \n', 'Dakwah Islam melalui jalur pendidikan formal dan mencetak kader Muhammadiyah serta menghambat perkembangan paham komunisme di sekitar Kalasan', 'MUHAKA MULIA', '-77,573', '1,104,489', '3400', '36'),
('SMP', 'Sekolah / Madrasah DIY', 20401055, 'Nomor : 093/ H / 198', '1948-01-08', 'Gedongan', 'SENDANGARUM', 67, 4, '(0274) 6497001', 'muh.gedongan@gmail.com', 'www.smpmuh1ming', 'A', '2012', 'KTSP', 'Visi Skolah SMP Muhammadiyah 1 Minggir:\n  Mewujudkan lulusan yang unggul,teladan, dan islami serta berkarakter mulia \n', '1. Menyusun dan melaksanakan KTSP', 'Sesuai dengan visi dan misi sekolah, SMP Muhammadiyah 1 Minggir bertujuan:', 'SMaFt ( Sidiq, Amanah, Fathonah, Tablig)', '1,102,538,912', '-77,585,647', '7500', '6 mbps'),
('SMP', 'Sekolah / Madrasah DIY', 20401054, '23628/MPK/74', '1974-07-24', 'Jalan Magelang KM 7,5', 'SENDANGADI', 68, 4, '0274 869879', 'smpmusati@ymail.com', '', 'A', '28.02/BAP/TU/X/2011', 'KTSP', 'Bertaqwa, Cerdas, Terampil, Berbudaya, Berwawasan lingkungan dan Berwawasan Global', '1) Mewujudkan warga sekolah yang taat dan tertib dalam beribadah. 2) Membentuk kader Muhammadiyah berdasarkan Al-Quran dan Sunah Nabi. 3) Mendidik peserta didik menjadi manusia yang cerdas dan berbudaya melalui proses pembelajaran aktif, kreatif, efektif dan menyenangkan. 4) Menggali dan mengembangkan potensi non akademik setiap peserta didik. 5) Mewujudkan pribadi-pribadi warga sekolah serta lulusan yang berkarakter dan berbudaya yang berwawasan global. 6) Menyelenggarakan pembelajaran yang berbasis perkembangan IPTEK dan kearifan lokal. 7) Mewujudkan lingkungan sekolah yang bersih, sehat, dan berwawasan lingkungan. 8) Mewujudkan warga sekolah yang mematuhi etika dalam berlalu lintas/tidak melanggar etika dalam berlalu lintas.', '1) Mencapai tujuan pendidikan Muhammadiyah. 2) Membentuk kader persyarikatan. 3) Meningkatkan prestasi akademik dan non akademik. 4) Mengembangkan kedisiplinan dari seluruh komponen sekolah guna mempunyai kepribadian yang tangguh dan kokoh. 5) Menciptakan warga sekolah yang mematuhi etika dalam berlalu lints/tidak melanggar etika dalam berlalu lintas.', '', '110.362', '-77.373', '4400', '25 Mbps'),
('SMP', 'Sekolah / Madrasah DIY', 20401049, '0158/H/1986', '1997-01-01', 'Jl. Kaliurang km. 6,7 Gg. Timor-timor Desa Sono', 'SINDUADI', 68, 4, '0274 4532 634', 'smpmuh2mlati@gmail.com', 'smpmuh2mlati.sc', 'A', '21.01/BAP-SM/TU/XII/2013', 'KTSP', 'Menciptakan insan bertaqwa, berprestasi dan berbudaya', '1. Melaksanakan kegiatan dan bimbingan belajar agama agar siswa rajin beribadah dalam menjalankan agama ,2. Mengembangkan perilaku berjiwa Muhammadiyah, 3. Melaksanakan kegiatan dan bimbingan belajar agama, PKn, BK, Seni Budaya, agar siswa berbudi pekerti luhur ,4. Melaksanakan kegiatan dan bimbingan belajar untuk mencapai prestasi dalam bidang akademik, 5. Melaksanakan kegiatan dan bimbingan belajar agar siswa berprestasi dalam bidang  non akademik ,6. Melaksanakan kegiatan dan bimbingan belajar secara aktif, kreatif, dan inovatif ,7. melaksanakan kegiatan dan bimbingan kebersihan dan keindahan di lingkungan sekolah dengan ikhlas dan penuh tanggung jawab.\n8. Melaksanakan kegiatan dan bimbingan karakter bangsa dengan cara    membudayakan siswa  tertib dan disiplin.\n9. Melaksanakan bimbingan kepada siswa untuk berbudaya sopan dan berperilaku positif.\n10. Melaksanakan bimbingan agar siswa peduli terhadap lingkungan hidup di sekolah.\n', '1. Peserta didik memiliki akhlak yang terpuji\n2. Sekolah meningkatkan nilai rata-rata UN 7,0 dan UAS 7,6 untuk kelas 9 dan nilai di atas KKM  pada semua mata pelajaran untuk klas 7, dan 8. \n3. Meningkatnya prestasi non akademik\n4. Sekolah mengembangkan perangkat pembelajaran  silabus semua mata pelajaran untuk kelas VII,VIII dan IX.\n5. Sekolah mengembangkan RPP seluruh mata pelajaran untuk kelas VII,VIII dan IX.\n6. Sekolah mengembangkan kurikulum sesuai Standar Nasional Pendidikan.\n7. Sekolah mengembangkan proses pembelajaran berbasis CTL.\n8. Sekolah mengembangkan proses pembelajaran berbasis PAIKEM.\n9. Sekolah mengembangkan proses pembelajaran berbasis Teknologi Informasi  \n10. Sekolah memiliki tenaga pendidik dengan kualifikasi sarjana 75 %.\n11. Sekolah memiliki tenaga pendidik bersertifikasi pendidik 75 %.\n12. Sekolah memiliki tenaga kependidikan yang menguasai Teknologi Informasi.\n13. Terwujudnya warga sekolah gemar membaca dan belajar.( 80 % )\n14. Sekolah mengembangkan terwujudnya budaya tertib dan disiplin di sekolah.(80%)\n15. Sekolah mengembangkan kegiatan berwawasan lingkungan dan pembentukan  karakter yang berakhlak mulia.\n16. Sekolah mengembangkan budaya senyum, sapa, salam dengan sopan sehingga tercipta  perilaku positif / berbudi pekerti luhur yang dapat membuat situasi nyaman di sekolah.\n', '', '-77,456', '1,103,804', '7000', '30'),
('SMP', 'Sekolah / Madrasah DIY', 20401034, '4047/II-204/DIY-82/1', '1982-06-05', 'Jalan Kebon Agung Km.4 Cebongan, Tlogoadi, Mlati,', 'TLOGOADI', 68, 4, '0274-4364148', 'smp.muh3mlati@gmail.com', 'www.....', 'A', '22.01/BAP-SM/TU/X/2015', 'KTSP', 'visi misi sekolah SMK Muhammadiyah 1 Bantul adalah Membentuk tamatan yang berakhlak mulia, berprestasi, mandiri dan berdaya saing di tingkat lokal maupun nasional', '1.Berakhlaq mulia., 2.Terampil 3.Berprestasi  dan Berbudaya', '1.Menciptakan Suasana agamis dan berkarakter melalui IMTAQ 2.Meningkatkan ketrampilan peserta didik melalui kegiatan ektrakurikuler 3.Meninhkatkan mutu sumber daya manusia {SDM} melalui Pendidikan', '', '-79,023', '1,103,491', '3000', '30'),
('SMP', 'Sekolah / Madrasah DIY', 20404127, '0744/H/1986', '1986-08-02', 'Banjarharjo', 'BIMOMARTANI', 71, 4, '0274 2860350', 'smpmuhngemplak@gmail.com', 'www.....', 'A', '21.01/BAP-SM/TU/XII/2013', 'KTSP', 'Visi SMP Muhammadiyah Ngemplak adalah   UNGGUL DALAM IMTAQ TANGGUH DALAM IPTEK, SANTUN DALAM PERILAKU \nSERTA BERWAWASAN LINGKUNGAN  \n', '1. Mengaktualisasi amalan-amalan ibadah dengan tertib dan benar; 2. Membiasakan hidup secara islami dan berakhlakul kharimah;  3. Melaksanakan kegiatan belajar mengajar seefektif mungkin, inovatif dan kreatif; 4. Menyelenggarakan dan mengaktifkan organisasi IPM sebagai organisasi intra sekolah; 5. Menanamkan kesadaran sikap disiplin; 6. Meningkatkan kemampuan siswa dibidang teknologi, informasi dan komunikasi; 7. Melaksanakan penanggulangan mitigasi bencana yang diadakan oleh BNPB dan sekolah; 8. Mengembangkan disiplin etika lalu lintas secara persuasive, edukatif kepada seluruh warga sekolah', '1. Seluruh peserta didik dapat membaca Al-Qur''an dengan benar; 2. Seluruh peserta didik melaksanakan sholat dhuha, jama''ah sholat dhuhur tadarus dan mengucapkan salam di sekolah dan di rumah dengan penuh kesadaran; 3. Seluruh peserta didik dapat memperoleh peningkatan nilai rata-rata Ujian Nasional; 4. Delapan puluh persen (80%) peserta didik dapat menguasai Bahasa Inggris secara aktif; 5. Seluruh peserta didik dapat mengoperasikan/menguasai komputer (TI); 6. Seluruh peserta didik dapat meningkatkan kesadaran dalam merespon dan kesiapsiagaan dalam penanggulangan bencana; 7. Seluruh peserta didik santun dalam berlalu lintas.', '-', '-76.827', '1,104,581', '2200', '65'),
('SMP', 'Sekolah / Madrasah DIY', 20401053, '3050/M.620/DIY/60/77', '1977-09-01', 'GATAK', 'BOKOHARJO', 73, 4, '496206', 'smp.muhammadiyah1prambanan@yah', 'http://smpmuham', 'A', '16.01/BAP-SM/TU/X/2014', 'KTSP', 'Islami, Unggul dan Berprestasi', '1. Melaksanakan sholat dhuha,dhuhur dan ashar berjamaah', '1. Mewujudkan lulusan yang lancar membaca Al-Quran dan rajin beribadah', 'Islami, Unggul dan berprestasi', '-77,444', '1,104,923', '4500', 'Angkasa Net'),
('SMP', 'Sekolah / Madrasah DIY', 20404126, '3051/M.621/DIY.67/77', '1970-07-01', 'JL. Prambanan - Piyungan Km. 5', 'SUMBERHARJO', 17, 4, '0274 367954', 'smpmuh2prambanan@gmail.com', '', 'A', '10.01/BAP-SM/TU/XI/2012', 'KTSP', 'Islam Unggul dan Terpercaya', '1. Mengembangkan dan meningkatkan mutu akademik berstandar nasional dengan menerapkan kurikulum lokal serta berkualitas dibidang akademik dan non akademik', '1. Terbentuknya pribadi peserta didik yang berkualitas Islam berdasarkan Al-Qur''an dan Al-Hadits', 'Sekolah Berbasis Life Skill', '-79,023', '1,103,491', '2200', '30'),
