('SD', 'Sekolah / Madrasah DIY', 20400604, '0277/H/1986', '2016-01-01', 'JL. KH. AGUS SALIM NO. 97C BANTUL', 'KELURAHAN', 11, 1, '0274 368565', 'sdmuh_bantulkota@yahoo.co.id', 'www.sdmuh-bantu', 'A', 'no sk akreditasi', 'KTSP dan K', 'Berakhlak mulia, berwawasan Islami, terdepan dalam prestasi, kreatif dan berbudaya', '1.Â Â  Membiasakan berakhlak mulia', 'Â Â Â Â Â Â Â Â Â Â Â  1.Â Â Â Â Â  Menumbuhkan dan mengembangkan penghayatan serta pengamalan ajaran Islam melalui intensifikasi kegiatan keagamaan, sehingga meningkatkan iman dan taqwa.', 'SEKOLAH PARA JUARA', '-78,889', '1,103,268', '13800', '30'),
('SD', 'Sekolah / Madrasah DIY', 20400603, '238/KPTS/1989', '1989-09-27', 'Bendo, Trimurti, Srandakan, Bantul, DIY 55762', 'TRIMURTI', 17, 1, '628', 'sdbendo@yahoo.com', 'www.....', 'B', '10.01/BAP-SM/TU/XI/2012', 'KTSP dan K', 'Membentuk Manusia yang Cakap, Cerdas, Berakhlaq Mulia, dan Berkepribadian Muslim yang Kuat', '1. Menjaga kedisiplinan siswa, guru dan karyawan.\n2. Memberdayakan potensi guru, siswa, wali murid dan masyarakat pada umumnya dalam rangka meningkatkan mutu pendidikan.\n3. Mengkondisikan suasana Islami di sekolah, sehingga terwujud suasana yang aman, tentram dan damai.\n', '1.Â Â Â Â Â Â Â Â Â  Meningkatkan pencapaian Nilai rata-rata Ujian Nasional (UAN) dari 25,63 (untuk 3 mata pelajaran) pada tahun 2013-2014, menjadi :', 'Jujur, unggul dan islami', '-79,273', '1,102,535', '900', '30'),
('SD', 'Sekolah / Madrasah DIY', 20400602, '2932/L.1S63/DIY.27/7', '1977-09-01', 'JL. IMOGIRI TIMUR KM 11,5 BLAWONG', 'TRIMULYO', 7, 1, '0274 4415122', 'sd.muh.blawong1@gmail.com', 'sdmublasa.blogs', 'A', '5.01/BAP-SM/TU/XI/2016', 'KTSP dan K', 'Terwujudnya sekolah unggul, cerdas, terampil, berakhlak mulia dan berkarakter menuju peradaban global, berbasis kemandirian.', '1. Mewujudkan keunggulan dalam prestasi akademik\n2. Mewujudkan keunggulan dalam pencapaian prestasi dalam berbagai perlombaan\n3. Mewujudkan keunggulan dalam penerapan IPTEK dan keterampilan berbahasa\n4. Mewujudkan keunggulan dalam permahaman dan aktifitas Islam\n5. Mewujudkan keunggulan dalam sikap dan perilaku sesuai nilai-nilai karakter bangsa\n6. Mewujudkan kemandirian peserta didik\n7. Mewujudkan kemandirian bangsa\n', 'a. Meningkatkan pencapaian nilai semua kompetensi pengetahuan dan keterampilan pada semua kelas dan semua muatan pelajaran, minimal 76.\nb. Meningkatkan pencapaian nilai kompetensi sikap (spiritual dan sosial) pada semua kelas, minimal B (baik).\nc. Meningkatkan pencapaian nilai rata-rata ujian sekolah/daerah (Bahasa Indonesia, Matematika IPA), minimal 245,00.\nd. Meningkatkan pencapaian nilai rata-rata ujian sekolah (PPKn, IPS, PJOK, SBDP, Bahasa Jawa, Pendidikan Batik, dan Bahasa Inggris), minimal 250,00.\ne. Mempertahankan prosentase kelulusan siswa 100%.\nf. Mempertahankan prosentase siswa mengulang 0%.\ng. Menjuarai minimal dua cabang lomba MTQ tingkat kabupaten.\nh. Menjuarai minimal dua cabang lomba OOSN dan POR Pelajar tingkat kabupaten dan provinsi.\ni. Menjuarai lomba OSN tingkat kecamatan.\nj. Menjuarai lomba mata pelajaran tingkat kecamatan.\nk. Menjuarai minimal dua cabang lomba FLSSN, Cipta Seni, dan Apresiasi Seni tingkat kabupaten.\nl. Masuk lima besar lomba drum band tingkat kabupaten.\nm. Masuk lima besar lomba karawitan tingkat kabupaten.\nd. Semua warga sekolah menjalankan ibadah sesuai agama masing-masing.\ne. Semua warga sekolah bersikap dan berperilaku sesuai norma dan aturan yang berlaku.\n', 'Mandiri Berkemajuan', '-78,809', '1,103,899', '4800', '30');
 Terwujudnya insan yang iman, taqwa, cerdas, terampil ,unggul berprestasi, dan berkarakter budaya Indonesia ', '1.Â Â  Mengembangkan dan memperkuat pendidikan agama serta mengamalkannya.', 'Melaksanakan ajaran agama dalam kehidupan sehari-hari.', '', '-79.683', '1,103,393', '900', '300'),
('SD', 'Sekolah / Madrasah DIY', 20400486, '2955/L.1886/DIY.Yg/9', '1992-09-01', 'Jogodayoh', 'SUMBERMULYO', 8, 1, '0274 6460485', 'sdm.jogodayoh@gmail.com', 'http://sdmuhjog', 'A', '10.01/BAP-SM/TU/XI/2012', 'KTSP dan K', ' TERWUJUDNYA INSAN YANG BERTAQWA, UNGGUL, MANDIRI, BERKARAKTER DAN BERBUDAYA', '1. Menciptakan suasana religius dalam semangat nasionalisme dan kekeluargaan di antara warga sekolah untuk mewujudkan sekolah yang unggul dalam mutu, insane yang santun dalam perilaku dan berprestasi setiap hari, 2. Mengembangkan sekolah yang memiliki sarana pembelajaran berbasis teknologi dan informatika, dalam suasana lingkungan yang asri, aman, bersih, dan sehat, 3. 3. Mempersiapkan peserta didik untuk mengikuti pendidikan lebih lanjut, memiliki kecerdasan dan kompetensi untuk hidup mandiri, mampu bersaingdi taraf regional, nasional dan internasional, menguasai ilmu pengetahuan dan teknologi serta berkepribadian dan berbudaya Indonesia.', '1. Menghasilkan tamatan yang berakhlak mulia, memiliki pengetahuan, keterampilan dan kemampuan untuk mengembangkan diri, 2. Meningkatkan mutu lulusan rata-rata jumlah US minimal mencapai 24,00., 3. Meningkatkan peringkat dan prestasi siswa yang mampu bersaing di tingkat propinsi, 4. Menumbuhkan kreatifitas belajar siswa melalui sarana pembelajaran multimedia, 5. Memfasilitasi pengembangan bakat dan minat siswa dengan menyediakan waktu, sarana dan prasarana non akademik', 'Taqwa, Cerdas, Berprestasi', '-79,273', '1,103,227', '7.700 Wa', '250'),
('SD', 'Sekolah / Madrasah DIY', 20400485, '2938/L.1869/DIY.27/7', '1927-07-01', 'Kadisoro', 'GILANGHARJO', 9, 1, '6280000000000.0', 'kadisoro1@gmail.com', '', 'B', '02/BAS-BTL/II/2007', 'KTSP dan K', 'TERWUJUDNYA INSAN YANG BERAKHLAK MULIA CERDAS DAN BERKARAKTER INDONESIA', '1.Â  Menumbuh kembangkan iman ilmu dan amal dalam setiap perilaku   sesuai dengan ajaran agama islam. , 2.Â  Menanamkan kemampuan menyelesaikan masalah,memupuk rasa empati dan peduli terhadap sesama dan lingkunganya. , 3.Â  Mengintegrasikan pendidikan budi pekerti kedalam setiap kompetensi sehingga menjadi sekolah yang kondusif dan menciptakan peserta didik yang memiliki kualitas SDM yang berakhlak mulia. , 4.Â   Menciptakan proses pembelajaran yang efektif agar bisa berkembang secara maksimal. , 5.Â  Melaksanakan pembelajaran dan bimbingan dengan intensif untuk mencapai tingkat ketuntasan dan daya serap yang tinggi. , 6.Â  Menekankan kedisiplinan efektif dan efisien dalam setiap perilaku ,membudayakan hidup bersih dan sehat dengan berolah raga. , 7.Â  Menumbuh kembangkan rasa cinta seni ,trampil sehingga mampu berkarya dan berkreasi. , 8.Â  Melaksanakan pendidikan budaya dan karakter bangsa kedalam pembelajaran baik instrakurikuler maupun ekstrakurikuler sehingga tercipta SDM yang berkarakter Indonesi.', '1. Meningkatkan pencapaian nilai rata-rata hasil ujian sekolah dari 221,64 (untuk 3 mapel), pada tahun 2015/2016 menjadi 230,00. 2.meningkatkan peringkat sekolah dibidang akademik/non akademik. 3. meningkatkan prestasi pada lomba akademik dan non akademik yang diselenggarakan ditingkat kecamatan, kabupaten, provinsi. 4. mengoptimalkan potensi keterampilan dan seni. 5. mewujudkan pengalaman agama secara nyata sehingga meningkatkan iman, ilmu dan amal untuk menuju ketaqwaan terhadap Tuhan Yang Maha Esa. 6. memiliki tim olahraga yang handal. 7. menoptimalkan kegiatan ekstrakurikuler untuk mendukung tercapaianya kegiatan ekstrakurikuler.', '', '-78,958,000', '1103094', '900', '1Mega'),
('SD', 'Sekolah / Madrasah DIY', 20400483, '125/KPTS/1991', '1991-04-01', 'Kalakijo', 'GUWOSARI', 10, 1, '8112646557', 'sd_muh_kalakijo@yahoo.co.id', '-', 'B', 'Dd 070484', 'KTSP dan K', 'Terwujudnya pelajar muslim yang Berakhlak Mulia, Cerdas dan Unggul (BCU)', '1. Menanamkan kecintaan dan  ketaqwaan kepada Tuhan Yang Maha Esa\n2. Melaksanakan pembelajaran PAIKEM ( Pembelajaran Aktib, Inovatif, Kreatif, Efektf , dan Menyenangkan\n3. Membiasakan berdoa setiap akan memulai/selesai melakukan pekerjaan\n4. Melaksanakan budaya bersikap sopan santun,salam, sapa,senyum kepada orang tua, Guru dan teman\n5. Mengkondisikan suasana sekolah bernuansa islami\n6. Meningkatkan disiplin dan jujur warga sekolah\n7. Menumbuh kembangkan kreatifitas siswa sesuai dengan potensinya masing-masing\n8. Menumbuhkan rasa patriotisme sejak dini', '1. Siswa beriman dan bertaqwa kepada Allah SWT, serta berakhlak mulia; 2. Siswa menguasai dasar-dasar pengetahuan, kemampuan, dan keterampilan untuk melanjutkan pendidikan pada jenjang yang lebih baik; 3. Siswa mampu meraih prestasi baik akademik maupun non akademik; 4. Siswa mampu berperilaku islami; 5. Siswa mencintai bangsa, masyarakat dan budayanya', 'Sehat Beriman', '-78,785', '110,321', '2200', '-'),
