('SD', 'Sekolah / Madrasah DIY', 20400479, '2944/L.1875/DIY.70/7', '1970-01-01', 'KALIPAKEM,SELOHARJO,PUNDONG,BANTUL', 'SELOHARJO', 3, 1, '', 'sd.kalipakem2@gmail.com', '', 'B', '22.01/BAN-SM/TU/X/2015', 'KTSP dan K', 'visi misi sekolah SD Muhammadiyah Kalipakem II  adalah Mewujudkan insan yang taqwa,cerdas, terampil, berprestasi, berwawasan teknologi, dan berkharakter indonesia', '1.Menumbuhkan dan mengembangkan penghayatan serta pengalaman terhadap ajaran agama melalui intensifikasi kegiatan keagamaan, sehingga meninggkat iman dan taqwa 2 melaksanakan pembelajaran yang aktif,kreatif,efektif dan menyenangkan 3.Melaksanakan kegiatan pembelajaran intrakurikuler dan ekstrakurikuler untuk mengembangkan bakat dan minat. 4.Melaksanakan program-program pembiasaan untuk membentuk pribadi pribadi berperilaku islami. 5.Mengembangkan budaya gemar membaca ,bertoleransi, bekerjasama,menghargai,disiplin,jujur, kerja keras,kreatif, mandiri dan terampil menguasaiteknologiinformasi.6.Mengembangkan seni budaya lokal untuk membentuk manusia berkarakter berkepribadian indonesia7.Menciptakan lingkungan sekolah bersih, rapi, aman dan nyaman 8.memanfaatkan sumber daya alam dan lingkungan sebagai sumber belajar agar memberikan hasil yang terbaik bagi perkembangan peserta didik.9.menanamkan kepedulian sosial dan lingkungan ,cinta tanah air,semangat kebangsaan dan hidup demokratis.10.mengembangkan 5 S (senyum,slam,sapa,sopan dan santun)', '1.Meningkatkan keimanan dan ketaqwaan terhadap Tuhan Yang Maha Esa.2.Meraih prestasi akademik maupun non akademik minimal di tingkat kecamatan.3.Menguasai dasar ilmu pengetahuan dan teknologi sebagai bekal untuk melanjutkan pendidikan ke jenjang yang lebih tinggi.4.mengembangkan budaya daerah untuk menciptakan manusia yang berkarakter, berkebuadayaan indonesia serta peduli terhadap lingkungannya.5.Menyelenggarakan berbagai kegiatan sosial yang menjadi bagian dari pendidikan budaya dan karakter bangsa.6.Meningkatakan kinerja/akuntabilitas sekolah di masyarakat dan pemerintah serta terwujudnya penyelenggaraan pendidikan yang transparan,demokratis dan profesional', '', '-79,023', '1,103,491', '900', ''),
