('SD', 'Sekolah / Madrasah DIY', 20409856, '01/IV.4/F/2006', '0000-00-00', 'KEMBARAN, TAMANTIRTO, KASIHAN, BANTUL', 'TAMANTIRTO', 16, 1, '418551', 'Sdmuhika@gmail.com', 'www.sdmikkembar', 'B', '21.01/BAP-SM/TU/XII/2013', 'KTSP, K 13', 'visi misi sekolah muhammadiyah Insan Kreatif Kembaran adalah Berakhlak mulia, Cerdas, Kreatif dan Islami.', '1.Menanamkan ketaqwaan kepada Allah SWT melalui pembelajaran', '1.Menanamkan ketaqwaan kepada Allah SWT melalui pembelajaran', 'Berakhlak mulia, Cerdas, Kreatif dan Islami.', '', '', '1300', '500 Mbyte'),
('SD', 'Sekolah / Madrasah DIY', 20411840, '11 TAHUN 2012', '0000-00-00', 'MRIYAN, DONOTIRTO, KETEK, BANTUL, D.I. YOGYAKARTA', 'DONOTIRTO', 2, 1, '282000000000.00', 'sdumuhkretek@gmail.com', 'sdumuhkretek.sc', 'A', 'Dd.132121', 'KTSP, 2013', 'Terwujudnya tamatan yang unggul,cerdas, trampil, dan berprestasi berdasarkan imtaq menuju kehidupan yang agamis, dinamis dan demokratis', '1. Menumbuhkan penghayatan terhadap ajaran  agama Islam.', '1. Meletakkan dasar kecerdasan, pengetahuan, kepribadian yang berakhlak mulia  serta ketrampilan untuk hidup mandiri.', 'SEKOLAHKU SEHAT, PRESTASIKU HEBAT, IMANKU KUAT, BERMAIN MASIH SEMPAT, CITA-CITAKU BAHAGIA', '-7,984,654', '110,305,385', '2200', '5'),
('SD', 'Sekolah / Madrasah DIY', 20400491, '2957/L.1888/DIY.58/7', '1958-01-01', 'BEKANG', 'MULYODADI', 8, 1, '81328666100', 'sdmuhmulyodadi@yahoo.com', 'www.sdmuhmulyod', 'B', 'no sk akreditasi', 'KTSP dan K', 'Terbentuknya peserta didik yang berakhlagul karimah, cerdas dan berprestasi serta berkepribadian Indonesia', 'a.Â Â Â Â Â Â  Menanamkan nilai-nilai Islam dalam kehidupan sehari-hari melalui pembiasaan-pembiasaan.', '1.Â Â Â  Dapat mengamalkan ajaran islam dalam kehidupan sehari-hari.', '', '-79.468', '1,103,148', '900', ''),
('SD', 'Sekolah / Madrasah DIY', 20400490, '2959/L.1890/DIY.70/7', '1970-01-01', 'PANDES 1 WONOKROMO PLERET BANTUL', 'WONOKROMO', 6, 1, '6290000000000.0', 'muhammadiyah_sdpandes@yahoo.co', 'www.sdmuhpandes', 'A', '22.01/BAP-SM/TU/X/2015', 'KTSP dan K', 'Terbentuknya manusia pembelajar yang bertakwa, berakhlak mulia, berkemajuan dan unggul dalam ilmu pengetahuan, teknologi, dan seni (IPTEKS) sebagai perwujudan dari tadjid dakwah amar ma''ruf nahi mungka,serta berkepribadian Indonesia.', '1. Mendidik manusia agar memiliki kesadaran ketuhanan (spiritual ma''rifat); 2.Membentuk manusia berkemajuan yang memiliki etos tadjid, berfikir cerdas, alternative, dan berkarakter kebangsaan Indonesia; 3.Mengembangkan potensi manusia yang bejiwa mandiri, beretos kerja keras, wirausaha, kompetitif dan jujur; 4. Membina peserta didik agar menjadi manusia yang memiliki kecakapan hidup dan ketrampilan sosial, teknologi, informasi, dan komunikasi; 5. Membimbing peserta didik agar menjadi manusia yang memiliki jiwa serta kemampuan menciptakan dan mengapresiasi karya seni budaya daerah dan nasional; 6. Membentuk peserta didik menjadi yang ikhlas, peka, peduli, dan bertanggung jawab terhadap pengurangan resiko bencana; 7. Mengembangkan dan melaksanakan budaya Indonesia 6K (Ketertiban, Keamanan, Kebersihan, Keindahan, Kekeluargaan, Kesopanan) serta budaya 5SMT  (Senyum, Salam, Sapa, Sodaqoh, Maaf, dan Terima kasih) bagi semua warga sekolah. 8. Mengembangkan nilai budaya dan karakter bangsa berupa nilai religius, disiplin, jujur, dan mandiri.', '1. Memberikan bekal kemampuan dasar dan ajaran islam kepada peserta didik untuk mengembangkan diri dan kehidupannya sebagai pribadi,  persyarikatan Muhammadiyah serta masyarakat, warga Negara, dan anggota umat manusia; 2. Mempersiapkan peserta didik untuk mengikuti pendidikan menengah; 3. Meningkatkan pencapaian jumlah nilai rata-rata UAN dan USD pusat bertambah dari 21,60 menjadi 22,40 dari 3 mata pelajaran yang soalnya dari pusat; 4. Meningkatkan nilai rata-rata raport sebesar 0,77 dari kelas I - VI; 5. Mengoptimalkan 75% potensi ketrampilan budaya lokal; 6. Membiasakan siswa kelas III - VI bekomunikasi dengan bahasa inggris secara sederhana; 7. Mengoptimalkan berkomunikasi bahasa jawa berdasar unggah- ungguh; 8. Meningkatkan kesadaran lingkungan dan pengurangan resiko bencana; 9. Meningkatkan kesadaran siswa membaca perpustakaan; 10. Mengupayakan siswa kelas IV minimal tamat Iqro''.', 'Disiplin, kreatif, jujur, dan berani sebagai kunci meraih sukses', '-7.857', '110.382', '2200', '30'),
('SD', 'Sekolah / Madrasah DIY', 20400478, '31/KPTS/1967', '1967-08-01', 'Pandeyan, Bangunharjo, Sewon, Bantul', 'BANGUNHARJO', 12, 1, '', 'sdmpandeyan@yahoo.co.id', '', 'A', '10.1/BAP-SM/TU/XI/2012', 'KTSP dan K', 'Visi Sekolah : Terwujudnya Karakter Murid Berakhlaq Mulia, Berprestasi, dan Berwawasan IPTEK', 'Misi Sekolah :                                               1. Menanamkan Pendidikan akhlaq mulia dan berkarakter Indonesia', 'Tujuan Sekolah :                           1. Tujuan Pendidikan 5 tahun ke depan :', '', '-78,454', '1,103,779', '1300', ''),
('SD', 'Sekolah / Madrasah DIY', 20400477, '09/A.P/A6/77', '1977-09-01', 'PENDOWO,PENDOWOHARJO,SEWON, BANTUL', 'PENDOWOHARJO', 12, 1, '81568499289', 'sdm_pendowo@yahoo.co.id', 'www.....', 'A', '22.01/BAP-SM/TU/X/2015', 'KTSP dan K', 'TERBENTUKNYA  PRIBADI MUSLIM YANG  BERPRESTASI, BERAKHLAK MULIA DAN BERKARAKTER INDONESIA', '1.Â Â Â Â Â  Melaksanakan pembelajaran dan bimbingan secara efektif sehingga potensi siswa dapat berkembang secara optimal.', 'mengembangkan berbagai potensi siswa agar menjadi manusia beriman dan bertaqwa kepada Allah SWT, berakhlaq mulia, sehat, berilmu, cakap, kreatif, mandiri dan menjadi warga negara yang demokratis serta bertangung jawab atas terwujudnya masyarakat Islam yang sebenar-benarnya', '', '-78,508', '1,103,344', '1300', '0'),
('SD', 'Sekolah / Madrasah DIY', 20400460, '2955/L.1886/DIY.70/7', '1970-08-01', 'DERMAN, SUMBERMULYO, BAMBANGLIPURO, BANTUL, YOGYAK', 'SUMBERMULYO', 8, 1, '85102113198', 'sdmuhsumbermulyo@yahoo.co.id', 'www.....', 'A', 'Dd.000331', 'KTSP dan K', 'MEMBENTUK MANUSIA YANG BERIMAN, INSAN BERTAQWA, BERAKHLAK MULIA, CERDAS, TERAMPIL, MANDIRI, BERGUNA BAGI MASYARAKAT, SERTA BERTANGGUNG JAWAB TERWUJUDNYA MASYARAKAT ISLAM YANG SEBENAR-BENARNYA', '1MENINGKATKAN KINERJA TENAGA KEPENDIDIKAN, MENGALANG SUASANA AKOMODATIF, ADAFTIF DAN KETERBUKAAN, 2. MENINGKATKAN EFEKTIFITAS KBM DENGAN NUANSA PAIKEM (PEMBELAJARAN AKTIF, INOVATIF, KREATIF, EFEKTIF, MENYENANGKAN3. MENINGKATKAN PEMAHAMAN DAN PENGAMALAN KEHIDUPAN YANG ISLAMI 4. MENANAMKAN JIWA PATRIOTIK MELALUI KEPANDUAN HIZBUL WATON (HW)', '1. MENGHASILKAN TAMATAN YANG BERAKHLAK MULIA2. MEMILIKI PENGETAHUAN, KETERAMPILAN, PRESTASI AKADEMIK MAUPUN NON AKADEMIK3.MENUMBUHKAN KEATIFITAS BELAJAR SISWA 4. MELALUI PEMBELAJARAN YANG TERINTEGRITAS DENGAN NILAI BUDAYA KARAKTER BANGSA DAPAT MENGHASILKAN PERILAKU ANAK YANG BERKARAKTER DAN BERBUDAYA', '', '-77.828', '1,103,608.10', '1200', '30'),
('SD', 'Sekolah / Madrasah DIY', 20400460, '2955/L.1886/DIY.70/7', '1970-08-01', 'DERMAN, SUMBERMULYO, BAMBANGLIPURO, BANTUL, YOGYAK', 'SUMBERMULYO', 8, 1, '85102113198', 'sdmuhsumbermulyo@yahoo.co.id', 'www.....', 'A', 'Dd.000331', 'KTSP dan K', 'MEMBENTUK MANUSIA YANG BERIMAN, INSAN BERTAQWA, BERAKHLAK MULIA, CERDAS, TERAMPIL, MANDIRI, BERGUNA BAGI MASYARAKAT, SERTA BERTANGGUNG JAWAB TERWUJUDNYA MASYARAKAT ISLAM YANG SEBENAR-BENARNYA', '1MENINGKATKAN KINERJA TENAGA KEPENDIDIKAN, MENGALANG SUASANA AKOMODATIF, ADAFTIF DAN KETERBUKAAN, 2. MENINGKATKAN EFEKTIFITAS KBM DENGAN NUANSA PAIKEM (PEMBELAJARAN AKTIF, INOVATIF, KREATIF, EFEKTIF, MENYENANGKAN3. MENINGKATKAN PEMAHAMAN DAN PENGAMALAN KEHIDUPAN YANG ISLAMI 4. MENANAMKAN JIWA PATRIOTIK MELALUI KEPANDUAN HIZBUL WATON (HW)', '1. MENGHASILKAN TAMATAN YANG BERAKHLAK MULIA2. MEMILIKI PENGETAHUAN, KETERAMPILAN, PRESTASI AKADEMIK MAUPUN NON AKADEMIK3.MENUMBUHKAN KEATIFITAS BELAJAR SISWA 4. MELALUI PEMBELAJARAN YANG TERINTEGRITAS DENGAN NILAI BUDAYA KARAKTER BANGSA DAPAT MENGHASILKAN PERILAKU ANAK YANG BERKARAKTER DAN BERBUDAYA', '', '-77.828', '1,103,608.10', '1200', '30'),
('SD', 'Sekolah / Madrasah DIY', 20400459, '125/KPTS/1991', '1991-04-01', 'JL. GEBLAGAN', 'TAMANTIRTO', 3, 1, '0274 4342726', 'sdmuhammadiyahtamantirto@yahoo', '-', 'A', '21.01/BAP-SM/TU/XXI/2013', 'KTSP dan K', 'Visi  SD Muhammadiyah Tamantirto adalah "Terwujudnya Peserta Didik Taqwa, Unggul, Cerdas, dan Islami".', 'Misi SD Muhammadiyah Tamantirto, yaitu : 1. Taqwa , 1.1 Melakssanakan pembelajara agama secara efektif dan mengimplementasikan dalam kehidupan peserta didik; 1.2 Menerapkan pendidikan dan karakter budaya bangsa melalaui kegiatan pengembangan diri dan budaya sekolah; 1.3 Dengan kesadaran sendiri siswa taat dan patuh melaksanakan semua perintah Tuhan Yang Mahasa Esa. , 2. Unggul, 2.1 Memupuk bakat dan potensi peserta didik melalui kegiatan ekstrakulikuler; 2.2 Melaksanakan lomba kreatifitas didik, 3. Cerdas, 3.1 Melaksanakan kegiatan pembelajaran yang efektif dengan pendekatan PAKEM; 3.2 Mengoptimalkan kegiatan pembelajaran dengan memanfaatkan sumber dan media pembelajaran ; 3.3 Memupuk kemampuan intelegensi sebagai bakat dasar yang dikembangan melalui pendidikan dan pengajaran sehingga siswa mampu menganalisa dan memecahkan masalah dengan baik, 4. Islami, 4.1 Menciptakan nuansa islami dalam setiap kegiatan. Memiliki keyakinan hati yang teguh kepada Tuhan Yang Maha Esa yang diucapkan secara lisan dan dilaksanakand engan perbuatan.', '1. Terdepan, terbaik dan terpercaya dalam hal ketaqwaan terhadap Tuhan yang Maha Esa; 2. Terdepan, terbaik, dan terpercaya dalam pengembangan potensi, kecerdasan, dan minat.; 3. Terdepan, terbaik dan terpercaya dalam perolehan nilai UAN; 4. Terdepan, terbaik dan terpercaya dalam persaingan masuk jenjang SMP dan Mts; 5. Terdepan, terbaik dan terpercaya dalam berbagai kompetensi akademik dan non akademik; 6. erdepan, terbaik dan terpercaya dalam persaingan secara global;7. Terdepn, terbaik dan terpercaya dalam pelayanan.', '-', '1,103,276', '-78.078', '1300', '3'),
('SD', 'Sekolah / Madrasah DIY', 20400466, '2956 L1887 DIY70 77', '1970-01-01', 'GLUNTUNG KIDUL', 'CATURHARJO', 9, 1, '85227851313', 'tegallayang2sdmuh@yahoo.co.id', '', 'A', 'Dd.070411', 'KTSP dan K', 'Terwujudnya insan yang "Unggul dalam Prestasi, Berakhlak Mulia, Taqwa, Menguasai Teknologi dan Berkarakter Indonesia."', '1.Melaksanakan pembelajaran PAIKEM dan bimbingan secara intensif untuk mencapai tingkat ketuntasan dan daya serap yang tinggi sehingga peserta didik  dapat masuk SMP sesuai pilihannya; 2. Mengkoordinasikan suasana sekolah kondusif bernuansa Islami; 3. Memperkuat Pendidikan Agama disertai pengamalannya; 4. Menumbuh kembangkan bakat dan kreatifitas siswa melalui berbagai kegiatan ekstra kurikuler; 5) Menanamkan rasa cinta tanah air dan bangga pada budaya lokal, daerah, serta Nasional guna membentuk  perilaku siswa yang berkarakter Indonesia.', '1) Meningkatkan  pencapaian Nilai rata-rata Ujian Akhir Sekolah (UAS) ; 2) Meraih rangking dalam Nilai rata-rata Ujian Akhir Sekolah; 3) memperoleh kejuaraan Lomba FLS2N ; 4) Mendapatkan prestasi bidang olah raga ; 5) Memperoleh kejuaraan bidang keagamaan', '', '-79,557', '1,102,784', '450', '0'),
('SD', 'Sekolah / Madrasah DIY', 20400468, '2933/l.1864/DIY.51/7', '1951-08-01', 'WONOKROMO I', 'WONOKROMO', 6, 1, '0274 4415045', 'wonokromo1@gmail.com', '', 'A', '22.01/BAP-SM/TU/X/2015', 'KTSP dan K', '" Terwujudnya pribadi yang cerdas , berprestasi, terampil dan berwawasan Islam "', '1. Meningkatkan kedisiplinan dan semangat keluarga serta komitmen terhadap tugas kepada semua warga sekolah untuk menuju sekolah yang berkualitas.', '1. Terbentuknya insan yang cerdas, berahlaq mulia, beriman dan bertaqwa kepada Tuhan YME', '', '-78,738', '1,103,934', '900', 'Bimo Net'),
('SD', 'Sekolah / Madrasah DIY', 20400476, '2960/L-1891/DIY-68/1', '1968-08-01', 'DAHROMO 1, SEGOROYOSO, PLERET, BANTUL', 'SEGOROYOSO', 6, 1, '274,441,415', 'sdm.wonokromo2@gmail.com', 'www.sdmwonokrom', 'A', '22.01/BAP-SM/TU/X/2015', 'KTSP dan K', ' TERBENTUKNYA PESERTA DIDIK YANG TAQWA, BERPRESTASI,  TERAMPIL, SERTA BERKEPRIBADIAN INDONESIA YANG ISLAMI', '1. Menumbuh kembangkan pendidikan agama (Islam) disertai pengamalannya, 2.Â Melaksanakan pembelajaran yang efektif dengan pendekatan PAIKEM.   3.Â Â Memberikan pelajaran tambahan di luar jam sekolah.  4.Â Mengadakan kegiatan ekstrakurikuler untuk pengembangan bakat.   5.Â Melaksanakan kegiatan olah raga dan mengikuti PORSENITAS secara rutin.  6.Â Memberikan penghargaan dan sanksi bagi siswa.    7.Â Melaksanakan kegiatan ekstrakurikuler HW, TSPM, Drumband, Tari, Hadroh, Mipa, computer,  9. Menanamkan nilai karakter yang islami dalam kehidupan sehari-hari.   8.Â Melaksanakan  muatan  lokal Bahasa Jawa, Bahasa Inggris, dan Pendidikan Batik.   9. Menanamkan nilai karakter yang islami dalam kehidupan sehari-hari.', '1. Melaksanakan kegiatan keagamaan secara rutin.\n2. Melaksanakan Kegiatan Pembelajaran yang efektif dengan menggunakan berbagai pendekatan, metode  dan media.\n3. Melaksanakan Pembinaan yang intensif terhadap kegiatan ekstra kurikuler.\n4. .Meningkatkan kualitas dan disiplin kerja.\n5. Pengadaan sarana dan prasarana yang memadai.\n6.  Menciptakan lingkungan kerja yang aman, nyaman bersih, indah dan  menyenangkan.\n7. Menjalin kerja sama dengan instansi terkait.\n8. Memberdayakan potensi masyarakat sekitar.\n\n', '-', '-78,816', '1,104,021', '450, 450', '30'),
('SD', 'Sekolah / Madrasah DIY', 20400463, '2941/L.1872/DIY.27/7', '1977-09-01', 'Sambeng I Poncosari Srandakan Bantul', 'PONCOSARI', 17, 1, '85228689212', 'Sd_Muhsambengsi@yahoo.co.id', '-', 'A', '10.01/BAP-SM/TU/XI/2012', 'KTSP dan K', ' TERWUJUDNYA PESERTA DIDIK YANG BERAKHLAK MULIA, CERDAS, UNGGUL DALAM PRESTASI DAN GENERASI ISLAMI .', '1. Meningkatkan pemahaman dan pengamalan ajaran agama islam yang berpedoman pada Al-Quran dan Hadist.', '1. Menumbuhkembangkan penghayatan serta pengamalan ajaran agama sehingga tercapai pribadi yang kuat penuh iman dan taqwa.', '', '110Â°14''16.41', '7Â°57''54.83"S', '900', '30'),
('MI', 'Sekolah / Madrasah DIY', 60714003, 'WI/6/PP.004/KTR/11/1', '1989-07-10', 'Kenteng, Demangrejo, Sentolo, Kulon Progo', 'DEMANGREJO', 58, 3, '', 'mimkenteng@yahoo.co.id', 'www.....', 'B', '22.01/BAP-SM/TU/X/2015', 'KTSP dan K', 'Visi MI Muhammadiyah Kenteng adalah Terwujudnya manusia muslim yang beriman, taqwa, berakhlak mulia, cerdas, terampil, dan bertanggung jawab.', '1. mencetak kader bangsa yang mempunyai keimanan yang kuat kepada Allah SWT dan memegang teguh ajaran islam. 2. mencetak kader bangsa yang taat menjalankan ajaran islam, menjauhi larangan- Nya dan mempunyai akhlak yang mulia. 3. mencetak kader bangsa yang memiliki kecerdasan intelektual, kecerdasan emosional, dan kecerdasan spiritual yang tinggi.', '1. terbentuknya pribadi muslim yang santun, degan mengedepankan pola pikir yang jernih. 2. meningkatkan pencapaian nilai rata-rata UN sesuai SKL. 3. berusaha meningkatkan peringkat sekolah sepuluh besar d tingkat UPTD PAUD DAN DIKDAS kecamatan Sentolo. 4. menjuarai lomba keagamaan, mata pelajaran, olahraga, dan bidang seni ditingkat kecamatan dan kabupaten sampa propinsi. 5. menumbuh kembangkan penghayatan dan pengamalan terhadap ajaran agama dalam rangka meningkatkan iman dan taqwa. 6. menanamkan budaya disiplin, jujur, dan bertanggung jawab.', 'Man jadda wa jada " barang siapa yang bersungguh-sungguh maka IA akan berhasil"', '-7,879,097', '110,200,753', '1300', '50'),
('MI', 'Sekolah / Madrasah DIY', 60713982, '78/124/C/I', '1978-04-12', 'Nogosari', 'PURWOSARI', 49, 3, '6290000000000.0', 'mi_muh_nogosari@yahoo.co.id', 'www.....', 'B', 'Dd 048261', 'KTSP dan K', 'mewujudkan generasi Qurani yang beriman, bertaqwa, berakhlak mulia, cerdas, terampil dan mandiri.', '1. Membiasakan membaca alquran. 2. Membiasakan shalat lima waktu. 3. Menciptakan suasana KBM dan bimbingan yang efektif/kondusif. 4. Mengembangkan pengetahuan dibidang IPTEK, Bahasa, Olah raga, danSeni budaya sesuai dengan bakat, minat dan potensi siswa. 5. membina kemandirian siswa melalui kegiatan pengembangan diri yang terencan dan berkesinambungan. 6. Menjalin kerjasama yang harmonis  antara warga sekolah dengan seluruh pemangku kepentingan', '1. Menanamkan akidah Islam peserta didik yang kuat, dan mampu mengamalkan ajaran agama Islam sesuai alquran dan dan al hadits. 2. Mewujudkan prestasi belajar peserta didik sesiuai standar kompetensi lulusan pada semua aspek mata pelajaran. 3. Membentuk kepribadian serta didik yang memiliki kecakapan hidup dan kemandirian.', 'Ikhlas beramal, berkarya dan bermoral', '-7,720,264', '110,185,105', '9000', '30'),
('MI', 'Sekolah / Madrasah DIY', 60713986, '3127/L-1993/DIY-76/7', '1977-09-01', 'Jln. Kartini Selo Barat Hargorejo Kokap Kulon Prog', 'HARGOREJO', 52, 3, '0274 367954', 'mimuhselo383@gmail.com', 'www.....', 'A', '22.01/BAP-SM/TU/X/2015', 'KTSP dan K', 'UNGGUL, BERPRESTASI, ISLMAI, DISIPLIN, DAN BERAKHLAK MULIA', '1. Memotivasi  Peserta didik agar dapat melaksanakan Ibadah Sehari-hari sesuai tuntunan Al Quran dan Ash Shunah 2.Meletakkan dasar - dasar ilmu pengetahuan dan tehnologi 3.Menyiapkan perserta didik yang unggul dan memiliki potensi 4. Membentuk peserta didik yang aktiv, kreativ, inovativ dan berkarakter', '1. Memotivasi  Peserta didik agar dapat melaksanakan Ibadah Sehari-hari sesuai tuntunan Al Quran dan Ash Shunah 2.Meletakkan dasar - dasar ilmu pengetahuan dan tehnologi 3.Menyiapkan perserta didik yang unggul dan memiliki potensi 4. Membentuk peserta didik yang aktiv, kreativ, inovativ dan berkarakter', 'UNGGUL , ISLAMI  DAN BERKARAKTER', '-7852118', '110111299', '900', '72'),
('MI', 'Sekolah / Madrasah DIY', 60714007, '77/009/C/1', '1977-11-01', 'SERANGREJO, KULWARU, WATES, KULON PROGO', 'KULWARU', 60, 3, '-7839452402', 'mimuhserangrejo@gmail.com', 'mimuhammadiyahs', 'A', 'Dd048257', 'KTSP dan K', 'TAPLUS'' Terampil, Akhlak Mulia, Peduli Lingkungan, Unggul dalam Prestasi, Siswa Mandiri', '1.Mengamalkan Ajaran Agama Islam dengan Efektif, 2.Menumbuhkan sikap Sopan, Santun dan Berbudi Luhur, 3.Menumbuhkan Cinta pada Alam dan Lingkungan sekitar, 4.Mengoptimalkan Pembinaan Prestasi, 5.Mengoptimalkan Kemandirian Siswa.', 'Meletakkan landasan pengetahuan kepribadian akhlak mulia dan membentuk generasi yang terampil, berprestasi, peduli lingkungan, dan membentuk siswa mandiri.', '', '-7,909,543', '110,120,258', '1300', '30'),
('MI', 'Sekolah / Madrasah DIY', 69854139, 'Kd.12.02/4/2978/2013', '0000-00-00', 'KALIWIRU', 'TUKSONO', 58, 3, '', 'mialfalaahmuh_kaliwiru@yahoo.c', 'www.....', '', 'no sk akreditasi', 'KTSP dan K', 'Terwujudnya Sumber Daya Manusia yang Islami, Berakhlak Mulia dan Unggul dalam Ilmu Pengetahuan.', '1. Menyelengarakan pendidikan dasar yang mengedepankan akhlakul karimah, 2. menyelengarakan pendidikan dasar berbasis kader, 3. menyelenggarakan pendidikan dasar yang menyatu dengan masyarakat, 4. Menyelengarakan pendidikan dasar berbasis karakter.', '1. Menyiapkan generasi yang berilmu dan berakhlak mulia, berguna bagi agama, bangsa dan negara 2 Menyiapkan geberasi berbasis kader 3. Menghasilkan peserta didik yang terampil, kreatif dan berprestasi.', 'To Be Anak Sholeh tur Sugih.', '-7879786', '110261083', '900', ''),
('SD', 'Sekolah / Madrasah DIY', 20402966, '3090/L.1956/DIY.28/7', '1928-01-07', 'JL. RAYA TRISIK, KENTENG, BANARAN, GALUR, KULON PR', 'BANARAN', 50, 3, '6290000000000.0', 'sdmbanaran1@gmail.com', '-', 'B', 'no sk akreditasi', 'KTSP', 'visi sekolah dasar muhammadiyah I banaran adalah terbentuknya pribadi muslim yang bertaqwa kepada Allah S.W.T, berakhlak mulia, santun, berkarakter, berbudi pekerti luhur serta unggul dalam prestasi, terampil, dalam bidang kesenian dan olahraga.', '1. Mengintensifkan pembelajaran agama islam serta mengembangkan penghayatan dan pengenalan syariat islam melalui kegiatan intrakurikuler dan ekstrakurikuler, 2. Megintensifkan pembelajaran dalam bidang akademik secara optimal, 3. Mengintensifkan pembelajaran komputer, 4. Meningkatkan pembinaan dan pengembangan diri dalam bidang seni dan Hizbul Wathan, 5. Meningkatkan pembinaan dalam bidang olahraga, 6. Mengadakan pembelajaran Al-Qur''an dan TPA, 7. Membiasakan Sholat Dhuha dan Dhuhur secara berjamaah.', '1. Mendasari keimanan dan ketaqwaan kepada Allah S.W.T, 2. Meningkatkan pembinaan akhlak siswa, 3. Peningkatan nilai SKBM dari kelas I-VI, 4. Dapat meraih kejuaraan akademik dan nonakademik di tingkat kabupaten, 5. Terwujudnya keterampilan di bidang teknologi informasi, 6. Terwujudnya keterampilan bidang seni, 7. Terlaksananya pembelajaran berwawasan lingkungan hidup pada mata pelajaran wajib, mulok, dan kurikuler, 8. Terwujudnya nilai-nilai karakter budi pekerti (sehat, jujur, disiplin, bertanggung jawab, budaya bersih, peduli sampah)', '-', '-7,967,294', '110,214,829', '450', '-'),
('SD', 'Sekolah / Madrasah DIY', 20402967, '3117/L-1983/DIY-69/7', '1969-01-01', 'Pedukuhan VII Kentang, Banaran, Galur, Kulon Progo', 'BANARAN', 50, 3, '0274 367954', 'sdm2banaran@gmail.com', '', 'A', '5.01/BAP-SM/TU/XI/2016', 'KTSP', 'Unggul dalam Prestasi Berakhlakul Karimah dan Berkarakter, serta Cinta Tanah Air', '1. Melaksanakan pembelajaran dan bimbingan dengan efektif sehingga siswa dapat berkembang secara optimal sesuai dengan potensi yang dimiliki 2. Menumbuhkan semangat keunggulan secara intensif kepada seluruh warga sekolah 3. Menumbuhkan penghayatan dan pengalaman terhadap ajaran agama Islam serta budaya bangsa sehingga menjadi sumber kearifan dalam bertindak 4. Melaksanakan peringatan hari-hari besar nasional', '1. Meningkatkan pencapaian nilai rata-rata US/M 2. Meningkatkan peringkat sekolah 3. Meningkatkan prestasi akdemik 4. Meningkatkan pembinaan tim olahraga 5. Mengoptimalkan kegiatan seni dan ketrampilan 6 Mengambangkan dan mengikuti kegiatan keagamaan', '', '-79.625', '1,102,172', '900', ''),
