('SD', 'Sekolah / Madrasah DIY', 20402871, '3119/L-1985/DIY-69/7', '1969-01-01', 'JLN. K.H. AHMAD DAHLAN KEDUNGGONG WATES', 'WATES', 60, 3, '274774577', 'sdmuh.kedunggong@gmail.com', '', 'B', 'Dd. 070585', 'KTSP', 'Terbentuknya lulusan yang beriman, bertakwa, dan berkemajuan', '1. Mengembangkan program pembelajaran \nsecara efektif, dan kreatif', '1. Tujuan Umum\nTujuan yang akan dicapai dalam penyelenggaraan pendidikan adalah membentuk kepribadian muslim yang berakhlak mulia, takwa, memiliki kemandirian, cerdas, dan berkemajuan sehingga sanggup menjadi kader persyarikatan', '', 'S7Â°52''6.1716', 'E110Â°9''3.862', '3500', '2');
 Terbentuknya manusia pembelajar yang bertaqwa, berakhlaq mulia, berkemajuan dan unggul dalam IPTEKS sebagai perwujudan tajdid dakwah amar ma ruf nahi munkar .\nIndikator  Visi:\na. Berprestasi dalam peningkatan mutu akademik, percaya diri untuk menuntut ilmu.\nb. Bertaqwa, menghayati agama sebagai panduan hidup dan kaya akan amal.\nc. Berbudaya, sanggup melangsungkan amal usaha dalam bidang budaya yang Islami, berguna bagi masyarakat Islam.\nd. Berkarakter, anggun dalam moral dan kebijaksanaan.\n\n', 'Misi SD Muhammadiyah Ledok Adalah:\na.   Mendidik manusia memiliki kesadaran ketuhanan (spiritual makrifat).\nb. Membentuk manusia berkemajuan yang memiliki etos tajdid, berfikir cerdas, alternatif dan berwawasan luas.\nc. Mengembangkan potensi manusia berjiwa mandiri, beretos kerja keras, wirausaha, kompetitif dan jujur.\nd. Membina peserta didik agar menjadi manusia yang memiliki kecakapan hidup dan ketrampilan sosial, tekhnologi, informasi dan komunikasi .\ne. Membimbing peserta didik agar menjadi manusia yang memiliki jiwa, kemampuan menciptakan dan mengapresiasi karya seni budaya.\nf. Membentuk kader persyarikatan, umat dan bangsa yang ikhlas, peka, peduli dan bertanggung jawab terhadap kemanusiaan dan lingkungan.\nMisi SD Muhammadiyah Ledok Adalah:\na.   Mendidik manusia memiliki kesadaran ketuhanan (spiritual makrifat).\nb. Membentuk manusia berkemajuan yang memiliki etos tajdid, berfikir cerdas, alternatif dan berwawasan luas.\nc. Mengembangkan potensi manusia berjiwa mandiri, beretos kerja keras, wirausaha, kompetitif dan jujur.\nd. Membina peserta didik agar menjadi manusia yang memiliki kecakapan hidup dan ketrampilan sosial, tekhnologi, informasi dan komunikasi .\ne. Membimbing peserta didik agar menjadi manusia yang memiliki jiwa, kemampuan menciptakan dan mengapresiasi karya seni budaya.\nf. Membentuk kader persyarikatan, umat dan bangsa yang ikhlas, peka, peduli dan bertanggung jawab terhadap kemanusiaan dan lingkungan.\n', '(jujur,disiplin,sopan ,rajin)\ng. Terlaksananyan pembelajaran berwawasan lingkungan hidup pada mata pelajaran wajib, mulok, maupun kurikuler dan terwujudnya sikap peduli lingkungan.\n2.    Rencana Operasional Sekolah 1 Tahun yang akan Datang\n     SD Muhammadiyah Ledok dalam tahun 2016/2017 untuk  mencapai tujuan, sekolah merencanakan kegiatan sebagai berikut:\na. Mengoptimalkan pembinaan bidang keagamaan melalui pembelajaran maupun pengembangan diri\nb. Mengoptimalkan pembelajaran berbasis SKL\nc. Mengoptimalkan penguasaaan calistung bagi kelas I-III\nd. Mengoptimalkan pembinaan seni dan olahraga melalui pembelajaran maupun pengembangan diri\ne. Mengimplementasikan pendidikan budi pekerti melalui keteladanan dan pembelajaran\nf. Mengoptimalkan pendidikan lingkungan hidup dalam proses pembelajaran wajib, mulok,dan ekstrakurikuler\ng. Menambah jumlah sarana untuk proses pembelajaran\n\nG. Strategi Pencapaian Tujuan \n1.Beriman dan bertaqwa kepada Tuhan Yang Maha Esa\n SD Muhammadiyah Ledok melakukan strategi melaksanakan tadarus\n Al-Qur an sebelum pembelajaran ,sholat dhuha dan melaksanakan sholat dzuhur berjamaah.\n2.Berprestasi dalam bidang akademik dan non akademik\na. Mengadakan les atau jam tambahan pelajaran untuk meningkatkan prestasi akademik bagi kelas IV,V dan VI\nb. Memprioritaskan kegiatan baca ,tulis,dan hitung bagi siswa kelas rendah\nc. Mengadakan Ekstrakurikuler tari, Drum Band, Hisbul wathon/ HW,Karawitan, dan Tapak Suci untuk meningkatkan prestasi non akademik dan mengikutsertakan siswa dalam berbagai lomba non akademik seperti lomba tari dan olahraga\n3.Berkarakter/berbudi pekerti yang luhur\n    Memberikan keteladanan dan pembelajaran budi pekerti pada anak \n(Jujur, disiplin, sopan, rajin)\n4.Berbudaya hidup dengan lingkungan yang bersih dan sehat\n Mengoptimalkan pendidikan lingkungan hidup dalam proses      pembelajaran,melaksanakan piket sekolah,melaksanakan Jum at bersih\n5.Berwawasan teknologi yang maju\n            Memberikan pembelajaran TIK/Komputer untuk terwujudnya keterampilan di   \n             bidang Teknologi Informasi\n         6.Berbudaya lokal yang luhur\n            a.Menggunakan bahasa Jawa setiap hari Sabtu\n            b.Menggunakan pakaian adat pada hari besar nasional seperti hari Kartini\n            c. Mengembangkan permainan lokal seperti jamuran, egrang, bola bekel, dll.\n', '', '-79,023', '-7.9244000/1', '900', 'TELKOMSEL'),
