('SD', 'Sekolah / Madrasah DIY', 20402857, '08/VII/1929', '1929-07-01', 'Wonopeti,Karangsewu,Galur,Kulon Progo', 'KARANGSEWU', 50, 3, '', 'sdmuhwonopeti_1@yahoo.com', '', 'B', 'no sk akreditasi', 'KTSP dan K', 'a. Visi Sekolah SD Muhammadiyah 1 Wonopeti "  Terbentuknya akhlakul karimah, unggul dalam prestasi, terampil, berbudaya berdasarkan Al Quran dan Sunnah Rosul"                                                                                                   b. Indikatornya                                                                                     1)  Siswa lulus, khatam Al Quran                                                  2) Siswa kelas 5 hafal surat At Dhuha - surat Al Balad                   Siswa kelas 4 hafal surat Al ''Alaq - surat Fajr                       Siswa kelas 3 hafal surat Al Bayyinah - Surat Attin           Siswa kelas 2 hafal surat Ai humazah - surat Al Zalzalah Siswa kelas 1 hafal surat Annas - surat Al asr                            3) Siswa kelas 3 sampai 6 membiasakan sholat dhuha           4) Siswa kelas 3 sampai 6 membiasakan jamaah sholat dhuhur                                                                                                 5) Unggul dalam olimpiade MIPA                                                 6) Unggul dalam lomba kesenian                                                 7) Siswa kelas 3 mampu menghasilkan karya anyam dari enceng gondok                                                                        8) Siswa kelas 5 mampu menghasilkan karya batik sederhana                                                                                 9) Berkarakter bangsa yang luhur', 'Misi SD Muhammadiyah 1 Wonopeti             a. Membiasakan tadarus Al Quran sebelum pelajaran dimulai                                               b. Membiasakan sholat dhuha                         c.  Membiasakan jamaah sholat dhuhur                                                  d. Mengupayakan pembelajaran dengan  pendekatan PAKEM                                        e.  Mengupayakan PBM yang efektif sehingga potensi siswa berkembang secara optimal.                                                                f.  Mengintensifkan pembinaan Olimpiade MIPA.                                                                  g.  Menciptakan kondisi sekolah yang kondusif sehingga tumbuh semangat kerja yang intensif.                                                     h.Â  Mengadakan pembinaan keterampilan anyam, batik melalui kegiatan ekstrakurikuler. i. Membiasakan 3S, kerja keras, dan unggah ungguh basa', 'a. Dapat membaca Al Qur an dengan benar dan menjalankan sholat lima waktu               b. Berperilaku sesuai norma masyarakat dan agama                                                                c . Meningkat rata-rata ujian nasional :                   1)  Tahun pelajaran 2016/2017 dari 24,75 menjadi 25,25                                                  2) Tahun pelajaran 2017/2018 dari 25,25 menjadi 25,75                                                 3) Tahun pelajaran 2018/2019 dari 25,75 menjadi 26,00                                                  4) Tahun pelajaran 2019/2020 dari 26,00 menjadi 26,25                                                  d.  Meningkat peringkat sekolah menjadi 10 besar perolehan rata-rata nilai UN           e.Berkembang ketrampilan karya tepat guna dan budi daya tanaman holtikultura guna menumbuhkan jiwa wira usaha             f. Memiliki wawasan dan peduli pada lingkungan                                                        g.  Pengadaan sarana prasarana pembelajaran sesuai kebutuhan                    h.  Mewakili Kab dalam Olimpiade MIPA tingkat DIY', '', '-79.472', '1,102,052', '1300', '1'),
