('MI', 'Sekolah / Madrasah DIY', 60714054, '41081.202 DIY.721983', '1983-08-31', 'JL. KI AGENG GIRING', 'SODO', 23, 2, '8170421032', 'mimuh_sodopaliyan@yahoo.co.id', 'www.....', 'B', 'Dd070986', 'KTSP dan K', 'terwujudnya manusia yang taqwa, berakhlak mulia, berkepribadian islami, berilmu terampil dan mampu mengaktualisasikan diri dalam kehidupan bermasyarakat', '1 menciptakan lembaga pendidikan islami yang berkualitas\n2 menyiapkan kurikulum yang mampu memenuhi kebutuhan anak didik dan masyarakat\n3 menyiapkan tenaga pendidik yang profesional dan memiliki potensi pada bidangnya\n4 menyelenggarakan proses pembelajaran yang menghasilkan lulusan yang berprestasi\n', 'memberikan bekal kemampuan dasar pada siswa dalam ilmu agama dan ilmu pengetahuan umum serta mampu mengamalkan dalam kehidupan bermasyarakat dan beragama.', 'unggul, mandiri, berprestasi, bertaqwa dan berakhlak mulia', '-79761705', '1105915045', '900', '30'),
