('SD', 'Sekolah / Madrasah DIY', 20402170, '068/III.4/F/2002', '2002-07-03', 'JL. MAYANG, GADUNGSARI', 'WONOSARI', 35, 2, '0274 391147', 'sdmujahidin@yahoo.co.id', 'www.sdmujahidin', 'A', '22.01/BAP-SM/TU/X/2015', 'KTSP dan K', 'Visi SD Muhammadiyah Al Mujahidin Wonosari adalah unggul dalam prestasi bertumpu pada pribadi yang bertakwa dan berakhluk karimah.', '1. Meningkatkan kualitas pembelajaran, 2. Menyelenggarakan pendidikan dan pelatihan untuk mengembangkan bakat dan minat siswa, 3.Menyelenggarakan bimbingan konseling dan pengembangan diri, 4. Menyelenggarakan pendidikan dalam rangka peningkatan jiwa nasionalisme, 5. Menyelenggarakan pendidikan untuk menumbuhkan kecakapan hidup, 6. Menyelenggarakan pendidikan ketaqwaan kepada Allah SWT, 7. Melaksanakan sistem pendidikan islami, 8. Membudayakan tertib menjalankan ibadah, 9. Mendidik membaca dan menghafal Al Qur''an, 10. Menyelenggarakan pendidikan untuk menumbuhkan kesadaran lingkungan dan jiwa sosial, 11. Melaksanakan pendidikan karakter dan akhlakul karimah melalui budaya sekolah, 12. Menumbuh kembangkan semangat beramal sholeh dan berkompetisi prestasi.', 'Tujuan Sekolah jangka pendek : 1. Menghasilkan lulusan yang menguasai konsep dasar ilmu yang kuat dan religius, 2. Menghasilkan lulusan yang mampu berkompetisi di SMP/MTs unggulan dan pondok pesantren terkemuka, 3. Menghasilkan lulusan yang beraqidah kuat, dan tertib menjalankan ibadah, 4. Menghasilkan lulusan yang lancar membaca Al Qur''an dan hafal Al Qur''an juz XXX, 5. Menghasilkan lulusan yang berkarakter, memiliki jiwa nasionalisme dan berakhlakul karimah. Tujuan sekolah jangka panjang : 1. Terselenggaranya pendidikan yang komprehensif dengan mengacu pada kecerdasan majemuk siswa, 2. Terlaksananya pembinaan golden habits siswa, 3. Terselenggaranya sistem pendidikan islami dan menyenangkan, 4. Terbangunnya kerjasama pendidikan yang intensif antara sekolah dan orangtua, 5. Menghasilkan lulusan yang menguasai konsep dasar ilmu yang kuat, kompetitif dan religius, 6. Menghasilkan lulusan yang beraqidah kuat, dan tertib menjalankan ibadah, 7. Menghasilkan lulusan yang lancar membaca Al Qur''an dan hafal Al Qur''an, 8. Menghasilkan lulusan yang berkarakter, memiliki jiwa nasionalisme dan berakhlakul karimah.', 'Membangun Kecerdasan dan keshalihan.', '-79,678', '1,106,097', '67300', '10'),
