('SD', 'Sekolah / Madrasah DIY', 20402148, '3174/L-2008/DIY.68/7', '1977-09-01', 'Jl. Manthous Km. 2', 'PLAYEN', 26, 2, '6280000000000.0', 'sdm.bogor@yahoo.co.id', '', 'A', 'Dd.070826', 'KTSP dan K', 'visi SD Muhammadiyah Bogor adalah menjadi sekolah yang unggul dalam membentuk pribadi muslim yang cerdas, sehat, berakhlak mulia, berbudaya dan berwawasan global.', '1. Membiasakan disiplin belajar di rumah, disekolah dan di masyarakat, 2. Membiasakan perilaku sehat di lingkungan rumah, sekolah dan masyarakat, 3. Membiasakan perilaku peduli lingkungan rumah, sekolah dan masyarakat, 4. Membiasakan perilaku akhlakul karimah di sekolah maupun di lingkungan masyarakat, 5. Membiasakan perilaku disiplin disekolah maupun di lingkungan masyarakat, 6. Membiasakan lima S (senyum, salam, sapa, sopan, santun), 7. Menyelenggarakan pembelajaran kontekstual berbasis budaya, 8. Membiasakan budaya disiplin di lingkungan rumah, sekolah dan masyarakat, 9. Membiasakan berbahasa santun dilingkungan rumah, sekolah dan masyarakat, 10. Sekolah melaksanakan pembelajaran bahasa Inggris dan pembelajaran teknologi informasi, 11. Sekolah mengembangkan kemampuan berfikir secara luas', 'Terselenggaranya pendidikan Islam yang bermutu untuk mengantarkan peserta didik unggul dalam kepribadian, kompetensi, dan karya serta berdaya saing tinggi untuk terwujudnya masyarakat utama', 'Kerjaku Ibadahku', '-79,471', '1,105,672', '900', '30'),
