('SD', 'Sekolah / Madrasah DIY', 20402146, '3186/L-2020/DIY-72/7', '2016-09-01', 'Kemiri, Semugih, Rongkop', 'SEMUGIH', 12, 2, '6280000000000.0', 'sdmuhdawung01@gmail.com', '', 'B', 'Dd.048162', 'KTSP', 'Unggul dalam prestasi, berjiwa wirausaha, berakhlak mulia, berwawasan global berlandaskan IMTAQ dan IPTEK', '1. Meningkatkan PBM yang efektif, efisien dan menyenangkan.  2. Meningkatkan pelayanan pendidikan dan tanggung jawab terhadap pendidikan.  3. Meningkatkan sumber daya insan yang berguna bagi agama, nusa dan bangsa.  4. Meningkatkan pemahaman isi kandungan Al- Quran.  5. Meningkatkan kualitas kehidupan Islami di sekolah, keluarga dan masyarakat.  6. Mengembangkan pengetahuan di bidang IPTEK, bahasa, olahraga dan seni budaya sesuai dengan bakat, minat dan potensi siswa.', '1. Peserta didik dapat menerima pembelajaran dengan mudah dan menyenangkan.  2. Peserta didik dan warga sekolah dapat dengan mudah menerima segala bentuk pelayanan terkait pendidikan di SD Muhammadiyah Dawung.  3. Peserta didik dapat berprestasi dibidang seni baca Al-Quran, seni lukis, dan mata pelajaran.  4. Peserta didik memiliki kualitas iman dan takwa, yang ditandai dengan kemampuan membaca dan menghafal Al-Quran, rajin mengerjakan shalat dan berakhlakul karimah.  5. Terwujudnya kehidupan islami di lingkungan sekolah dengan suasana kerja yang kondusif dan menyenangkan semua warga sekolah.  6. Memiliki sarana dan prasarana sekolah yang lengkap dan memadai sehingga peserta didik dapat mengembangkan IPTEK dan berprestasi sesuai dengan bakat dan minatnya masing-masing.', '', '', '', '450', ''),
