('SD', 'Sekolah / Madrasah DIY', 20402142, '317/L.2009/DIY-69/77', '1969-01-01', 'GROGOL 1/1', 'GROGOL', 23, 2, '87839881446', 'muhgrogolsd@yahoo.co.id', 'www.....', 'B', '28.2/BAP/TU/X/2011', 'KTSP', 'Visi Sekolah Dasar Muhammadiyah Grogol adalah Unggul dalam Moralitas, Intelektualitas, Kemandirian dan Berbudaya.', 'Misi Sekolah Dasar Muhammadiyah Grogol adalah:1. Mewujudkan peserta didik yang bertaqwa , berakhlak mulia. 2. Mewujudkan peserta didik yang mampu mengembangkan ilmu pengetahuan ddan teknologi. 3. Mewujudkan peserta didik yang cakap, percaya diri dan terampil. 4. Membiasakan dan melestarikan budaya lokan dan global.', 'Tujuan Sekolah Dasar Muhammadiyah Grogol adalah:  1. Tujuan Jangka Panjang ( 8 tahunan ) adalah ( a ). Taat beribadah sesuai agama islam.   ( b ) . Ber prestasi dalam bidang akademik tingkat Provinsi. ( c ). Cakap, percaya diri, berprestasi bidang non akademik tingkat Provinsi. ( d ). Terbiasa Melakukan 5 S, 7K dan melestarikan budaya lokal serta global dalam berbagai kegiatan. 2. Tujuan Jangka Menengah 9 4 Tahunan ). ( a). Melaksanakan sholat wajib dan sholat dhuha berjamaah secara rutin, hafal al- qur''an juz 30 dan berakhlak mulia. ( b). Berprestasi dalam bidang akademik tingkat kabupaten masuk lima besar.     ( c ). Cakap, percaya diri, terampil, berprestasi bidang non akademik tingkat kabupaten masuk lima besar.     ( d). Terbiasa Melakukan 5 S, 7 K dan melestarikan budaya lokal serta global dalam 10 kegiatan. 3. Tujuan Jangka Pendek ( tahun 2016/2017 ).      ( a ). Melaksanakan sholat wajib dan sholat dhuha berjamaah secara rutin, hafal 24 surat dan berakhlak mulia. ( b). Berprestasi dalam bidang akademik tingkat kabupaten masuk lima besar. ( c ). Cakap, Percaya diri, terampil, berprestasi bidang non akademiktingkat kabupaten masuk lima besar. ( d ). Terbiasa melakukan 5 S, 7K dan melestarikan budaya lokal serta global dalam 4 kegiatan.', '', '-79,792', '1,105,378', '900', '30'),
